INSERT INTO `faq` (`faq_id`, `faq_numero`, `faq_orden`, `idi_code`, `faq_pregunta`, `faq_respuesta`) VALUES
(1, 1, 1, 'es', 'Cómo me puedo registrar en Sistema?', 'El registro en Sistema es simple y gratuito, solo necesitas ingresar a la página de inicio de nuestro sitio web (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) o bien descargar y abrir la aplicación, luego hacer clic en « <a href=\"https://www.Sistema.com/\">Registrate</a> », completar los campos con los datos de país, idioma y correo electrónico de tu negocio, asignar la contraseña a tu cuenta, y aceptar los términos y condiciones de Sistema.\r\n\r\nTambién puedes optar por hacer un registro directo a través de las siguientes redes sociales: Facebook, Google+'),
(2, 1, 1, 'en', 'How can I sign up on Sistema?', 'Signing up on Sistema is simple and free, all you have to do is visit the homepage of our website (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) or download and open the app, then click on « <a href=\"https://www.Sistema.com/\">Sign up</a> », filling the fields with your country, language and the email address of your business, assign a password to your account, and accept the terms and conditions of Sistema.\r\n\r\nYou can also choose to make a direct registration through the following social media networks: Facebook, Google+'),
(3, 2, 2, 'es', 'Tiene algún costo mi registro?', 'El registro en Sistema es gratuito, y siempre lo será. '),
(4, 2, 2, 'en', 'Does signing up have any costs?', 'Signing up on Sistema is free, and always will be.'),
(5, 3, 3, 'es', 'Olvidé la contraseña de mi cuenta.', 'Si olvidaste la contraseña de tu cuenta en Sistema, solo necesitas ingresar a la página de inicio de nuestro sitio web (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) o bien descargar y abrir la aplicación, en el panel de ingreso, hacer clic en « <a href=\"https://www.Sistema.com/\">Solicitar</a> », completar el campo con el correo electrónico de tu cuenta en Sistema para que te enviemos automáticamente un link de acceso al panel donde podrás establecer una nueva contraseña para tu cuenta.'),
(6, 3, 3, 'en', 'I forgot my account´s password.', 'If you forgot your Sistema account password, you only need to visit the home page of our website (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) or download and open the app, on the login panel, click on « <a href=\"https://www.Sistema.com/\">Request</a> », complete the field with the email of your Sistema account so that we can automatically send you a link to the panel where you can establish a new password for your account.'),
(7, 4, 4, 'es', 'Cómo puedo encontrar contactos para mis productos o servicio de interés?', 'Si deseas localizar nuevos contactos comerciales en Sistema, potenciales clientes o proveedores, interesados en los productos o servicios que forman parte del núcleo de tu negocio, primero necesitas cargar lo que tú ofreces o buscas en tu cuenta de Sistema.\r\n\r\n1)	Ingresa a la página de inicio de nuestro sitio web (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) o bien descarga y abrí la aplicación.\r\n\r\n2)	Tras loguearse en el sistema, la carga se realiza en forma individual en los paneles « <a href=\"https://www.Sistema.com/productos/index/1\">Mis ofertas</a> » y « <a href=\"https://www.Sistema.com/productos/index/2\">Mis demandas</a> ». La información cargada en estos paneles nos permiten localizar y conectar aquellos usuarios de intereses complementarios.\r\n\r\nEn el panel de « <a href=\"https://www.Sistema.com/productos/index/1\">Mis ofertas</a> » se cargarán los productos o servicios que vendes. En el panel de « <a href=\"https://www.Sistema.com/productos/index/2\">Mis demandas</a> » se cargarán los productos o servicios que deseas adquirir.\r\n\r\n3)	Situado en panel deseado, haces clic en el signo + para agregar un nuevo producto o servicio, y luego completas la siguiente información clave en cada campo correspondiente:\r\n\r\n« Producto o servicio »: Ingresando palabras, frases o los 6 primeros dígitos de código del Sistema Armonizado (*) de tus productos, buscas y seleccionas en el Nomenclador las descripciones que más se ajustan a los productos o servicios a cargar.\r\n« País »: Eliges el país donde se encuentra tu negocio y donde toma lugar la oferta o demanda cargada.\r\n« Ciudad »: Eliges la ciudad donde se encuentra tu negocio y donde toma lugar la oferta o demanda cargada.\r\nSi tu negocio se encuentra en varios países y ciudades podes optar por seleccionar aquel país y ciudad que esté activamente involucrado en la transacción o bien puedes cargar varias veces el producto o servicio utilizando todas las combinaciones de países y ciudades donde se encuentre tu negocio en base a tu  criterio.\r\n« Detalle »: En este campo describes brevemente las particularidades de los productos o servicios que no contempla la descripción del nomenclador y que ayudarán al resto de los usuarios a conocer mejor tu oferta o demanda,  aumentando las posibilidades de su comercialización (utilizando como máximo 255 caracteres).\r\n« Correo electrónico »: Puedes incorporar todos los correos electrónicos donde desees que el resto de los usuarios de Sistema se contacten con motivo de la comercialización de los productos o servicios en cuestión, o simplemente dejar el correo electrónico predeterminado de tu registro.\r\n« Idioma »: Puedes incorporar otros idiomas que manejes tú o las personas que reciben los correos electrónicos en las cuentas informadas previamente. \r\n« Imágenes »: Puedes subir todas las imágenes que desees sobre los productos o servicios en cuestión.\r\n\r\n4) Por último guarda los cambios. Para confirmar que la carga se ha efectuado correctamente, deberás podes visualizar en el panel que corresponda la tarjeta con la información de producto o servicio cargado.\r\n\r\n(*) El Sistema Armonizado (SA) es una nomenclatura internacional definida por la Organización Mundial de Aduanas (OMA) para la clasificación de los productos. Permite a los países participantes clasificar los productos comercializados en una base común con fines aduaneros. A nivel internacional, el Sistema Armonizado de clasificación de mercancías es un sistema de código de seis dígitos. Esta nomenclatura no aplica para servicios, los cuales se clasifican bajo una nomenclatura adicional específica desarrollada por la Organización Mundial del Comercio (OMC).'),
(8, 4, 4, 'en', 'How can I find contacts for my products or service of interest?', 'If you want to locate new business contacts in Sistema, potential customers or suppliers, interested in the products or services that are part of the core of your business, you first need to upload what you offer or look for in your Sistema account.\r\n\r\n1) Go to the homepage of our website (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) or download and open the app.\r\n\r\n2) After logging in the system, upload must be done individually in the panels on « <a href=\"https://www.Sistema.com/productos/index/1\">My offers</a> » and « <a href=\"https://www.Sistema.com/productos/index/2\">My demands</a> ». The information uploaded on these panels allows us to locate and connect those users with complementary interests.\r\n\r\nOn « <a href=\"https://www.Sistema.com/productos/index/1\">My offers</a> » panel you will upload the products or services that you sell. On « <a href=\"https://www.Sistema.com/productos/index/2\">My demands</a> » panel you will upload the products or services you want to purchase.\r\n\r\n3) Locate the desired panel, click on the + sign to add a new product or service, and then complete the following key information in each corresponding field:\r\n\r\n« Product or service »: By entering words, phrases or the first 6 digits of the Harmonized System (*) of your products, search and select the Nomenclator  descriptions that best fit your products or services to be uploaded.\r\n« Country»: Choose the country where your business is located and where the offer or demand takes place.\r\n« City »:  Choose the city where your business is located and where the offer or demand takes place.\r\nIf your business is in several countries and cities you can choose to select the country and city that most actively involved in the transaction or you can upload the product or service several times using all combinations of countries and cities where your business is based in your criteria.\r\n« Detail »: In this field briefly describe the particularities of the products or services that the description of nomenclature does not contemplate and that will help the rest of the users to know better your offer or demand, increasing the possibilities of its commercialization (using at max. 255 characters).\r\n« E-mail »: You can add all the emails where you want the rest of Sistema users contact you for the commercialization of those products or services, or simply use the default e-mail of your sign up.\r\n« Language »: You can add other languages that you or the other people that receive the emails in the accounts manage.\r\n« Images »: You can upload all the images you want of the products or services.\r\n\r\n4) Finally saves the changes. To confirm that the upload has been correctly saved, you should be able to display the card with the uploaded product or service information on the corresponding panel.\r\n\r\n(*) The Harmonized System (HS) is an international nomenclature defined by the World Customs Organization (WCO) for the classification of products. It allows participating countries to classify products marketed on a common basis for customs purposes. At the international level, the Harmonized Goods Classification System is a six-digit code system. This nomenclature does not apply to services, which are classified under a specific additional nomenclature developed by the World Trade Organization (WTO).'),
(9, 5, 5, 'es', 'Qué pasa si no encuentro mi producto o servicio entre las descripciones del Nomenclador?', 'Si en el campo « Producto o servicio » no encuentras descripciones que se ajusten a tu búsqueda intenta con alguna de las siguientes opciones:\r\n\r\n« Clasificación manual »: Mediante la « Clasificación Manual » (lupa) puedes tener acceso al Nomenclador completo para clasificar, en 3 pasos, eligiendo las descripciones que más se ajusten a tus productos o servicios.\r\n\r\n« Consulta a experto »: Puedes consultarle a un experto en operaciones de exportación o importación (Despachante de Aduana) en tu país cual es el código del Sistema Armonizado (*) correspondiente para tu producto, que según su composición o criterios de clasificación puede tener 1 o varios códigos, en caso de existir varios opta por carga todos (obviar esta opción en caso de servicios).\r\n\r\n« Consulta en internet »: Una opción muchas veces útil, aunque no tan precisa, es consultar en el buscador de internet cual es el Código del Sistema Armonizado (*) para tu producto y analizar la información que otorga la web. En todo caso cargar utilizando los 6 primeros dígitos de los distintos Códigos de Sistema Armonizado (*) encontrados cuyas descripciones por tu criterio personal consideras se ajustan más a tu producto (obviar esta opción en caso de servicios).\r\n\r\n(*) El Sistema Armonizado (SA) es una nomenclatura internacional definida por la Organización Mundial de Aduanas (OMA) para la clasificación de los productos. Permite a los países participantes clasificar los productos comercializados en una base común con fines aduaneros. A nivel internacional, el Sistema Armonizado de clasificación de mercancías es un sistema de código de seis dígitos. Esta nomenclatura no aplica para servicios, los cuales se clasifican bajo una nomenclatura adicional específica desarrollada por la Organización Mundial del Comercio (OMC).'),
(10, 5, 5, 'en', 'What happens if I do not find my product or service among the Nomenclator descriptions?', 'If you can not find descriptions that match your search in the « Product or service » field, try one of the following options:\r\n\r\n« Manual classification »: With the « Manual classification » (magnifying glass) you can access the complete nomenclature to classify, in 3 steps, choosing the descriptions that best fit your products or services.\r\n\r\n« Consult an expert »: You can consult an expert in export or import operations (Customs Broker) in your country which is the code of the Harmonized System (*) corresponding to your product given that according to its composition or classification criteria can have 1 or more codes. If there are more than one codes opt for uploading all (skip this option in case of services).\r\n\r\n« Internet consultation »: An option that is many times useful, but not so precise, is to consult the Internet browser which is the Harmonized System Code (*) for your product and analyze the information provided by the website. In any case upload using the first 6 digits of the different Harmonized System Codes (*) found whose descriptions by your personal criterion you consider are more fit to your product (avoid this option in case of services).\r\n\r\n(*) The Harmonized System (HS) is an international nomenclature defined by the World Customs Organization (WCO) for the classification of products. It allows participating countries to classify products marketed on a common basis for customs purposes. At the international level, the Harmonized Goods Classification System is a six-digit code system. This nomenclature does not apply to services, which are classified under a specific additional nomenclature developed by the World Trade Organization (WTO).'),
(11, 6, 6, 'es', 'Que información relevante podré observar de cada resultado?', 'Tras haber cargado tus productos o servicios en los paneles « <a href=\"https://www.Sistema.com/productos/index/1\">Mis ofertas</a> » y « <a href=\"https://www.Sistema.com/productos/index/2\">Mis demandas</a> », automáticamente se localizaran y mostraran en tu panel de « <a href=\"https://www.Sistema.com/resultados/\">Resultados</a> » aquellos usuarios que estén buscando u ofreciendo, los productos o servicios correspondientes en base a lo que tú has especificado.\r\n\r\nEn el panel de « <a href=\"https://www.Sistema.com/resultados/\">Resultados</a> » podrás visualizar de cada una de las ofertas y demandas localizadas en base a tus intereses:\r\n\r\no	Si el usuario está buscando adquirir u ofreciendo el producto o servicio.\r\no	Las imágenes del producto o servicio que haya subido el usuario.\r\no	Descripción de la nomenclatura sobre el producto o servicio de interés coincidente entre tú y el usuario.\r\no	Detalles particulares del producto o servicio, especificados por el usuario. \r\no	País y ciudad donde radica el negocio del usuario.\r\no	Idiomas que el usuario maneja.\r\no	Correos electrónico que el usuario suministrado para ser contactado.\r\no	Último acceso a Sistema.\r\no	Calificación asignada por otros usuarios.\r\no	Cantidad de usuarios de Sistema que la han visto.\r\no	Referencias comerciales de usuario.\r\no	Estadísticas de comercio internacional sobre el producto en cuestión. '),
(12, 6, 6, 'en', 'What relevant information can I see from each result?', 'After loading your products or services in  « <a href=\"https://www.Sistema.com/productos/index/1\">My offers</a> » and « <a href=\"https://www.Sistema.com/productos/index/2\">My demands</a> » panels, the users that are looking for or offering the corresponding products or services will automatically be located and displayed in your « <a href=\"https://www.Sistema.com/resultados/\">Results</a> » panel based on what they you specified.\r\n\r\nIn the « <a href=\"https://www.Sistema.com/resultados/\">Results</a> » panel you can view each of the offers and demands located based on your interests:\r\n\r\no	If the user is looking to purchase or offer the product or service.\r\no	Images of the product or service uploaded by the user.\r\no	Description of the nomenclature about the product or service of common interest between you and the user.\r\no	Particular details of the product or service, specified by the user.\r\no	Country and city where the user´s business is based from.\r\no	Languages that the user handles.\r\no	Electronic mail that the user added in the contact.\r\no	Last access to Sistema.\r\no	Rating assigned by other users.\r\no	Number of Sistema users who have seen it. \r\no	Business user references.\r\no	International trade statistics on the product concerned.'),
(13, 7, 7, 'es', 'Que significa la « Calificación »?', 'La « Calificación » indica el promedio del nivel de importancia otorgado (del 1 al 5) por usuarios de Sistema a la oferta o demanda determinada. Tú puedes calificar la cada publicación si lo deseas. La calificación es de carácter anónimo y sin motivos.'),
(14, 7, 7, 'en', 'What is the « Rating »?', 'The « Rating » indicates the average level of importance given (from 1 to 5) by Sistema users to the offer or demand. You can rate each publication if you wish. The rating is anonymous and does not need any explanation.'),
(15, 8, 8, 'es', 'Que significa el « Visto »?', 'El « Visto » indica la cantidad de usuarios de Sistema han ingresado a la oferta o demanda determinada para ver la información completa.'),
(16, 8, 8, 'en', 'What is « Seen » ?', '« Seen » indicates how many Sistema users have viewed the offer or demand publication to see the complete information.'),
(17, 9, 9, 'es', 'Que significan las « Referencias comerciales »?', 'Las « Referencias comerciales » indican que la cuentas de correo electrónico del usuario que ha publicado la oferta o la demanda han sido validadas por terceras cuentas de correo electrónico suministradas por el usuario, de la que tu puedes visualizar el @dominio. Las « Referencias comerciales » permiten obtener garantías relativas de la existencia del usuario en el negocio. A mayor número y calidad de los dominios de referencias comerciales, mayor será la calidad del usuario. Tú puedes validar cada publicación si lo deseas.'),
(18, 9, 9, 'en', 'What is « Commercial references »?', 'The « Commercial references » indicate that the email accounts of the user that has published the offer or demand have been validated by third email accounts supplied by the user, from which you can view the @domain. The « Commercial references » allow obtaining relative guarantees of the existence of the user in the business. The greater the number and quality of commercial referral domains, the greater the quality of the user. You can validate each publication if you wish.'),
(19, 10, 10, 'es', 'Que información estadística encuentras en cada resultado?', 'Estadísticas de comercio internacional sobre el producto en cuestión que te permitirán conocer en valores, por un lado el flujo de comercio bilateral existente entre tu país y el país del usuario, y por otro lado el flujo de comercio  que tiene el país del usuario localizado para con el resto del mundo. Ambos datos resultan de suma importancia ya que te mostrarán si existen exportaciones/importaciones (según corresponda) del producto en relación  con el mercado del usuario localizado, o bien si existe alguna barrera arancelaria o para-arancelaria que este bloqueando el comercio, y de registrarse actividad, si estas exportaciones/importaciones existentes han crecido o no durante los últimos 5  años.'),
(20, 10, 10, 'en', 'What statistical information do you find in each result?', 'Statistics of international trade of the product will allow you to know the values, on one hand the bilateral trade flow between your country and the country of the user, and on the other hand the trade flow that has the country of the user located, to the rest of the world. Both data are extremely important because it will show you if there are exports / imports of the product to the market of the localized user, or if there is a tariff or other barrier that is blocking trade, and if any activity exist, if these exports / imports have grown over the last 5 years or not.'),
(21, 11, 11, 'es', 'Que información de mi perfil resulta clave para potenciar las comunicaciones y los negocios?', 'En tu perfil de usuario de Sistema podrás ampliar información sobre tu persona y/o tu empresa, y optar si deseas que la misma sea visible para otros usuarios.\r\n\r\nUn perfil completo con información veraz denota un contacto fiable con quien comenzar a entablar conversaciones y relaciones comerciales. Sistema recomienda a los usuarios:\r\n\r\n1)	Establecer la mayor cantidad de vías de contacto para con el resto de los usuarios.\r\n2)	Evitar errores en la información suministrada.\r\n3)	Responder con celeridad a las consultas recibidas por las distintas vías establecidas.\r\n'),
(22, 11, 11, 'en', 'What information on my profile is key to boosting communications and business?', 'In your Sistema user profile you can add personal information about you  and / or your company, and opt if you want it to be visible to other users.\r\n\r\nA complete profile with truthful information shows a reliable contact with whom to start a conversations and business relationships. Sistema recommends users:\r\n\r\n1) Add the maximum number of contact information for the rest of the users. \r\n2) Avoid errors in the information provided.\r\n3) Respond quickly to the queries received by the various channels established.\r\n'),
(23, 12, 12, 'es', 'Que información muestra el panel de estadísticas de comercio internacional de tu país?', 'El panel de estadísticas de comercio internacional de tu país te mostrará un listado con aquellos productos exportados e importados por tu país que han registrado un mayor incremento en valores (USD FOB y CIF, respectivamente) comparando los montos totales anuales en los últimos 5 años registrados.  Así conocerás aquellos productos que han mejorado la dinámica de sus negocios internacionales.'),
(24, 12, 12, 'en', 'What information does your country´s international trade statistics panel show?', 'The international trade statistics panel of your country will show you a list of those products exported and imported by your country that have registered a greater increase in values (USD FOB and CIF, respectively) by comparing the total annual amounts in the last 5 years registered. That way you will know those products that have improved the dynamics of your international business.'),
(25, 13, 13, 'es', 'Que información muestra el panel de productos y servicios con mayor actividad?', 'El panel de panel de productos y servicios con mayor actividad te mostrará los productos y servicios que poseen más cantidad de cargas, ya sea como ofertas o bien como demandas, por parte de los usuarios de Sistema. Información clave a la hora de saber cuáles son las posiciones calientes en el mundo, o sea los códigos que presentan mayor cantidad de contactos.'),
(26, 13, 13, 'en', 'What information shows the most active products and services panel?', 'The panel of products and services with greater activity will show you the products and services that have more quantity of loads, either as offers or as demands, by the users of Sistema. Key information when you want to know what positions are more active in the world, or what codes have more uploads.'),
(27, 14, 14, 'es', 'Que es el panel de Mensaje a los usuarios?', 'En este panel podrás dejar consultas breves (de hasta 255 caracteres) relativas a un producto o servicio y a un mercado en partículas, para que sea respondida por cualquiera de los usuarios de Sistema.'),
(28, 14, 14, 'en', 'What is the Message to users panel?', 'In this panel you can leave brief queries (up to 255 characters) related to a product or service in special market, to be answered by any of the users of Sistema.'),
(29, 15, 15, 'es', 'Cómo puedo publicitar mi empresa en Sistema?', 'Si deseas publicitar en Sistema, por favor escribenos a <a href=\"mailto: advertising@Sistema.com\">advertising@Sistema.com</a>'),
(30, 15, 15, 'en', 'How can I advertise my business on Sistema?', 'If you wish to advertise on Sistema, please email us at <a href=\"mailto: advertising@Sistema.com\">advertising@Sistema.com</a>\r\n'),
(31, 16, 16, 'es', 'Cómo me comunico con el quipo de soporte de Sistema?', 'Si tienes alguna consulta o comentario sobre el funcionamiento del sitio, por favor escribenos a <a href=\"mailto: support@Sistema.com\">support@Sistema.com</a>'),
(32, 16, 16, 'en', 'How do I contact the Sistema support team?', 'If you have any questions or concerns about the operation of the site, please email us at <a href=\"mailto: support@Sistema.com\">support@Sistema.com</a>\r\n'),
(33, 1, 1, 'de', 'Wie kann ich mich bei Sistema registrieren?', 'Die Registrierung in Sistema ist einfach und kostenlos. Sie müssen nur auf unsere Website (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) gehen oder unsere App herunterladen. Klicken Sie dann auf « <a href=\"https://www.Sistema.com/\">Registrieren</a> », füllen Sie die Felder mit den Daten, Land, Sprache und E-Mail, Ihrer Firma aus, erstellen Sie ein Kennwort und akzeptieren Sie unsere Nutzungsbedingungen.\r\n\r\nSie können sich auch über die folgenden sozialen Netzwerke registrieren: Facebook, Google+'),
(34, 1, 1, 'ar', '؟ Sistema كيف أسجل على', ' بسيط و مجاني ، تحتاج فقط أن تزور الصفحة Sistema التسجيل في\r\n أو حمل و افتح التطبيق ، ثم <a href=\"https://www.Sistema.com/\">www.Sistema.com</a> الرئيسية لموقعنا\r\n ،و قم بتعبئة الحقول ببياناتك : البلد ، اللغة , <a href=\"https://www.Sistema.com/\">Sign up/اضغط على تسجيل</a> \r\nالبريد الالكتروني الخاص بعملك ، و أدخل كلمة مرور لحسابك ثم اضغط \r\n.Sistema على قبول للأحكام و الشروط الخاصة ب\r\n\r\nFacebook, Google+ :يمكن أيضاً أن تختار التسجيل عبر شبكات التواصل الاجتماعي التالية '),
(35, 1, 1, 'zh', 'Sistema 该如何登记注册？ ', '在Sistema上登记注册，手续简便，且分文不取。您只需进入我们网站的首页 （<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>）或是点击«<a href=\"https://www.Sistema.com/\">登记</a>»一词，下载并打开申请表格，将国籍、语言、公司邮箱等资料填入表格，给您的帐号指定一个密码，并表示接受Sistema的合约条文和条件便成。\r\n   \r\n您也可以选择通过下列社交网络直接进行登记：Facebook, Google+'),
(36, 1, 1, 'ko', 'Sistema가입 방법', 'Sistema가입은 간편하고 무료입니다. 웹 사이트 첫 페이지에 접속하시거나 어플리케이션을 다운받으신 후 «<a href=\"https://www.Sistema.com/\">가입하기</a>» 를 누르시고, 국가, 언어, 업무용 e-mail 를 입력하세요. 계좌 비밀번호를 지정하시고, Sistema의 가입 규정 및 조항을  수락하십시오.  \r\n\r\n다음과 같은 소셜네트워크를 통해 직접 가입도 가능합니다: Facebook, Google+\r\n'),
(37, 1, 1, 'ja', 'Sistemaに登録するにはどうすればいいでしょうか？', 'Sistemaには簡単に、無料で登録できます。SistemaのWebサイト（<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>）にアクセスするか、アプリケーションをダウンロードして開き、その後に「<a href=\"https://www.Sistema.com/\">登録</a>」をクリックし、国、言語及びあなたのビジネス用メールアドレスを入力した後、アカウント用のパスワードを指定し、使用条件に同意するだけです。\r\n\r\nまた、次のソーシャル・ネットワークを通じて直接登録を行うこともできます。\r\nFacebook, Google+'),
(39, 1, 1, 'pt', 'Como posso me registrar no Sistema?', 'O registro no Sistema é simples e gratuito, você só precisa entrar na página inicial do nosso web site (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) ou baixar o aplicativo. Depois de clicar em « <a href=\"https://www.Sistema.com/\">Registre-se</a> », preencha os espaços com os dados referentes a país, idioma e endereço de e-mail. Então, crie uma senha para a sua conta e aceite os termos e condições do Sistema.\r\n\r\nVocê também pode optar por fazer o registro diretamente através das seguintes redes sociais: Facebook, Google+'),
(40, 2, 2, 'de', 'Kostet meine Registrierung etwas?', 'Die Registrierung bei Sistema ist kostenlos und so wird es immer sein.\r\n'),
(41, 2, 2, 'zh', '登记注册需要付费吗？', 'Sistema的登记注册是不收费的，永远免费。\r\n'),
(42, 2, 2, 'ko', '가입에 비용을 지불해야 하나요?', 'Sistema 가입은 무료이고, 앞으로도 계속 그럴 예정입니다.\r\n'),
(43, 2, 2, 'ja', '登録には何らかの費用がかかりますか？', 'Sistemaの登録は、常に無料です。'),
(44, 2, 2, 'pt', 'O registro no Sistema tem algum custo?', 'O registro no Sistema é gratuito e sempre será.\r\n'),
(45, 2, 2, 'ar', 'هل هناك تكاليف للتسجيل؟', '.مجاني و سيبقى كذلك دوماً Sistema التسجيل في\r\n'),
(46, 3, 3, 'de', 'Ich habe mein Kennwort vergessen.', 'Wenn Sie Ihr Kennwort bei Sistema vergessen haben, müssen Sie nur unsere Website (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) besuchen oder laden Sie die App herunter und klicken Sie auf Kennwort « <a href=\"https://www.Sistema.com/\">Anfordern</a> », füllen Sie das Feld mit der E-Mail Ihres Sistema-Kontos aus, damit wir Ihnen automatisch einen Link senden, wo Sie ein neues Kennwort für Ihr Konto einrichten können.'),
(47, 3, 3, 'zh', ' 忘记了本人的帐户密码该怎么办？', '如果您忘记了您的Sistema帐户密码，您只需登录我们网站（<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) 进入首页，或者下载并打开申请表格，点击«<a href=\"https://www.Sistema.com/\">申请</a>»一词，在栏内填入您将在我们Sistema帐户中使用的电子邮箱地址，我们的系统就会自动将上网链接方式发至该栏目，您即可在栏内填写您帐户的新密码。'),
(48, 3, 3, 'ko', '제 계정의 비밀번호를 잊어버렸습니다. ', '만약 Sistema 계정의 비밀번호를 잊어버리셨다면, 웹사이트 첫페이지에 접속하시거나 어플리케이션을 다운받으신 후, «<a href=\"https://www.Sistema.com/\">요청하기</a>» 를 눌러주세요. Sistema에 등록되어있는 e-mail주소를 입력하시면, 자동으로 e-mail로 링크를 보내 비밀번호를 재설정할 수 있도록 하고 있습니다.'),
(49, 3, 3, 'ja', '自分のアカウントのパスワードを忘れてしまいました。', 'Sistemaアカウントのパスワードを忘れてしまった場合、Sistemaのトップページ（<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>）にアクセスするか、アプリケーションをダウンロードして開き、「<a href=\"https://www.Sistema.com/\">リクエストする</a>」をクリックし、メールアドレス欄に記入して下さい。すると自動的に、アカウントのパスワードを再設定できる画面へのリンクが記載されたメールが届きます。'),
(50, 3, 3, 'pt', 'Esqueci minha senha. É possível recuperá-la?', 'Se você esqueceu sua senha do Sistema, só precisa entrar na página inicial do nosso web site (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) ou baixar e abrir o aplicativo. Nesta página, clique em « <a href=\"https://www.Sistema.com/\">Solicitar</a> », preencha o campo com o endereço de e-mail cadastrado no Sistema e lhe enviaremos automaticamente um link de acesso para que você possa criar uma nova senha para sua conta.'),
(51, 3, 3, 'ar', 'نسيت كلمة المرور لحسابي', 'تحتاج فقط الصفحة Sistema اذا نسيت كلمة المرور لحسابك على\r\nأو افتح التطبيق و في لوحة <a href=\"https://www.Sistema.com/\">www.Sistema.com</a> الرئيسية لموقعنا\r\n<a href=\"https://www.Sistema.com/\">طلب و أكمل كتابة البريد /Request</a> تسجيل الدخول اضغط على\r\nحيث سيتم اوتوماتيكياً ارسال ايميل Sistema الالكتروني لحسابك على \r\n.على بريدك يحتوي رابط لتستخدمه في إنشاء كلمة مرور جديدة لحسابك\r\n'),
(52, 4, 4, 'de', 'Wie kann ich Kontakte für meine Produkte oder Dienstleistungen finden oder Kontakte für Produkten oder Dienstleistungen, die ich suche?', 'Wenn Sie bei Sistema neue Geschäftskontakte, potenzielle Kunden oder Lieferanten suchen, die an den Produkten oder Dienstleistungen interessiert sind, die zum Kern Ihres Geschäfts gehören, müssen Sie zuerst Ihre Angebote oder Bedarfe in Ihrem Sistema-Konto eingeben.\r\n\r\n1)	Gehen Sie auf unsere Website (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) oder laden Sie die App herunter und öffnen sie.\r\n\r\n2)	Nach dem Einloggen im System erfolgen Eingaben individuell im Bereich  « <a href=\"https://www.Sistema.com/productos/index/1\">Meine Angebote</a> » und « <a href=\"https://www.Sistema.com/productos/index/1\">Meine Bedarfe</a> ». Die Informationen, die dort von Ihnen eingegeben werden, ermöglichen es Ihnen, interessante Nutzer zu finden und sich mit diesen zu verbinden.\r\n\r\nIm Bereich « <a href=\"https://www.Sistema.com/productos/index/1\">Meine Angebote</a> » werden die von Ihnen verkauften Produkten oder Dienstleistungen angezeigt. Im Bereich « <a href=\"https://www.Sistema.com/productos/index/1\">Meine Bedarfe</a> » werden genau die Produkte oder Dienstleistungen angezeigt, die Sie suchen.\r\n\r\n3)	Klicken Sie im gewünschten Bereich auf das + -Zeichen, um ein neues Produkt oder eine Dienstleistung hinzuzufügen, und füllen Sie dann die folgenden Schlüsselinformationen in jedem entsprechenden Feld aus:\r\n\r\n« Produkt oder Dienstleistung »: Durch die Eingabe von Wörtern, Phrasen oder den ersten sechs Ziffern des Harmonisierten Systemcodes (*) Ihrer Produkte, können Sie im Nomenklator die Beschreibungen suchen, die am besten zu den Produkten oder Dienstleistungen passen und Sie können diese natürlich auswählen.\r\n« Land »: wählen Sie das Land aus, in dem sich Ihre Firma oder Ihr Angebot bzw. Bedarf befindet.\r\n« Stadt »: wählen Sie die Stadt aus, in dem sich Ihre Firma oder Ihr Angebot bzw. Bedarf befindet. Wenn sich Ihre Firma in mehreren Ländern und  Regionen befindet, können Sie das Land und die Stadt auswählen, die aktiv an der Transaktion beteiligt sind. Sie können aber das Produkt oder die Dienstleistung mehrmals eingeben mit allen passenden Kombinationen von Ländern und Städten.\r\n« Details »: In diesem Feld können Sie die Produkte oder Dienstleistungen kurz mit Ihren eigenen Wörtern beschreiben (am besten anders umschrieben als bei der Beschreibung des Nomenklators). Dieses hilft den Nutzern, Ihr Angebot oder Bedarf besser zu verstehen, um so die Chance auf Geschäfte zu erhöhen (maximal 255 Zeichen).\r\n« E-Mail »: Sie können alle E-Mails eingeben, an die die Nutzer kontaktieren können.\r\n« Sprachen »: Sie können so viele Sprachen auswählen wie Sie möchten - einschließlich solcher, die Ihre Kontakte sprechen.\r\n« Bilder »: Sie können so viele Bilder von den Produkten oder Dienstleistungen hochladen wie Sie möchten. \r\n\r\n4)	Als Letztes speichern Sie alle Änderungen. Um zu kontrollieren, dass die Eingaben und das Hochladen von Bildern korrekt ausgeführt wurde, sollten Sie in dem entsprechenden Bereich die Tabs mit den eingegebenen Informationen zu Produkten oder Dienstleistungen angezeigt bekommen.\r\n\r\n(*) Das Harmonisierte System ist eine internationale Nomenklatur, die von der Weltzollorganisation (WZO) für die Klassifizierung von Produkten festgelegt wird. Es ermöglicht den teilnehmenden Ländern, die Produkte auf einer gemeinsamen Grundlage für Zollzwecke zu klassifizieren. \r\nEs handelt es sich bei dem Harmonisierten System um ein weltweit gültiges, sechsstelliges Codesystem zur Klassifizierung von Waren. \r\nDiese Nomenklatur gilt nicht für Dienstleistungen, da diese einer zusätzlichen und spezifischen Nomenklatur unterliegen, welche von der Welthandelsorganisation (WTO) entwickelt wurde.'),
(53, 4, 4, 'zh', '怎么才能找到对本人的产品或服务感兴趣的客户的联系方式呢？', '如果您想在Sistema上寻找新的对您经销的核心产品或服务有兴趣的商业伙伴、潜在客户或者供货商，您首先需要做的是将您的发盘或询价的内容，上传到您的Sistema帐户中。\r\n\r\n1、进入我们网站的首页(<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>)或者下载并打开申请表格。\r\n\r\n2、进入系统之后，上传资料可在«<a href=\"https://www.Sistema.com/productos/index/1\">本人发盘</a>»和«<a href=\"https://www.Sistema.com/productos/index/2\">本人询价</a>»栏内分别进行。在这些栏目内填写资料上传之后，我们就可以代您找到并联系上有意分头合作的客户。\r\n«<a href=\"https://www.Sistema.com/productos/index/1\">本人发盘</a>»栏内填写并上传您想推销的产品或服务。 «<a href=\"https://www.Sistema.com/productos/index/2\">本人询价</a>»栏内得填写并上传您想购入的产品或服务。\r\n\r\n3、进入想要的栏目后，您可点击«+»号，添加您的新产品或新服务，然\r\n后在每一相关领域填入以下的关键信息：\r\n\r\n«产品或服务»栏：填入您的说明词句或者您产品协同编码(*)的前六位数字，接着从名册(Nomenclador)中寻找并选出跟您的上传信息最为相近的产品或服务介绍。\r\n«国别»栏：选取您的经商地，也就是您上传的发盘-询价活动即将进行的国家。\r\n«城市»栏：您选取您的经商地，也就是您所上载的发盘-询价活动行将举行的城市。\r\n如果您的生意分布在好几个国家，您可以从中选取商贸活动最为活跃的国家或城市，或者您也可以依照您本人的判断，组合搭配您经商的国家或城市，多次上传您的产品或服务资料。\r\n«详情»栏：在这一栏目内您可以简单描述一下在´名册´栏里没法细说的您产品和服务的特点，它将有助于其他客户更好地了解您的发盘-询价活动，以加大您商贸活动的可能范围（最多可扩至255个字）。\r\n«电子邮箱»栏：您可以将所有其他的Sistema 客户的邮箱地址都收罗在内，让他们都可以就上述产品或服务的经销进行联系，或者也可以干脆在注册登记时留下预设的电子邮箱地址。\r\n«语言»栏：您也可添加您本人或者账户上事先规定的接收电子邮件的人员所掌握的其他语言。\r\n«图像»栏：您可以上传您想上传的所有相关产品或服务的图像。\r\n\r\n4、最后将所有改动过的内容予以存盘保存。要确认上传资料是否已正确上传，您必须在与上传产品或服务信息卡相应的栏目内查阅核实。\r\n　　\r\n（*）注: 协同编码系统（SA）是一套为了商品分类，而由世界海关组织（OMA）所确定的国际命名系统。它使成员国能够依照统一的通关要求，将经销的产品进行分类。在国际上，商品分类协同编码系统是一组六位数的编码系统。这一命名方法不适用于服务，服务另由世界贸易组织（OMC）开发出的一套特殊的辅助命名法加以分类。'),
(54, 4, 4, 'ko', '어떻게 제가 관심있는 상품이나 서비스에 대한 연락처(Contact)를 찾을 수 있나요?', '만약 Sistema에서 당신의 회사에서 취급하는 상품이나 서비스에 관심을 가진 새로운 상업 연락처 (Contact), 잠재적 고객, 납품업자를 찾고 계신다면, 먼저 당신이 제안하거나 찾고 있는 내용을 업로드하셔야합니다. \r\n\r\n1) Sistema의 첫 페이지에 들어가시거나 어플을 다운받아 접속해주십시오.\r\n\r\n2) 로그인 후, 개인적인 형태로 «<a href=\"https://www.Sistema.com/productos/index/1\">나의 판매</a>» 또는 «<a href=\"https://www.Sistema.com/productos/index/2\">나의 구매</a>» 패널에서 해당내용을 입력해주십시오. 이 내용이 관련 연락처와 보충의 관심사를 가진 사용자들을 찾도록 허용합니다. \r\n«<a href=\"https://www.Sistema.com/productos/index/1\">나의 판매</a>» 패널에는 자신이 판매하는 상품 또는 서비스를 입력하시고, «<a href=\"https://www.Sistema.com/productos/index/2\">나의 구매</a>» 패널에는 자신이 얻고자 하는 상품과 서비스를 입력하시기 바랍니다.\r\n\r\n3) 원하는 패널에 들어가서, ´+»를 클릭하셔서, 새 상품과 서비스를 추가하시고, 해당하는 부문에 각각 필요한 주요정보를 입력해주시기 바랍니다.\r\n\r\n«상품 또는 서비스»: 당신의 상품의 단어, 구문 또는 HS 코드를 입력하시고, 등록할 상품과 서비스에 적합한 설명을 찾아서 선택하십시오.\r\n«국가»: 당신의 사업의 위치와 매매가 이루어지는 장소를 선택하세요.\r\n«도시»: 당신의 사업의 위치와 매매가 이루어지는 장소를 선택하세요.\r\n만약 당신의 사업이 여러국가나 도시에서 진행되고 있다면, 그 중에서도 가장 거래가 활발한 곳을 선택해주시거나, 당신 기준(Criteria)에 부합되는 모든 국가와 도시를 여러번에 걸처 상품과 서비스를 등록할 수 도 있습니다. \r\n«세부사항»: 이 항목은 간단하게 상품과 서비스의 특징들을 기술하는 곳입니다. 용어집이 충분히 설명하지 못하는 경우나, 다른 사용자들의 당신의 매매내용에 대해 이해를 도울 수 있는 내용을 입력해 거래 가능성을 키우 십시오.(최대 255자)  \r\n«E-mail»: 취급하고 있는 상품과 서비스에 대해 다른 Sistema사용자가 문의를 하거나, 연락을 취할 수 있는 모든 e-mail주소를 등록할 수 있습니다, 단순히 등록 예정인e-mail주소를 남겨도 됩니다.\r\n«Language»: 당신 혹은 앞서 계정에 등록된 e-mail을 받는 사람들이 이해하는 언어를 지정할 수 있습니다.\r\n«Image»: 당신이 취급하는 상품 또는 서비스에 관련되어 업로드 하고 싶은 모든 사진을 올릴 수 있습니다.\r\n\r\n4) 마지막으로, 변경내용을 저장하세요. 등록된 내용을 실제로 확인하기 위해서는 등록된 상품 또는 서비스의 정보의 카드에 해당되는 패널을 시각적으로 볼 수 있어야 합니다.\r\n\r\n(*) HS 코드 (Harmonized System code)는 세계세관기구(Wold Customs Organization)이 대외 무역거래에서 거래 상품의 종류를 숫자 코드로 분류해 놓은 용어집이다. 참여 국가들이 정한 세관목적에 맞는 공동 기반에 상업화 품목들을 분류할 수 있도록 도와 줍니다. 국제적 차원에서 상품에 대한 HS의 분류는 6자리 숫자로 이루어집니다. HS 코드는은 서비스에는 해당되지 않고, 따라서 WTO가 특별히 규정한 추가 용어집을 기준으로 분류하게 됩니다.  '),
(55, 4, 4, 'ja', '私の製品やサービスと関連するコンタクト先とは、どのようにすれば出会えますか。', 'Sistema上で新しい取引先、つまり、ご自身のビジネスの核となる製品又はサービスに関連する顧客又はサプライヤーを見つけたいとお考えの場合、まず、ご自身が提供する又は探しているものをSistemaのアカウントに入力する必要があります。\r\n\r\n1) SistemaのWebサイト（<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>）にアクセス、又はアプリをダウンロードし開いて下さい。\r\n\r\n2)システムにログインした後、「<a href=\"https://www.Sistema.com/productos/index/1\">オファー</a>」及び「<a href=\"https://www.Sistema.com/productos/index/2\">ニーズ</a>」の画面に行き個別に入力します。これらの画面で入力された情報によって、その製品やサービスを欲しい、又は提供したいと思っているユーザーを特定し、連絡することができます。\r\n\r\n「<a href=\"https://www.Sistema.com/productos/index/1\">オファー</a>」の画面には、あなたが販売する製品又はサービスを入力します。「<a href=\"https://www.Sistema.com/productos/index/2\">ニーズ</a>」の画面には、買いたいと思っている製品又はサービスを入力します。\r\n\r\n3)いずれか希望するほうの入力画面で「＋」の印をクリックし、製品又はサービスを追加し、その後各欄に、次の情報を入力して下さい。\r\n「製品又はサービス」：単語、文章又はHSコード(*)の最初の6桁を入力し、コード表の記述の中から、製品に最も適合するものを選んで下さい\r\n「国」：あなたがビジネスを行い、入力した「オファー」や「ニーズ」が存在する国を選んで下さい\r\n「県 」：あなたがビジネスを行い、入力した「オファー」や「ニーズ」が存在する県を選んで下さい\r\nあなたのビジネスが複数の国や県で展開されている場合は、最も取引が活発に行われている国や県を選択するか、ビジネス拠点として登録したい国や県すべてに対し複数回にわたって製品やサービスを登録することができます\r\n「詳細」：この欄には、他のユーザーがあなたのニーズやオファーをより良く理解できるような、コード表の記述には含まれていない製品又はサービスの特徴を、簡潔に記入して下さい（最大255文字）。これにより、取引成立の可能性が高まります。\r\n「メールアドレス」：Sistemaの他のユーザーからの、製品又はサービスの取引打診を受取りたいと希望する、すべてのメールアドレスを含めることができます。もちろん、登録時に設定したメールアドレスのままでもかまいません。\r\n「言語」：ご自身や上で設定したアドレスでメールを受信する方が使用できる言語を追加して下さい。\r\n「画像」：製品又はサービスに関する画像を、いくつでもアップロードできます。\r\n\r\n4)最後に変更を保存して下さい。入力が正しく行われたことを確認するには、入力された製品又はサービスの情報が記載された画面を見ることができます。\r\n\r\n(*)　HSコードは、「商品の名称及び分類についての統一システム」に基づいて世界税関機構（OMA）が定めた国際輸出入統計品目番号です。その参加国は、税関手続き上の統一見解によって取引される製品を分類することができます。「商品の名称及び分類についての統一システム」は、世界共通の6桁のコードから成るシステムです。サービスの場合はHSコード表が適用されないため、世界貿易機構（OMC）が定めた専用の追加コード表に基づき分類されます。'),
(56, 4, 4, 'pt', 'Como posso encontrar contatos para meus produtos ou serviços de interesse?', 'Se você quer localizar novos contatos comerciais no Sistema, clientes em potencial ou fornecedores interessados nos produtos ou serviços que fazem parte do núcleo do seu negócio, a primeira coisa a fazer é buscá-los em sua conta Sistema ou fazer o upload de tudo o que você tem a oferecer.\r\n\r\n1)	Entre na página inicial de nosso web site (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) ou então baixe o aplicativo. \r\n\r\n2)	Depois de fazer o login no sistema, você deve providenciar o upload de forma individual nos painéis « <a href=\"https://www.Sistema.com/productos/index/1\">Minhas ofertas</a> » e « <a href=\"https://www.Sistema.com/productos/index/2\">Minhas demandas</a> ». As informações incluídas nestes painéis nos permitem localizar e conectar os usuários que possuem interesses complementares.\r\n\r\nNo painel « <a href=\"https://www.Sistema.com/productos/index/1\">Minhas ofertas</a> » devem ser incluídos os serviços que você oferece ou produtos que vende. No painel « <a href=\"https://www.Sistema.com/productos/index/2\">Minhas demandas</a> », devem ser incluídos os produtos ou serviços que você deseja adquirir. \r\n\r\n3)	No painel desejado, clique no sinal de mais (+) para acrescentar um novo produto ou serviço, e depois complete as principais informações em cada campo correspondente:\r\n\r\n« Produto ou serviço »: Preencha com palavras, frases ou com os 6 (seis) primeiros dígitos do código do Sistema Harmonizado (*) dos seus produtos. Procure e selecione no Nomenclador as descrições que mais se assemelhem aos produtos ou serviços que deseje incluir.\r\n« País »: Escolha o país onde está localizado seu negócio e onde se aplica a oferta ou demanda incluída. \r\n« Cidade »: Escolha a cidade onde seu negócio está localizado e onde se aplica a oferta ou demanda incluída. \r\nSe seu negócio está localizado em vários países e cidades, você pode optar por selecionar o país e a cidade que estiverem mais ativamente envolvidos na transação, ou então fazer o upload do produto ou serviço várias vezes, utilizando todas as combinações de países e cidades do seu negócio.\r\n« Detalhe »: Neste campo você deve descrever brevemente as particularidades dos produtos ou serviços que não estão incluídas na descrição do Nomenclador e que ajudarão os demais usuários a conhecer melhor sua oferta ou demanda, aumentando assim as suas chances de fazer negócios (utilizando no máximo 255 caracteres).\r\n« E-mail »: Você pode acrescentar todos os endereços de e-mails onde quiser ser contatado pelos demais usuários do Sistema para a comercialização dos produtos ou serviços em questão, ou simplesmente deixar o e-mail registrado anteriormente.\r\n« Idioma »: É possível acrescentar outros idiomas falados por você ou pelos demais membros da sua equipe.\r\n« Imagens »: Você pode fazer o upload de todas as imagens que quiser dos produtos ou serviços em questão.\r\n\r\n4) No fim, salve as mudanças. Para confirmar se o upload foi feito corretamente, você pode visualizar no painel correspondente o cartão com a informação sobre o produto ou serviço adicionado. \r\n\r\n(*) O Sistema Harmonizado (SH) é uma nomenclatura internacional definida pela Organização Mundial de Alfândegas (OMA) para a classificação de produtos. Permite aos países participantes classificar produtos segundo uma base de dados comum, com fins alfandegários. Internacionalmente, o Sistema Harmonizado de classificação de mercadorias é um sistema de código de seis dígitos. Esta nomenclatura não se aplica a serviços, que são classificados com uma nomenclatura adicional e específica, desenvolvida pela Organização Mundial do Comércio (OMC).'),
(57, 4, 4, 'ar', 'كيف يمكنني أن أجد جهات اتصال لمنتجي أو الخدمة المهتم بها؟', 'ايجاد الزبائن ، Sistema اذا أردت تحديد جهات اتصال جديدة لعملك في \r\nالمطلوبين أو المزودين الأساسيين ، أو إن كنت مهتم ببعض المنتجات أو \r\nالخدمات التي تعد جزء من العمل الذي تمارسه\r\n\r\nفعليك أولا أن تحمل العرض الذي تقدمه أو ما تبحث عنه إلى حسابك على \r\n:كما يلي Sistema\r\n\r\nأو حمل و <a href=\"https://www.Sistema.com/\">www.Sistema.com</a> اذهب إلى الصفحة الرئيسية لموقعنا (I\r\n.افتح التطبيق\r\n\r\n، و <a href=\"https://www.Sistema.com/productos/index/1\">My offers/بعد تسجيل الدخول يتم تحميل لوحتين عروضي</a> (II\r\nالمعلومات الموجودة في اللوحات تساعدنا في تحديد و .<a href=\"https://www.Sistema.com/productos/index/2\">My Demands/طلباتي</a>\r\n.الاتصال بالمستخدمين المتوافقين مع اهتماماتك\r\n \r\nيتم تحميل المنتجات و الخدمات التي تبيعها  <a href=\"https://www.Sistema.com/productos/index/1\">/My offers/في لوحة عروضي</a> \r\nيتم تحميل المنتجات و <a href=\"https://www.Sistema.com/productos/index/2\">My Demands/و تعرضها. و في لوحة طلباتي</a> \r\n.الطلبات التي تريد شراءها\r\n\r\nاضغط على + ، في اللوحة التي تريد أن تضيف إليها خدمة أو منتج جديد (III\r\nثم أكمل ادخال المعلومات الرئيسية المطلوبة منك في كل حقل من الحقول \r\n:المبينة\r\n\r\nالمنتج أو الخدمة´´: من خلال إدخال الكلمات أو العبارات أو الأرقام الستة´´ \r\nالأولى من النظام المنسق (*) لمنتجاتك، يمكنك البحث في أوصاف الأسماء \r\n.التي تناسب المنتجات أو الخدمات التي يتم تحميلها\r\nالبلد´´ : اختار البلد حيث يقع عملك و أيضاً أين يتم الطلب على المنتج أو ´´\r\n.المدينة´´: اختار المدينة حيث يقع عملك و أين يتم الطلب´´\r\nاذا كان عملك موجود في عدة بلدان و عدة مدن يمكن أن تختار البلد أو \r\nالمدينة التي يتركز فيها النشاط أو الصفقة المطروحة أو يمكنك أن تحمل نفس \r\nالمنتج/الخدمة لعدة مرات بالتبديل بين جميع مجموعات البلدان و المدن\r\n.الموجود فيها عملك\r\nتفاصيل´´: ضع في هذا الحقل شرح موجز عن خصائص المنتج/الخدمة ´´\r\nالتي لا تتعارض مع التسميات مما يساعد باقي المستخدمين بالتعرف على \r\nمنتجك أو طلبك و يزيد من إمكانية التسويق.(يتم استخدام 255 حرف على \r\n.(الأكثر\r\nيمكنك أن تضع البريد الالكتروني لقسم:´´E-mail البريد الالكتروني ´´\r\nالتسوق الخاص بالمنتج/ الخدمة إن كنت ترغب أن يتواصل مستخدمو \r\nمعهم أو ببساطة يمكن أن تترك ايميل حسابك على Sistema\r\nالأساسي الذي استخدمته للتسجيل في الموقع Sistema \r\nاللغة´´:يمكنك دمج لغات أخرى لإدارة منتجاتك أو الأشخاص الذين يتلقون ´´ \r\n.رسائل البريد الالكتروني على حساباتهم \r\n.الصور´´ : يمكنك تحميل كل صور المنتجات و الخدمات المعنية.´´\r\n\r\nأخيراً قم بحفظ التعديلات. و للتأكد من أن التحميل تم بشكل صحيح يجب أن (IIII\r\n.تتأكد من أن يظهر لك المنتج/الخدمة المحملة حديثاً ضمن القائمة الموافقة\r\n\r\nالنظام المنسق هو تسمية دولية تحددها منظمة الجمارك العالمية لتصنيف (*)\r\nالمنتجات. وهي تسمح للبلدان المشاركة بتصنيف المنتجات التي يتم تسويقها\r\nعلى أساس مشترك لأغراض الجمارك. وعلى الصعيد الدولي، فإن نظام \r\nتصنيف السلع المنسق هو نظام رموز مكون من ستة أرقام. ولا تنطبق هذه \r\nالتسميات على الخدمات التي تصنف تحت تسمية إضافية محددة وضعتها منظ\r\n.التجارة العالمية'),
(58, 5, 5, 'de', 'Was passiert, wenn ich mein Produkt oder Dienstleistung nicht unter den Beschreibungen des Nomenklators finde?', 'Wenn Sie im Bereich « Produkt oder Dienstleistung » die passenden Beschreibungen nicht finden können, versuchen Sie es mit folgenden Optionen:\r\n\r\n« Manuelle Klassifizierung »: Mit Hilfe der ´Manuellen Klassifizierung » (lupa) können Sie die vollständige Nomenklator ansehen und somit das Produkt oder die Dienstleistung in drei Schritten klassifizieren. Sie müssen nur die Beschreibungen auswählen, die am besten zu Ihren Produkten oder Dienstleistungen passen. \r\n\r\n« Sich von einem Expert beraten lassen »: Sie können sich von einem Experten in Ihrem Land für Export- oder Importvorgänge bezüglich des HS-Codes gemäß des Harmonisierten Systems (*) für Ihr Produkt. Falls Ihr Produkt mehr als einen passenden HS-Code hat, geben Sie alle ein (ignorieren Sie diese Option im Falle von Dienstleistungen).\r\n\r\n« Sich im Internet informieren »: Eine andere gute Option ist –wenn auch manchmal nicht so genau – sich mit Hilfe einer Internet-Suchmaschine nach dem genauen HS-Code gemäß des Harmonischen Systems (*) zu informieren (ignorieren Sie diese Option im Falle von Dienstleistungen).\r\n\r\n(*) Das Harmonisierte System ist eine internationale Nomenklatur, die von der Weltzollorganisation (WZO)  für die Klassifizierung von Produkten festgelegt wird. Es ermöglicht den teilnehmenden Ländern, die Produkte auf einer gemeinsamen Grundlage für Zollzwecke zu klassifizieren. \r\nEs handelt es sich bei dem Harmonisierten System um ein weltweit gültiges, sechsstelliges Codesystem zur Klassifizierung von Waren. \r\nDiese Nomenklatur gilt nicht für Dienstleistungen, da diese einer zusätzlichen und spezifischen Nomenklatur unterliegen, welche von der Welthandelsorganisation (WTO) entwickelt wurde. '),
(59, 5, 5, 'zh', '如果我在名册内找不到我的产品或服务该怎么办？', '要是您在«产品或服务»栏内找不到您想要的东西，那可以试试以下几种办法：\r\n　\r\n«手工分类»：通过 ´´手工分类»（放大镜）您可以进入完整的分类名称目录，有三个步骤，可以选择与您的产品或服务最为相配的目录。\r\n\r\n«咨询专家»：您可以咨询您国内的进出口贸易专家（海关人员），询问您产品的协同编码系统(*)的编码,   因为根据产品构成或其分类准则，一种产品可以有一个或者几个编码，如是有几个编码，您应选择上传所有编码（如是服务则跳过这一选择）。\r\n\r\n«上网查询»：一种常常有用却不一定精确的做法是上网查找您产品的协同编码系统(*)编码，并分析网页所提供的信息。不管怎么说，只要您觉得依您个人的看法，其描述说明与您的产品接近，您就将您所找到的几个不同协同编码的前六位数字统统输入并加以上传就对了。\r\n\r\n（*）注: 协同编码系统（SA）是一套为了商品分类，而由世界海关组织（OMA）所确定的国际命名系统。它使成员国能够依照统一的通关要求，将经销的产品进行分类。在国际上，商品分类协同编码系统是一组六位数的编码系统。这一命名方法不适用于服务，服务另由世界贸易组织（OMC）开发出的一套特殊的辅助命名法加以分类。'),
(60, 5, 5, 'ko', '내 상품 또는 서비스를 용어집 목록에서 찾을 수 없으면 어쩌죠?', '만약 «상품 또는 서비스» 항목에서 당신이 찾고자하는 설명을 찾을 수 없다면, 다음의 옵션 중 하나를 시도해보십시오.\r\n\r\n«수동분류»: «수동분류» (돋보기) 를 통해 를 위한 완전한 용어집에 접근할 수 있고, 3단계에 걸쳐서 당신의 상품 또는 서비스에 적합한 설명을 고를 수 있습니다. \r\n\r\n«전문가에 문의하세요»: 당신의 국가의 (세관) 수출입을 담당하는 전문가에게 문의하셔서 HS 코드가 무엇인지 확인하세요. 당신의 분류 기준에 따라, 1자리 또는 여러 자리의 코드를 가질 수 있습니다. 상품이 여러 종류인 경우에는 각각의 상품을 모두 업로드하시기 바랍니다. (서비스의 경우에는 이 방법을 지양하시기 바랍니다.)\r\n\r\n«인터넷 검색»: 항상 정확하지는 않지만 인터넷을 통해 찾는 방법도 있습니다. 검색 엔진을 통해서 상품에 맞는 HS 코드가 무엇인지 확인하시고, 정보가 맞는지 확인해보세요. HS 코드의 첫 6 자리 숫자를 이용하면, 당신상품에 가장 적합하다고 판단되는 설명을 찾을 수 있습니다. (서비스의 경우에는 이 방법을 지양하시기 바랍니다.)\r\n\r\n(*) HS 코드 (Harmonized System code)는 세계세관기구(Wold Customs Organization)이 대외 무역거래에서 거래 상품의 종류를 숫자 코드로 분류해 놓은 용어집이다. 참여 국가들이 정한 세관목적에 맞는 공동 기반에 상업화 품목들을 분류할 수 있도록 도와 줍니다. 국제적 차원에서 상품에 대한 HS의 분류는 6자리 숫자로 이루어집니다. HS 코드는은 서비스에는 해당되지 않고, 따라서 WTO가 특별히 규정한 추가 용어집을 기준으로 분류하게 됩니다.'),
(61, 5, 5, 'ja', 'コード表の記述の中に、私の製品やサービスに相当するものがない場合はどうしたらいいでしょうか？', '「製品又はサービス」の欄に、あなたの探す内容と一致する記述がない場合、次のいずれかの方法をとって下さい：\r\n\r\n「手作業で分類」：「手作業での分類」（虫眼鏡のマーク）により、分類用の完全なコード表にアクセスし、3ステップで、あなたの製品やサービスに最も適合する記述を選択することができます。\r\n\r\n「専門家に相談する」：あなたの国の輸出入取引の専門家（通関業者）に、製品の該当するHSコード(*)が何であるかを相談して下さい。製品の構成又は分類基準によっては、2つ以上のコードが該当することがありますが、その場合は、すべてのコードに対して登録して下さい（この方法は、サービスの場合には該当しません）。\r\n\r\n「インターネットで調べる」：正確性に欠けることもあるものの、多くの場合に役立つ手段です。インターネットの検索エンジンで、あなたの製品に対するHSコードが何であるかを探し、検索結果を調べてみて下さい。そして、Webで見つかったHSコードの中で、あなたが最も自分の製品にふさわしいと考える記述を持ったHSコードの、始めの6桁を入力して下さい（この方法は、サービスの場合には該当しません）。\r\n\r\n(*)　HSコードは、「商品の名称及び分類についての統一システム」に基づいて世界税関機構（OMA）が定めた国際輸出入統計品目番号です。その参加国は、税関手続き上の統一見解によって取引される製品を分類することができます。「商品の名称及び分類についての統一システム」は、世界共通の6桁のコードから成るシステムです。サービスの場合はHSコード表が適用されないため、世界貿易機構（OMC）が定めた専用の追加コード表に基づき分類されます。');
INSERT INTO `faq` (`faq_id`, `faq_numero`, `faq_orden`, `idi_code`, `faq_pregunta`, `faq_respuesta`) VALUES
(62, 5, 5, 'pt', 'O que acontece se não encontrar meu produto ou serviço entre as descrições do Nomenclador?', 'Se no espaço « Produto ou Serviço » você não encontrar descrições que se ajustem à sua busca, tente uma das seguintes opções:\r\n\r\n« Classificar manualmente »: Mediante a « Classificação Manual » (lupa) é possível ter acesso ao Nomenclador completo para classificar, em 3 passos, escolhendo as descrições que mais se aproximem de seus produtos ou serviços.\r\n\r\n« Consultar um especialista »: É possível consultar um especialista em operações de exportação e importação (Despachante Aduaneiro) em seu país sobre o código do Sistema Harmonizado (*) correspondente ao seu produto, já que conforme sua composição ou critérios de classificação pode haver um ou vários códigos. No caso de existirem mais de um código, opte por fazer o upload de todos (marcar esta opção em caso de serviços).\r\n\r\n« Consultar a internet »: Uma opção que muitas vezes é útil, embora não tão precisa, é procurar num serviço de busca o Código do Sistema Harmonizado (*) do seu produto e analisar a informação encontrada na web. Em todo caso, utilize os 6 (seis) primeiros dígitos dos diferentes Códigos do Sistema Harmonizado (*) cujas descrições, na sua opinião, forem as mais adequadas para descrever seu produto (marcar esta opção em caso de serviços). \r\n\r\n(*) O Sistema Harmonizado (SH) é uma nomenclatura internacional definida pela Organização Mundial de Alfândegas (OMA) para a classificação de produtos. Permite aos países participantes classificar produtos segundo uma base de dados comum, com fins alfandegários. Internacionalmente, o Sistema Harmonizado de classificação de mercadorias é um sistema de código de seis dígitos. Esta nomenclatura não se aplica a serviços, que são classificados com uma nomenclatura adicional e específica, desenvolvida pela Organização Mundial do Comércio (OMC).'),
(63, 5, 5, 'ar', 'ماذا يحصل اذا لم أجد المنتج أو الخدمة الخاصة بي ضمن تسميات النظام المنسق؟', 'إذا لم تتمكن من العثور على أوصاف تطابق بحثك في الحقل ´´المنتج أو \r\n:الخدمة´´، فجرب أحد الخيارات التالية\r\n\r\nالتصنيف اليدوي: مع ´´التصنيف اليدوي´´ (عدسة مكبرة) يمكنك الوصول -\r\nإلى تسمية كاملة لتصنيف، في 3 خطوات، واختيار الأوصاف التي تناسب \r\n.المنتجات أو الخدمات الخاصة بك\r\n\r\nاستشارة خبير: يمكنك استشارة خبير في عمليات التصدير أو الاستيراد -\r\nوسيط الجمارك) في بلدك الذي هو رمز النظام المنسق (*) المقابلة للمنتج )\r\nالخاص بك نظرا لأنه بحسب تكوينها أو معايير التصنيف يمكن أن يكون لها \r\nرمز أو عدة رموز، إذا كان هناك عدة أوبتس لتحميل جميع (تخطي هذا \r\n.(الخيار في حالة الخدمات\r\n\r\nالتشاور عبر الإنترنت: خيار مفيد ولكن ليس دقيقا جدا، هو استشارة -\r\nمتصفح الإنترنت الذي هو رمز النظام المنسق (*) للمنتج الخاص بك \r\nوتحليل المعلومات التي يقدمها الموقع. في أي حال تحميل باستخدام أول 6 \r\nأرقام من النظام المنسق المختلفة(*) التي وجدت مواصفاتها موافقة لمعايير \r\n.(منتجك (تجنب هذا الخيار في حالة الخدمات\r\n\r\nالنظام المنسق هو تسمية دولية تحددها منظمة الجمارك العالمية لتصنيف (*)\r\nالمنتجات. وهي تسمح للبلدان المشاركة بتصنيف المنتجات التي يتم تسويقها \r\nعلى أساس مشترك لأغراض الجمارك. وعلى الصعيد الدولي، فإن نظام \r\nتصنيف السلع المنسق هو نظام رموز مكون من ستة أرقام. ولا تنطبق هذه \r\nالتسميات على الخدمات التي تصنف تحت تسمية إضافية محددة وضعتها \r\n.منظمة التجارة العالمية'),
(64, 6, 6, 'de', 'Welche relevante Information werde ich für jedes Ergebnis beobachten können?', 'Nachdem Sie Ihre Produkte oder Dienstleistungen im Bereich « <a href=\"https://www.Sistema.com/productos/index/1\">Meine Angebote</a> » oder « <a href=\"https://www.Sistema.com/productos/index/1\">Meine Bedarfe</a> » eingegeben haben, werden die Nutzer, die die entsprechenden Produkte oder Dienstleistungen suchen oder anbieten, automatisch im Bereich « <a href=\"https://www.Sistema.com/resultados/\">Ergebnisse</a> » angezeigt, basierend auf dem, was Sie angegeben haben.\r\n\r\nIm Bereich « <a href=\"https://www.Sistema.com/resultados/\">Ergebnisse</a> » können Sie alle Angebote und Bedarfe ansehen, die auf Ihren Interessen basieren:\r\n\r\no Ob der Nutzer das Produkt oder die Dienstleistung erwerben oder anbieten möchte.\r\no Die Bilder des Produkts oder Dienstleistung, die der Nutzer hochgeladen hat.\r\no Die Beschreibung der Nomenklatur über das Produkt oder die Dienstleistung, die Sie einkaufen oder anbieten möchten.\r\no Bestimmte Details des Produkts oder der Dienstleistung, die vom Nutzer angegeben werden.\r\no Land und Stadt, in der sich das Geschäft des Nutzers befindet.\r\no Sprachen, die der Nutzer spricht.\r\no Angegebene E-Mail vom Nutzer, um kontaktiert zu werden.\r\no Letzter Zugriff auf Sistema.\r\no Bewertung von anderen Nutzern. \r\no Menge von Nutzern, die das Produkt oder Diensleistung bereits angesehen haben. \r\no Geschäftsreferenzen vom Nutzer. '),
(65, 6, 6, 'zh', '在每一次查询结果中我可以发现什么重要信息？', '在将您的产品或服务上传到«<a href=\"https://www.Sistema.com/productos/index/1\">本人发盘</a>»和«<a href=\"https://www.Sistema.com/productos/index/2\">本人询价</a>»栏内之后，这些信息将会自动定位，并且，在您的«<a href=\"https://www.Sistema.com/resultados/\">搜索结果</a>»栏内，会按照您所确定的准则显示出有哪些客户在搜寻产品或服务：\r\n\r\no	您可以知道客户是在寻求购入还是在提供产品或服务；\r\no	您可以见到客户上传的产品或服务的图片；\r\no	您会读到和客户共同感兴趣的产品或服务的名册说明；\r\no	会了解到客户特别说明的产品或服务的个别详情；\r\no	了解到客户经商的所在地，包括国家和城市；\r\no	获悉客户所使用的语言；\r\no	客户所提供的建立联系的电子信箱地址；\r\no	看到最近一次上Sistema网的结果；\r\no	见到其他客户对您的评分；\r\no	以及看到过您网页的其他Sistema客户的数量；。\r\no	您会看到经商客户的商贸参考资料；\r\no	还有与产品相关的国际贸易统计数字。'),
(66, 6, 6, 'ko', '각 결과에서 어떤 관련된 정보를 확인할 수 있나요?', '당신의 상품과 서비스를«<a href=\"https://www.Sistema.com/productos/index/1\">나의 판매</a>» 와«<a href=\"https://www.Sistema.com/productos/index/2\">나의 구매</a>» 패널에 등록한 이후에, 자동으로«<a href=\"https://www.Sistema.com/resultados/\">결과들</a>» 패널에 당신이 기입한 내용을 바탕으로 검색된 상품과 서비스를 취급하고 찾고 있는 사용자들이 나타날 것입니다.\r\n\r\n이 패널에서는, 당신 관심사에 맞는 각각의 매매에 대한 정보를 확인할 수 있습니다.\r\n\r\no	사용자가 상품 또는 서비스를 판매중인지 구매중인지\r\no	사용자가 업로드한 상품 또는 서비스의 이미지\r\no	당신과 그 사용자의 공통의 관심 상품과 서비스의 HS 코드 상품설명\r\no	사용자가 특정 지시한 상품과 서비스의 세부내용\r\no	사용자 자회사가 위치한 국가와 도시\r\no	사용자의 언어\r\no	연락가능한 사용자 e-mail \r\no	Sistema 에 최종접속일시 '),
(67, 6, 6, 'ja', '各結果について、どのような関連情報を見ることができますか？', '「<a href=\"https://www.Sistema.com/productos/index/1\">オファー</a>」及び「<a href=\"https://www.Sistema.com/productos/index/2\">ニーズ</a>」の画面に製品やサービスを終えると自動的に、「<a href=\"https://www.Sistema.com/resultados/\">結果</a>」画面には、あなたが指定した内容に一致する製品やサービスのニーズを抱えた、又はこれらをオファー中のユーザーが特定され、表示されます。\r\n\r\n「<a href=\"https://www.Sistema.com/resultados/\">結果</a>」画面では、あなたと興味対象が一致するオファー及びニーズが特定され、表示されます：\r\n\r\no	そのユーザーが製品やサービスを買いたいのか、それとも供給したいのか。\r\no	ユーザーがアップロードした、製品やサービスの画像。\r\no	あなたとユーザーの間で興味が一致した製品又はサービスに対する、コード表上の記述。\r\no	ユーザーによる、製品又はサービスの特徴についての説明。\r\no	ユーザーがビジネスを行う国及び県。\r\no	ユーザーが使用する言語。\r\no	コンタクト先としてユーザーが提供した、電子メール。\r\no	最後にSistemaにアクセスした日\r\no	他のユーザーが行った評価\r\no	その情報を閲覧したSistemaユーザーの人数\r\no	ユーザーの商用レファレンス\r\no	該当する製品に関する貿易統計\r\n'),
(68, 6, 6, 'it', 'Che informazione rilevante potró osservare in ogni risultato?', 'Dopo aver caricato i tuoi prodotti o servizi nei pannelli  « <a href=\"https://www.Sistema.com/productos/index/1\">Le mie offerte</a> » e « <a href=\"https://www.Sistema.com/productos/index/2\">Le mie richieste</a> », automaticamente si localizzano e si fanno vedere nel tuo pannello di  « <a href=\"https://www.Sistema.com/resultados/\">Risultati</a> » quei utenti che hanno cercato u offerto, i prodotti o servizi corrispondenti in base a quello che hai specificato.\r\n\r\nNel pannello di  « <a href=\"https://www.Sistema.com/resultados/\">Risultati</a> » potrai visualizzare ogni offerta e richista in base ai tuoi interessi:\r\n\r\no Se l´utente sta cercando acquisire u offrire il prodotto o servizio.\r\no Le immagini del prodotto o servizio che l´utente abbia caricato.\r\no Descrizione della nomenclatura sul prodotto o servizio d´ interesse tra te e l´utente.\r\no Dettagli particolari del prodotto o servizio specificati per l´utente.\r\no Paese o cittá dove risiede il negozio dell´utente.\r\no Lingue che parla l´utente.\r\no Poste elettroniche che l´utente ha fornito per essere contattato.\r\no Ultimo accesso a Sistema.\r\no Valutazione fatta da altri utenti\r\no Quantitá di utenti di Sistema che l´hanno vista.\r\no Riferimenti commerciali dell´utente.\r\no Statistiche di commercio internazionale sul prodotto in questione.'),
(69, 6, 6, 'pt', 'Que informações relevantes poderei ter de cada resultado?', 'Após ter feito o upload de seus produtos ou serviços nos painéis « <a href=\"https://www.Sistema.com/productos/index/1\">Minhas ofertas</a> » e « <a href=\"https://www.Sistema.com/productos/index/2\">Minhas demandas</a> », automaticamente serão localizados e indicados no seu painel de « <a href=\"https://www.Sistema.com/resultados/\">Resultados</a> » aqueles usuários que estiverem buscando ou oferecendo produtos ou serviços correspondentes aos seus, segundo a sua especificação.\r\n\r\nNo painel de « <a href=\"https://www.Sistema.com/resultados/\">Resultados</a> » você poderá visualizar cada uma das ofertas e demandas de acordo com seus interesses. \r\n\r\no	Se o usuário deseja adquirir ou oferecer o produto ou serviço.\r\no	As imagens do produto ou serviço que o usuário tenha feito o upload.\r\no	A descrição da nomenclatura sobre o produto ou serviço que é coincidente entre você e o usuário.\r\no	Detalhes do produto ou serviço especificado pelo usuário.\r\no	O país e a cidade onde se encontra o negócio do usuário.\r\no	Os idiomas falados pelo usuário ou por sua equipe.\r\no	Os endereços de e-mail que o usuário registrou.\r\no	Seu último acesso ao Sistema.\r\no	Qualificação atribuída por outros usuários.\r\no	A quantidade de usuários do Sistema que viram a oferta ou demanda publicada.\r\no	As referências comerciais do usuário.\r\no	Estatísticas de comércio internacional sobre o produto em questão.'),
(70, 6, 6, 'ar', 'ما المعلومات ذات الصلة التي يمكنني رؤيتها من كل نتيجة؟', '<a href=\"https://www.Sistema.com/productos/index/1\">´´بعد تحميل منتجاتك أو خدماتك في لوحة ´´عروضي</a>\r\n<a href=\"https://www.Sistema.com/productos/index/1\">و ´´طلباتي´´، سيتم</a> \r\nتلقائيا تحديد موقع المستخدمين أو المستخدمين الذين يبحثون عن المنتجات \r\n<a href=\"https://www.Sistema.com/resultados\">أو الخدمات المطابقة أو يعرضونها ويتم عرضها في لوحة ´´النتائج´´ استنادا</a> \r\n.إلى ما قمت بتحديده\r\n\r\n<a href=\"https://www.Sistema.com/resultados\">في لوحة ´´النتائج´´ يمكنك عرض كل من العروض والطلبات الواقعة ضمن</a> \r\n:المصالح الخاصة بك\r\n\r\n.إذا كان المستخدم يبحث لشراء أو تقديم المنتج أو الخدمة o\r\n.صور المنتج أو الخدمة التي تم تحميلها من قبل المستخدم o\r\nوصف التسميات للمنتج أو الخدمة ذات الاهتمام المشترك بينك وبين o \r\n.المستخدم\r\n.تفاصيل خاصة عن المنتج أو الخدمة المحددة من قبل المستخدم o\r\n.البلد والمدينة التي يتركز فيها عمل المستخدم o\r\n.اللغات التي يتعامل بها المستخدم o\r\n.البريد الإلكتروني الذي يزوده المستخدم للاتصال به o\r\n.Sistema آخر وصول إلى o\r\n.التقييم المعين من قبل مستخدمين آخرين o\r\n.الذين شاهدوا ذلك Sistema عدد مستخدمي o\r\n.مراجع مستخدم الأعمال o\r\n.إحصاءات التجارة الدولية بشأن المنتج المعني o'),
(71, 7, 7, 'de', 'Was bedeutet die « Bewertung »?', 'Die « Bewertung » bezieht sich auf den durchschnittlichen Grad von Relevanz, der von allen Nutzern zu einem bestimmten Angebot oder Bedarf bewertet wurde (zwischen 1 und 5). Sie können jede Veröffentlichung bewerten, wenn Sie möchten. Die Bewertung ist anonym und ohne Begründung.'),
(72, 7, 7, 'zh', '«评分»是什么意思？', '«评分»意味着Sistema的客户对某一发盘或询价的重要性打分时所给的平均分数（1分至5分）。您如果愿意，也可以对每次向您公布的信息打分。打分不记名也不用给出理由。'),
(73, 7, 7, 'ko', '«평가»가 무엇을 의미하나요?', '«평가»란 Sistema의 다른 사용자들이 해당 매매에 대해 평가한 1에서 5까지 평균점수입니다. 익명으로 표기되며, 추가 설명은 없습니다.'),
(74, 7, 7, 'ja', '「評価」とは何ですか？', '「評価」は、特定のオファーやニーズに対し、Sistemaユーザーが与えた重要度レベル（1から5まで）の平均を示します。あなたも、各公開情報を評価することができます。評価は匿名で、理由は記載されません。'),
(76, 7, 7, 'pt', 'O que significa a « Qualificação »?', 'A « Qualificação » indica a média do nível de importância (de 1 a 5) classificado pelos usuários do Sistema sobre uma oferta ou demanda determinada. Você pode qualificar cada publicação, se desejar. A qualificação é feita anonimamente e não é necessária qualquer explicação. '),
(77, 7, 7, 'ar', 'ماذا يفعل التقييم؟', 'يشير ´´التصنيف´´ إلى متوسط مستوى الأهمية الممنوحة (من 1 إلى 5) من \r\nإلى العرض أو الطلب المقدم. يمكنك تقييم كل SISTEMA قبل مستخدمي \r\n.منشور إذا كنت ترغب في ذلك. التقييم ذو طابع مجهول وبدون أسباب'),
(78, 8, 8, 'de', 'Was bedeutet « Bereits angesehen »?', 'Das « Bereits angesehen » bedeutet die Menge an Nutzer von Sistema, die sich das Angebot bzw. den Bedarf durchgeklickt und im Detail angeschaut haben.'),
(79, 8, 8, 'zh', '«已查阅»是什么意思？', '«已查阅»表示有多少Sistema的客户进入了某一发盘或询价网页查阅了全部信息。\r\n'),
(80, 8, 8, 'ko', '«확인» 이 무엇을 의미하나요?', '«확인»은 해당 매매건에 완전한 정보를 보기 위해 접속한 사용자들의 숫자를 뜻 합니다. '),
(81, 8, 8, 'ja', '「閲覧数」とは何ですか？', '「閲覧数」とは、特定のオファーやニーズに対し、完全な内容を見るために内容を閲覧したSistemaのユーザー数を意味します。'),
(82, 8, 8, 'pt', 'O que significa o « Visto »?', 'O « Visto » indica a quantidade de usuários do Sistema que entraram na publicação da oferta ou da demanda determinada para ler a informação completa. '),
(83, 8, 8, 'ar', 'ماذا يعني ´´شاهد´´؟', 'الذين فتحوا العرض أو الطلب لرؤية SISTEMA يشير إلى عدد مستخدمي \r\n.كامل المعلومات حوله'),
(84, 9, 9, 'de', 'Was bedeuten die « Geschäftsreferenzen »?', 'Die « Geschäftsreferenzen » weisen darauf hin, dass die E-Mail-Konten von dem Nutzer, der das Angebot oder den Bedarf veröffentlicht hat, bereits von anderen E-Mail-Konten für gültig erklärt wurden, bei denen die @Domain angezeigt werden kann. Mit den « Geschäftsreferenzen » hat man eine gewisse Garantie über die Existenz des Nutzers in einem Geschäft. Je höher die Anzahl und Qualität der Geschäftsreferenzen ist, desto höher ist die Qualität des Nutzers. Sie können jede Veröffentlichung als gültig erklären, wenn Sie möchten.'),
(85, 9, 9, 'zh', '«商贸参考资料»是什么意思？', '«商贸参考资料»表示公布发盘和询价信息的客户的电子邮箱帐号已经由客户所提供的第三方帐户所确认，您可以在@dominio中查到。«商贸参考资料»可以确保经商客户确实存在。商贸资质领域的数量和质量越高，客户的质量就越高。您如果愿意可以确认每一项公布的信息。'),
(86, 9, 9, 'ko', '«상업적 리퍼런스» 가 무슨 뜻인가요?', '«상업적 리퍼런스» 는 제 3자에 의해 현재 개시된 매매내용의 개시자의 e-mail 계정이 유효확인되었다는 것을 뜻하고, 당신은 그 사용자의 도메인을 확인할 수 있습니다. 리퍼런스는 실제 무역에서 사용자가 존재하고 있다는 것을 확신 시켜줍니다. «상업적 리퍼런스»의 도메인이 많고 질이 좋을 수록, 사용자 수준도 높아집니다. 당신은 각각의 개시글을 유효화할수 있습니다.'),
(87, 9, 9, 'ja', '「商用レファレンス」とは何ですか？', '「商用レファレンス」とは、オファー又はニーズを公開したユーザーのメールアドレスが、そのユーザーが依頼した第三者によって証明されていることを意味し、その第三者のメールアドレスのドメイン名（＠以下）が表示されます。商用レファレンスは、取引相手のユーザーが確実に存在するという保証となります。「商用レファレンス」の数が多いほど、また、ドメインが信用できるものであるほど、そのユーザーも信用できるということになります。あなたもまた、各公開情報の証明を行うことができます。'),
(88, 9, 9, 'pt', 'O que significam as « Referências comerciais »?', 'As « Referências comerciais » indicam que as contas de e-mail do usuário que publicou a oferta /demanda foram validadas por outras contas de e-mails providas pelo usuário, da qual você pode visualizar o @domínio. As « Referências comerciais » permitem obter garantias relativas da existência do usuário no negócio. Quanto maior o número e a qualidade dos domínios de referências comerciais, maior será a qualidade do usuário. Você pode validar cada publicação, se assim o desejar. '),
(89, 9, 9, 'ar', 'ماذا تعني ´´المراجع التجارية´´؟', 'تشير ´´المراجع التجارية´´ إلى أن حسابات البريد الإلكتروني للمستخدم التي \r\nنشرت العرض أو الطلب تم التحقق من صحتها من خلال حسابات البريد \r\nالإلكتروني الثالثة التي يقدمها المستخدم، والتي يمكنك من خلالها عرض \r\nتسمح المراجع التجارية بالحصول على ضمانات نسبية @domain المجال\r\nنسبية لوجود المستخدم في العمل(الشركة). وكلما زاد عدد وجودة مجالات \r\nالإحالة التجارية، كلما زادت جودة المستخدم. يمكنك التحقق من صحة كل \r\n.منشور إذا كنت ترغب في ذلك'),
(90, 10, 10, 'de', 'Welche statistische Informationen werden Sie für jedes Ergebnis finden können ?', 'Sie werden internationale Handelsstatistiken über das betreffende Produkt finden können. Diese werden es Ihnen ermöglichen, einerseits den bilateralen Handel zwischen Ihrem Land und dem Land des Nutzers in Zahlen zu kennen, und auf der anderen Seite werden Sie den Handelsfluss zwischen dem Land des Nutzers und dem Rest der Welt erfahren können.\r\n\r\nBeide Daten sind sehr wichtig, da diese Ihnen zeigen werden, ob es Exporte / Importe des Produkts in Bezug auf den Markt des Nutzers gibt beziehungsweise ob es tarifäre oder nicht tarifäre Handelshemmnisse gibt, die den Handel blockiert und im Falle von bestehenden/existierenden Exporten / Importen zeigen Ihnen diese Daten, ob diese in den letzten 5 Jahren gewachsen sind oder nicht.'),
(91, 10, 10, 'zh', '在每次查询结果中您可以查到什么样的统计信息？', '有关特定产品的国际贸易统计资料，一方面可以使您从数值角度，了解贵国与客户的国家之间现存的双边贸易的流量（视情况而异），另一方面是您选定的客户的国家与世界上其他国家的贸易流量。这两个数据都很重要，因为它们向您揭示，在您所确定的客户的市场里，相关的产品的进出口是否存在，或者是有没有阻碍贸易进行的关税或准关税壁垒存在，如果是有贸易活动进行的话，在最近五年内，进出口活动是否有所增长。'),
(92, 10, 10, 'ko', '각각의 결과에 대해 어떤 통계정보를 얻게되나요?', '국제 무역 통계는 해당 상품의 당신이 그 가격을 알게 해줄 뿐문 아니라, 당신의 국가와 상대방의 국가간 양자무역이 이미 존재하고 있는지, 또 상대방의 무역이 전세계 다른 국가와 또 진행중인지를 보여줍니다. 상대방의 국가 또는 지역의 시장에 대해 상품의 수입과 수출이 존재하고 있는지, 해당 무역 지구에서 상업활동을 하는데 있어서 관세나 관세장벽 존재하고 있는지, 지난 5년간의 수출입이 증가 또는 감소했는지를 보여주기 때문에, 각각의 자료가 모두 중요합니다. '),
(93, 10, 10, 'ja', '結果には、どんな統計情報が現れますか？', '製品に関する国際貿易統計では、あなたの国と特定されたユーザーの国の間の2国間貿易の量、及びそのユーザーの国がその他すべての国と行っている貿易の量を、金額ベースで知ることができます。いずれのデータも、特定されたユーザーの市場において既に製品の輸出入が行われているかどうかや、貿易の障害となるような関税が存在するかどうかを知ることができ、また既に輸出入が行われている場合には、過去5年間に増加したか減少したかを知ることができるため、非常に重要なものとなります。'),
(94, 10, 10, 'pt', 'Que informação estatística é possível encontrar em cada resultado?', 'Estatísticas de comercio internacional sobre o produto em questão o ajudarão a conhecer em valores dois dados importantes: primeiro, o fluxo de comércio bilateral existente entre o seu país e o país do usuário e, segundo, o fluxo de comércio do país do usuário localizado, com relação ao resto do mundo. Estes dois dados são extremamente importantes já que mostrarão se existem importações/exportações (o que corresponder) do produto no mercado do usuário localizado, e se existe alguma barreira alfandegária que esteja bloqueando o comércio. Em caso positivo, é possível saber se estas exportações/ importações existentes aumentaram ou diminuíram nos últimos 5 anos.'),
(95, 10, 10, 'ar', 'ما هي المعلومات الإحصائية التي تجدونها في كل نتيجة؟', 'إحصاءات التجارة الدولية على المنتج المعني من شأنها أن تسمح لك أن \r\nتعرف القيم، من ناحية تدفق التجارة الثنائية بين بلدك وبلد المستخدم، ومن \r\n.ناحية أخرى تدفق التجارة بين بلد المستخدم الموجود بالنسبة إلى بقية العالم\r\n/ وكلا البيانين مهمان للغاية لأنهما سيبينان ما إذا كانت هناك صادرات \r\nواردات (حسب الاقتضاء) للمنتج فيما يتعلق بسوق المستخدم ، و إذا كان \r\nهناك تعريفة جمركية أوضريبة تعرقل التجارة، وتسجيل النشاط، إذا نمت \r\n.هذه الصادرات / الواردات الحالية على مدى السنوات الخمس الماضية أم لا'),
(96, 11, 11, 'de', 'Welche Informationen meines Profils sind der Schlüssel zur Verbesserung der Kommunikation und meiner Geschäfte?', 'In Ihrem Profil können Sie Informationen über Ihre Person und / oder Ihr Unternehmen erweitern und auswählen, ob sie für andere Nutzer sichtbar sein möchten.\r\n\r\nEin vollständiges Profil mit genauen Informationen deutet auf einen zuverlässigen Kontakt hin, mit dem man in Gespräche und Geschäftsbeziehungen eintreten kann. Sistema empfiehlt Nutzern:\r\n\r\n1)	Stellen Sie die größte Anzahl von Kontaktwegen mit dem Rest der Benutzer her.\r\n2)	Vermeiden Sie Fehler in den bereitgestellten Informationen.\r\n3)	Reagieren Sie schnell auf die Anfragen, die über die verschiedenen etablierten Kanäle eingehen.'),
(97, 11, 11, 'zh', '有关本人个人的背景资料对于提升通讯联络和经商效果有多重要？', '您作为Sistema客户的背景资料可以增加有关您本人及/或贵公司的信息，您可以选择是否能让其他客户看到。内容可靠的完整背景资料意味着您与开始与之建立对话和商贸关系的人的联系牢靠可信。Sistema建议各位客户：\r\n\r\n1） 与其他客户建立尽可能多的沟通渠道。\r\n2） 避免所提供的信息出错。\r\n3） 通过您所建立的各种渠道，迅速回复您所收到的咨询。'),
(98, 11, 11, 'ko', '나의 프로필 정보가 소통 또는 무역에 어떤 중요한 역할을 하나요?', 'Sistema 의 당신 프로필에는 당신이 사용자들에게 나타내고 싶은 내용에 대해, 개인, 회사 정보에 대한 추가 정보를 입력할 수 있습니다. \r\n\r\n사실적인 정보와 프로필은 신뢰을 주는 연락처(Contact)으로 다른 사용자들이 무역관계를 시작하는 데 중요한 역할을 합니다. Sistema 가 사용자들에게 추천하는 것:\r\n\r\n1)	다를 사용자들을 위한 다양한 연락(Contact) 포인트 \r\n2)	제공하는 정보에서의 오류 지양\r\n3)	신속한 답변'),
(99, 11, 11, 'ja', '私のプロフィールのうちどの部分が、コミュニケーションやビジネスを円滑にするための鍵となりますか？', 'あなたのユーザープロフィールには、あなた自身やあなたの会社についての情報を記入し、希望する場合はその他のユーザーから見えるようにすることもできます。誰と会話をし、商業的関係を築いていくかを決めるにあたっては、プロフィールの必要事項がすべて記入されていて、真実の情報であることが必要となります。Sistemaはユーザーに、次の事項を推奨しています:\r\n\r\n1) \r\n他のユーザーに対し、できるだけ多くの連絡方法を提示すること。\r\n\r\n2) \r\n記入した情報に、誤りがないこと。\r\n\r\n3) \r\n提示した色々な連絡方法で受取った問合せに対し、迅速に回答すること。'),
(100, 11, 11, 'pt', 'Que informação do meu perfil é fundamental para potencializar os negócios?', 'No seu perfil de usuário do Sistema você poderá incluir informações sobre você mesmo e/ou sua empresa. Poderá também escolher se essas informações serão visíveis ou não para outros usuários. \r\n\r\nUm perfil completo, composto por dados verdadeiros, passa uma imagem mais profissional e fiável, o que irá aumentar suas relações comerciais. Sistema recomenda aos seus usuários que:\r\n\r\n1) Estabeleçam a maior quantidade de meios de contato pelos quais os usuários possam encontrá-lo. \r\n2) Evitem erros nas informações publicadas.\r\n3) Respondam às consultas recebidas através de todas as vias disponíveis com a maior brevidade possível.'),
(101, 11, 11, 'ar', 'ما هي المعلومات التي يمكن أن أضعها في ملف التعريف الخاص بي  لتعزيز الاتصالات والأعمال؟', 'يمكنك توسيع المعلومات حول SISTEMA في الملف الشخصي للمستخدم\r\nالشخص و / أو شركتك، واختيار إذا كنت تريد أن تكون مرئية للمستخدمين \r\n.الآخرين\r\n\r\nلمحة كاملة مع معلومات صادقة يمكن الاعتماد عليها للاتصال للبدء في \r\n :يوصي المستخدمين .SISTEMA الانخراط في المحادثات والعلاقات التجارية\r\n\r\n.إنشاء الحد الأقصى لعدد طرق الاتصال لبقية المستخدمين  (I\r\n.تجنب الأخطاء في المعلومات المقدمة (II\r\n.الرد بسرعة على الاستفسارات الواردة من قبل مختلف القنوات المنشأة (III'),
(102, 12, 12, 'de', 'Welche Informationen werden im Bereich internationale Handelsstatistiken aus Ihrem Land angezeigt?', 'Im Bereich internationalen Handelsstatistiken wird eine Liste der von Ihrem Land exportierten und importierten Produkten angezeigt, die einen größeren Anstieg der Werte (USD FOB bzw. CIF) aufweisen, wobei die jährlichen Gesamtbeträge in den letzten 5 Jahren verglichen werden. Damit können Sie die Produkte kennen, die die Dynamik ihres internationalen Geschäfts verbessert haben.'),
(103, 12, 12, 'zh', '栏目内贵国国际贸易的统计数字披露出什么信息？', '贵国国际贸易统计数字的栏目内，向您展现的是最近五年中，贵国那些进出口产品的列表比较的年度总额（分别是：美元数，离岸价数值，到岸价数值）。这样您就能了解有哪些产品改善了其国际贸易的发展势头。'),
(104, 12, 12, 'ko', '나의 국가의 국제무역 통계 패널은 무슨 정보를 보여주나요?', '내 국가 국제무역통계 패널에서는 지난 5년간 등록된 내용에서 당신국가에서 수출입한 상품들의 리스트를 보여줍니다. 일년 간의 총금액과 비교해서USD, FOB 과 CIF  등에 단위에 맞춰 증가치를 보여줌으로서 국제무역에서 성과가 더 좋아진 상품을 확인 할 수있 습니다.'),
(105, 12, 12, 'ja', '「あなたの国の国際貿易に関する統計」の画面には、どのような情報が表示されますか？', '「あなたの国の国際貿易に関する統計」の画面には、輸出又は輸入において、直近5年間の年間総取引量金額（米ドルに換算されたFOB価格とCIF価格）と比較し大幅な増加がみられた製品のリストが表示されます。これによって、国際取引がより活発になっている製品を知ることができます。'),
(106, 12, 12, 'pt', 'Quais informações podem ser encontradas no painel de estatísticas de comércio internacional do seu país?', 'O painel de estatísticas de comércio internacional de seu país lhe mostrará uma lista com os produtos exportados e importados pelo seu país que registraram um maior incremento em valores (USD FOB e CIF, respectivamente) comparando os montantes totais anuais registrados nos últimos 5 anos. Assim você saberá que produtos melhoraram a dinâmica de seus negócios internacionais.'),
(107, 12, 12, 'ar', 'ما هي المعلومات التي تظهرها لوحة إحصاءات التجارة الدولية في بلدك؟', 'ستعرض لك لوحة إحصاءات التجارة الدولية في بلدك قائمة بتلك المنتجات \r\nUSD) المصدرة والمستوردة من قبل بلدك والتي سجلت زيادة أكبر في القيم\r\nعلى التوالي) من خلال مقارنة إجمالي المبالغ السنوية في FOB و CIF, \r\nالسنوات الخمس الأخيرة المسجلة . وبهذه الطريقة سوف تعرف تلك \r\n.المنتجات التي حسنت ديناميكية الأعمال التجارية الدولية الخاصة بك'),
(108, 13, 13, 'zh', '最大交易量的产品与服务栏目向您展示的是什么信息？', '最大交易量的产品和服务栏目，向您展示的是Sistema 客户发盘上传量与询价上传量都大的那些产品与服务。这是在了解世界上有哪些热点时最为关键的信息, 即具有最多联系人的代码。'),
(110, 13, 13, 'de', 'Welche Informationen werden im Bereich aktivste Produkte und Dienstleistungen angezeigt?', 'Der Bereich mit den aktivsten Produkten und Dienstleistungen zeigt Ihnen die Produkte und Dienstleistungen, welche am meisten von Sistema-Nutzern angeboten oder bestellt wurden. Das ist eine sehr wertvolle Information, wenn es darum geht zu wissen, welche die heißesten Positionen weltweit sind; das heißt die Produkten mit den Zolltarifnummern, die die meisten Kontakte betreffen.'),
(111, 13, 13, 'ko', '가장 활발한 상품과 서비스 패널는 무슨 정보를 보여주나요?', '이 패널에서는 Sistema의 사용자의, 판매든 구매든 가장 활발한 상품과 서비스 패널은 가장 업로드가 많이 되어있는 상품 또는 서비스를 보여줍니다. 중요한 열쇠는 HS 코드에 따라서 세계에 핫스팟, (즉, 가장 많이 컨택트들이 상거래가 이루어지는 지역)이 어디인지 알수 있다는 것입니다.'),
(112, 13, 13, 'ja', '「注目されている製品及びサービス」の画面には、どのような情報が表示されますか？', '「注目されている製品及びサービス」の画面には、Sistemaのユーザーによって頻繁にオファーやニーズの公開が行われている製品及びサービスが表示されます。この情報は、世界で注目されている製品やサービス（つまり、コンタクト先を最も多く持つHSコード）が何であるかを知る鍵となります。'),
(113, 13, 13, 'pt', 'Que informações podem ser encontradas no painel de produtos e serviços com maior atividade?', 'O painel de produtos e serviços com maior atividade lhe mostrará aqueles produtos e serviços que os usuários do Sistema acessaram mais, tanto ofertas como demandas. Essa é uma informação crucial para compreender o que está em alta no mundo, ou seja, os códigos têm mais uploads.'),
(114, 13, 13, 'ar', 'ما هي المعلومات التي تظهر لوحة المنتجات والخدمات الأكثر نشاطاً؟', 'اللوحة من المنتجات والخدمات ذات النشاط الأكبر ستظهر لك المنتجات \r\nوالخدمات التي لديها كمية أكبر من عمليات التحميل، إما كما عروض أو \r\nو هي معلومات أساسية عندما .SISTEMA كما طلبات، من قبل مستخدمي\r\n.يتعلق الأمر بمعرفة ما هي المواقف الأكثر تداولاً في العالم'),
(115, 14, 14, 'de', 'Was ist der Bereich Nachricht an die Nutzer? ', 'In diesem Bereich können Sie kurze Anfragen (bis zu 255 Zeichen) für ein Produkt oder eine Dienstleistung für einen bestimmten Markt hinterlassen, die von jedem Sistema-Nutzer beantwortet werden können.'),
(116, 14, 14, 'zh', ' 什么是用户信息栏？', '在这一栏目中您可以就某一产品或服务，就某一特定市场，留下简短的咨询（不超出255字），让Sistema随便哪一位客户予以解答。'),
(117, 14, 14, 'ko', '사용자를 위한 메시지 패널은 무엇입니까?', '이 패널에는255자까지 상품과 서비스, 특정한 시장에 대한 간단한 질문을 남길 수 있으며, Sistema의 모든 회원이 답할 수 있습니다.'),
(118, 14, 14, 'ja', 'ユーザーへの相談画面は何のためですか?', 'この画面は、製品又はサービス、及び特定のマーケットに関する簡潔にまとめた相談内容（255 文字まで）を入力し、Sistemaのユーザーの皆さんから回答を得られるようにするためのものです。'),
(119, 14, 14, 'pt', 'O que é o Painel de Mensagem aos usuários?', 'Neste painel você poderá fazer breves consultas (de até 255 caracteres) referentes a um produto ou serviço, assim como a um mercado específico, para que seja respondida por qualquer usuário do Sistema.'),
(120, 14, 14, 'ar', 'ما لوحة رسالة المستخدمين؟', '(في هذه اللوحة يمكنك ترك استفسارات موجزة (تصل إلى 255 حرفا\r\nالمتعلقة ب منتج أو خدمة وسوق محدد ، ليجيب عليها مستخدمي \r\n.SISTEMA'),
(121, 15, 15, 'zh', '本人如何能在Sistema 上公布本公司的信息？', '如果您想在Sistema上发布信息，请给我们发函至<a href=\"mailto: advertising@Sistema.com\">advertising@Sistema.com</a> 。'),
(122, 15, 15, 'ko', 'Sistema 에 제 회사 홍보는 어떻게 하나요?', '회사 홍보를 원하신다면, <a href=\"mailto: advertising@Sistema.com\">advertising@Sistema.com</a>로 연락주시기 바랍니다.\r\n'),
(123, 15, 15, 'ja', 'Sistemaに私の会社の宣伝を出したいのですが、どうしたらいいですか？', 'Sistemaに宣伝を出したいとお考えの場合、メールにて<a href=\"mailto: advertising@Sistema.com\">advertising@Sistema.com</a>にご連絡ください。'),
(124, 15, 15, 'pt', 'Como posso anunciar minha empresa no Sistema?', 'Se você quiser fazer um anúncio no Sistema, por favor envie-nos um e-mail a <a href=\"mailto: advertising@Sistema.com\">advertising@Sistema.com</a>'),
(125, 15, 15, 'ar', '؟SISTEMA كيف يمكنني الإعلان عن نشاطي التجاري في', 'يرجى الكتابة لنا على ، SISTEMA إذا كنت ترغب في الإعلان على \r\n.<a href=\"mailto: advertising@Sistema.com\">advertising@Sistema.com</a>'),
(126, 15, 15, 'de', 'Wie kann ich für meine Firma in Sistema werben?', 'Falls Sie sich Werbung für Ihre Firma wünschen, schreiben Sie uns bitte kurz eine E-Mail an: <a href=\"mailto: advertising@Sistema.com\">advertising@Sistema.com</a> '),
(127, 16, 16, 'zh', '本人如何能跟Sistema技术支持团队联系？', '如果您对网站的运行有问题要咨询或有评论要发表，请给我们写信，来信可发至：<a href=\"mailto: support@Sistema.com\">support@Sistema.com</a> 。'),
(128, 16, 16, 'ko', 'Sistema 지원팀과는 어떻게 연락하나요?', '사이트의 기능에 대해 질문사항이나 코멘트가 있으시면, <a href=\"mailto: support@Sistema.com\">support@Sistema.com</a> 로 연락주시기 바랍니다. '),
(129, 16, 16, 'ja', 'Sistemaのサポートチームに連絡したいのですが、どうしたらいいですか？', 'サイトの機能に関する質問又はコメントは、メールにて<a href=\"mailto: support@Sistema.com\">support@Sistema.com</a>にご連絡ください。'),
(130, 16, 16, 'pt', 'Como posso me comunicar com a equipe de suporte do Sistema?', 'Caso você tiver alguma pregunta ou comentário sobre o funcionamento do web site, por favor envie-nos um e-mail a <a href=\"mailto: support@Sistema.com\">support@Sistema.com</a>'),
(131, 16, 16, 'de', 'Wie setze ich mich mit der Support-Hotline von Sistema in Verbindung?', 'Wenn Sie Fragen oder Kommentare zu dieser Website haben, schreiben Sie uns bitte eine E-Mail an: <a href=\"mailto: support@Sistema.com\">support@Sistema.com</a>\r\n'),
(132, 16, 16, 'ar', '؟SISTEMA كيف يمكنني الاتصال بفريق دعم ', 'إذا كان لديك أي أسئلة أو تعليقات حول تشغيل الموقع، يرجى مراسلتنا على \r\n<a href=\"mailto: support@Sistema.com\">support@Sistema.com</a>'),
(133, 1, 1, 'it', 'Come mi posso registrare su Sistema?', 'Fare i registro in Sistema é semplice e gratuito, solo hai bisogno di entrare nella pagina d´inizzio del nostro sito web (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) oppure scaricare e eprire  l´applicazione, dopo fare click su  « <a href=\"https://www.Sistema.com/\">Registrati</a> », completare gli spazi con i dati del paese, lingua e posta elettronica del tuo negozio, assegnare la parola d´ordine al tuo conto, e accettare i termini e condizioni di Sistema.\r\n\r\nAnche puoi scegliere di fare un registro diretto attraverso le seguenti reti sociali:  Facebook, Google+'),
(134, 2, 2, 'fr', 'Il y a-t-il des frais d´inscription?', 'L´inscription à Sistema est gratuite et le restera.\r\n'),
(135, 1, 1, 'fr', 'Comment m´inscrire sur Sistema? ', 'L´inscription à Sistema est simple et gratuite. Il vous suffit de vous diriger vers la page d´accueil de notre site Internet (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) ou bien de télécharger et d´ouvrir l´application et de cliquer sur « <a href=\"https://www.Sistema.com/\">S´inscrire</a> ». Complétez ensuite les champs de votre pays, de langue, entrez l´adresse e-mail de votre entreprise, créez votre mot de passe pour votre compte, et enfin, acceptez les termes et conditions de Sistema.\r\n\r\nVous pouvez également vous enregistrer directement à travers les réseaux sociaux suivants : Facebook, Google+'),
(136, 3, 3, 'fr', 'J´ai oublié le mot de passe de mon compte.', 'Vous avez oublié votre mot de passe de votre compte Sistema? Dirigez-vous vers la page d´accueil de notre site Internet (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) ou bien téléchargez et ouvrez l´application. Sur la page d´enregistrement, cliquez sur « <a href=\"https://www.Sistema.com/\">Demander</a> » et renseignez le champs avec l´adresse e-mail de votre compte Sistema. Nous vous enverrons ensuite automatiquement le lien de la page où vous pourrez créer un nouveau mot de passe pour votre compte.'),
(137, 4, 4, 'fr', 'Comment puis-je trouver des contacts pour mes produits et services d´intérêt?', 'Si vous souhaitez localiser de nouveaux contacts commerciaux chez Sistema, des clients potentiels ou des fournisseurs, intéressés par les produits ou services qui sont au cœur de votre affaire, vous devrez premièrement publierce que vous proposez ou cherchez dans votre compte Sistema.\r\n\r\n1.	Dirigez-vous vers la page d´accueil de notre site Internet (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) ou bien téléchargez et ouvrez l´application.\r\n\r\n2.	Après vous être identifié dans le système, la mise en ligne se fait de manière individuelle dans les tableaux « <a href=\"https://www.Sistema.com/productos/index/1\">Mes offres</a> » et « <a href=\"https://www.Sistema.com/productos/index/2\">Mes demandes</a> ». Les informations téléchargées dans ces catégories nous permettent de localiser et de connecter les utilisateurs d´intérêts complémentaires.\r\n\r\nDans le tableau « <a href=\"https://www.Sistema.com/productos/index/1\">Mes offres</a> » seront publiés les produits ou les services que vous vendez. Dans le tableau « <a href=\"https://www.Sistema.com/productos/index/2\">Mes demandes</a> », les produits ou les services que vous souhaitez acquérir.\r\n\r\n3.	Repérez le tableau voulu, cliquez sur le signe « + » pour ajouter un nouveau produit ou service, et complétez ensuite l´information clé suivante, dans chaque champs correspondant:\r\n\r\n« Produit ou service »: En entrant des mots, des phrases ou les 6 premiers chiffres du code du Système Harmonisé (*) de vos produits, vous cherchez et sélectionnez dans la Nomenclature les descriptions qui correspondent le mieux à vos produits ou services à publier.\r\n« Pays »: Choisissez le pays dans lequel est implantée votre activité et dans lequel l´offre et la demande enregistrées prennent lieu.\r\n« Ville »: Choisissez la ville dans laquelle est implantée votre activitéet dans laquelle l´offre et la demande enregistrées prennent lieu.\r\nSi votre activité se trouve dans plusieurs pays et plusieurs villes, vous pouvez sélectionner le pays ou la ville le/la plus activement impliqué(e) dans la transaction, ou vous pouvez également publier plusieurs fois le produit ou le service en utilisant toutes les combinaisons de pays et de villes où se trouve votre activité, selon vos critères.\r\n« Détail »: Dans ce champs, décrivez brièvement les particularités des produits ou des services non considérés dans la description de la nomenclature, et qui aideront le reste des utilisateurs à mieux connaître votre offre et votre demande. Augmentant ainsi les possibilités de commercialisation (utiliser max. 255 caractères).\r\n« Adresse e-mail »: Vous pouvez ajouter toutes les adresses e-mail auxquelles vous souhaitez être contacté par le reste des utilisateurs Sistema, pour la commercialisation des produits et services en question, ou simplement laisser l´adresse email prédéterminée lors de votre inscription. \r\n« Langue »: Vous pouvez ajouter d´autres langues maîtrisées, par vous ou par les personnes qui recevront les courriers électroniques des comptes indiqués au préalable.\r\n« Images »: Vous pouvez télécharger toutes les images que vous souhaitez, des produits ou des services en question. \r\n\r\n4.	Pour terminer, veuillez garder les changements. Afin de confirmer que la publication s´est effectuée correctement, vérifiez que vous pouvez visualiser la carte contenant les informations de votre produit ou service téléchargé, dans le tableau correspondant.\r\n\r\n(*) Le système Harmonisé (Nomenclature du SH) est une nomenclature internationale définit par l´Organisation Mondiale des Douanes (OMD), pour la classification des produits. Il permet aux pays participants de classifier les produits commercialisés dans une base commune, à des fins douanières. Au niveau international, le Système Harmonisé de classification de marchandise est un système de code de six chiffres. Cette nomenclature ne s´applique pas aux services, qui sont, quant à eux, classés selon une nomenclature supplémentaire spécifique, développée par l´Organisation Mondial du Commerce (OMC).\r\n'),
(138, 5, 5, 'fr', 'Que se passe-t-il si je ne trouve pas mon produit ou mon service parmi les descriptions de la Nomenclature?', 'Si dans le champ « Produit ou service », vous ne trouvez pas les descriptions qui correspondent à votre recherche, veuillez essayer les options suivantes:\r\n\r\n« Classification manuelle »: Grâce à la « Classification Manuelle » (loupe), vous pouvez avoir accès à la nomenclature complète afin de classifier, en 3 étapes et en choisissant les descriptions qui correspondent le mieux à vos produits ou services.\r\n\r\n« Consultez un expert »: Vous pouvez consulter un expert en opérations d´exportations ou d´importations (douanier) de votre pays afin de savoir quel est le code du Système Harmonisé (*) correspondant à votre produit, en considérant que selon la composition ou les critères de classification, il peut y avoir entre un ou plusieurs codes. S´il existe plus d´un code, optez pour tous les enregistrer (omettre cette option s´il s´agit de services).\r\n\r\n« Consultez Internet »: Une option souvent utile, bien que moins précise, est de consulter dans le chercheur d´Internet quel est le Code du Système Harmonisé (*) pour votre produit et d´analyser l´information donnée par le Web. Dans tous les cas, afin de les télécharger, utilisez les 6 premiers chiffres des différents Codes du Système Harmonisé (*) trouvés, dont les descriptions correspondent le mieux à votre produit, selon vos critères personnels (Omettre cette option s´il s´agit de services).\r\n\r\n(*) Le système Harmonisé (« Nomenclature du SH ») est une nomenclature internationale définit par l´Organisation Mondiale des Douanes (OMD), pour la classification des produits. Il permet aux pays participants de classifier les produits commercialisés dans une base commune, à des fins douanières. Au niveau international, le Système Harmonisé de classification de marchandise est un système de code de six chiffres. Cette nomenclature ne s´applique pas aux services, qui sont, quant à eux, classés selon une nomenclature supplémentaire spécifique, développée par l´Organisation Mondial du Commerce (OMC).'),
(139, 6, 6, 'fr', 'Quelles informations pertinentes pourrai-je observer pour chaque résultat?', 'Après avoir enregistré vos produits ou services dans le tableau « <a href=\"https://www.Sistema.com/productos/index/1\">Mes offres</a> » et « <a href=\"https://www.Sistema.com/productos/index/2\">Mes demandes</a> », les utilisateurs recherchant ou offrant les produits ou services qui correspondent à vos recherches, seront automatiquement localisés et s´afficheront dans votre tableau de « <a href=\"https://www.Sistema.com/resultados/\">Résultats</a> ». \r\n\r\nDans le tableau de « <a href=\"https://www.Sistema.com/resultados/\">Résultats</a> », vous pourrez donc visualiser, pour chacune des offres et des demandes localisées, et selon vos intérêts: \r\n\r\no	Si l´utilisateur cherche à acheter ou à offrir le produit ou le service.\r\no	Les images du produit ou du service enregistrées par l´utilisateur. \r\no	La description de la nomenclature sur le produit ou le service d´intérêt correspondant entre vous et l´utilisateur.\r\no	Des détails particuliers du produit ou du service, spécifiés par l´utilisateur.\r\no	Le pays et la ville où est implantée l´activité de l´utilisateur.\r\no	La langue parlée de l´utilisateur.\r\no	L´adresse e-mail que l´utilisateur a ajouté dans contact.\r\no	Le dernier accès à Sistema.\r\no	La qualification attribuée par d´autres utilisateurs.\r\no	La quantité d´utilisateurs de Sistema l´ayant vu.\r\no	Les références commerciales de l´utilisateur.\r\no	Les statistiques de commerce international sur le produit en question.'),
(140, 7, 7, 'fr', 'Que signifie la « Qualification »?', 'La « Qualification » indique la moyenne du niveau d´importance attribuée (de 1 à 5) par les utilisateurs Sistema, sur l´offre et la demande définit. Vous pouvez qualifier chaque publication si vous le souhaitez. La qualification est anonyme et sans besoins d´explications.'),
(141, 8, 8, 'fr', 'Que signifie le « Vu »?', 'Le « Vu » nous renseigne sur la quantité d´utilisateurs de Sistema qui a accédé à l´offre ou la demande définis afin de voir l´information complète.'),
(142, 9, 9, 'fr', 'Que signifient les « Références commerciales »?', 'Les « Références commerciales » vous indiquent que les comptes de l´adresse e-mail de l´utilisateur qui a publié l´offre ou la demande, ont été validés par d´autres comptes d´adresses e-mail fournis par cet utilisateur, desquels vous pouvez voir le @domaine. Les « Références commerciales » permettent d´obtenir certaines garanties sur l´existence de l´utilisateur dans le commerce en question. Plus le nombre et la qualité des domaines des références commerciales est élevé, plus la qualité de l´utilisateur est élevée. Vous pouvez valider toute publication que vous souhaitez.'),
(143, 10, 10, 'fr', 'Quelle information statistique trouvez-vous pour chaque résultat?', 'Des statistiques de commerce international sur le produit en question qui vous permettront de connaître les valeurs des flux de commerce  bilatéral existant entre votre pays et le pays de l´utilisateur, mais aussi le flux de commerce du pays de ce dernier avec le reste du monde. Ces deux résultats sont de toute importance puisqu´ils vous indiqueront s´il existe ou non des exportations/importations (si approprié) du produit, en relation avec le marché de l´utilisateur localisé. Ou bien s´il existe des barrières tarifaires ou paratarifaires qui bloqueraient le marché. Ils vous renseigneront également sur la croissance de ces exportations/importations, pour les 5 dernières années.'),
(144, 11, 11, 'fr', 'Quelles informations de mon profil sont pertinentes afin d´améliorer mes communications et mes affaires? ', 'Dans votre profil d´utilisateur Sistema, vous pouvez ajouter des informations sur vous et/ou sur votre activité, et décider de la rendre visible des autres utilisateurs. \r\n\r\nUn profil complet contenant une information fidèle reflète un contact fiable avec qui l´on peut commencer à entreprendre des conversations ainsi que des relations commerciales. Pour cela, Sistema recommande aux utilisateurs: \r\n\r\n1) Établir la majeure quantité de voies de communication pour le reste des utilisateurs.\r\n2) Éviter les erreurs dans l´information donnée.\r\n3) Répondre rapidement aux demandes reçues dans les différents canaux établis. '),
(145, 12, 12, 'fr', 'Quelles informations vous donne le tableau de statistiques de commerce international de votre pays?', 'Le tableau de statistiques de commerce international de votre pays vous donne une liste des produits exportés et importés par votre pays, qui ont enregistré la meilleure croissance en valeurs (USD FOB et CIF, réciproquement), en comparant les sommes totales annuelles enregistrées les 5 dernières années. Vous pourrez ainsi connaître les produits qui ont amélioré la dynamique de vos échanges internationaux.'),
(146, 13, 13, 'fr', 'Quelles informations vous donne le tableau de produits et services d´activité majeure?', 'Le tableau de produits et services d´activité majeure vous montrera les produits et les services qui ont enregistré le plus de grand nombre de chargements de la part des utilisateurs Sistema, en offres comme en demandes. Une information clé quand vous voulez savoir quelles positions sont les plus actives dans le monde, autrement dit, quels sont les codes qui ont le plus de contact.'),
(147, 14, 14, 'fr', 'Qu´est-ce que le tableau de Message aux utilisateurs? ', 'Dans ce tableau, vous pourrez poser vos questions (jusqu´á 255 caractères maximum) concernant un produit, un service, ou un marché en particulier, afin que chaque utilisateur de Sistema qui le souhaite, puisse vous répondre. '),
(148, 15, 15, 'fr', 'Comment faire connaître mon entreprise sur Sistema?', 'Si vous souhaitez promouvoir votre activité sur Sistema, merci de nous écrire à <a href=\"mailto: advertising@Sistema.com\">advertising@Sistema.com</a>'),
(149, 16, 16, 'fr', 'Comment puis-je me communiquer avec l´équipe d´aide de Sistema?', 'Pour toute question ou commentaire sur le fonctionnement du site, merci de nous écrire à <a href=\"mailto: support@Sistema.com\">support@Sistema.com</a>'),
(150, 2, 2, 'it', 'Ha costo il mio registro?', 'Il registro su Sistema e gratuito e lo sará sempre.\r\n'),
(151, 3, 3, 'it', 'Ho scordato la parola d´ordine del mio conto.', 'Se hai scordato la parola d´ordine del tuo conto in Sistema, soltanto hai bisogno d´entrare nella pagina d´inizio del nostro sito web (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) oppure scaricare e aprire l´applicazione, nel pannello d´ingresso, cliccare su « <a href=\"https://www.Sistema.com/\">Chiedere</a> », completare lo spazio con la tua posta elettronica del tuo conto in Sistema e ti rinvieremmo in modo automatico il collegamento di accesso al pannello dove potrai ristabilire la nuova parola d´ordine per il tuo conto.'),
(152, 4, 4, 'it', 'Come posso trovare contatti d´interesse per i miei prodotti o servizzi? ', 'Se desideri localizzare nuovi contatti commerciali in Sistema, potenziali clienti o fornitori, interessati sui prodotti o servizi che fanno parte del nucleo del tuo negozio, prima hai bisogno di caricare quello che tu offri o cerchi nel tuo conto Sistema.\r\n\r\n1) Entra alla pagina d´inizzio del nostro sito web (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) oppure scarica e apri  l´applicazione.\r\n\r\n2) Dopo l´accesso nel sistema, la carica si fa individualmente nei pannelli  « <a href=\"https://www.Sistema.com/productos/index/1\">Le mie offerte</a> » e « <a href=\"https://www.Sistema.com/productos/index/2\">Le mie richieste</a> ». L´informazione caricata in questi pannelli ci permette localizzate e collegare gli utenti d´interessi complementari.\r\n\r\nNel pannello« <a href=\"https://www.Sistema.com/productos/index/1\">Le mie offerte</a> » si caricheranno i prodotti o servizi che vendi. Nel pannello  « <a href=\"https://www.Sistema.com/productos/index/2\">Le mie richieste</a> » si caricheranno i prodotti o servizi che desideri acquisire.\r\n\r\n3) Situato nel pannello desiderato, clicca nel simbolo « + » per aggiungere un nuovo prodotto o servizio, e dopo completi le seguenti informazioni chiavi in ogni spazio corrispondente:\r\n\r\n« Prodotto o servizio »: Inserendo parole, frasi o i primi 6 digiti del codice del Sistema Armonizado (*) dei tuoi prodotti, cerchi e selezioni nel nomenclatore le descrizioni  che si adecuano ai prodotti o servizi da caricare.\r\n« Paese »: Scegli il paese dove si trova il tuo negozio e dov´ é l´offerta o richiesta caricata.\r\n« Cittá »: Scegli la tua cittá dove si trova il tuo negozio e dov´é l´offerta e la richiesta caricata.\r\nSe il tuo negozio si trova in molti paesi e cittá, puoi scegliere quello che é attivamente coinvolto nella transazione oppure puoi caricare molte volte il prodotto o servizio utilizzando tutte le combinazioni di paesi e cittá dove si trava il tuo negozio secondo il tuo giudizio.\r\n« Dettaglio »: In questo spazio descrivi brevemente le particolaritá dei prodotti o servizi che non prevede la descrizione del nomenclatore e che aiuterá al resto degli utenti  a conoscere meglio l´offerta e la richiesta, aumentando le possibilitá della sua commercializzazione (utilizando 255 caretteri massimo)\r\n« Posta elettronica »: puoi incorporare tutte le poste elettroniche dove desideri che il resto degli utenti di Sistema si mettano in contatto per commercializzare i prodotti o servizi in questione, o semplicemente lasciare  la posta elettronica predefinita del tuo registro.\r\n« Lingua »: puio incorporare altre lingue che parli tu o le altre persone che ricevono la posta elettronica nei conti informati precedentemente.\r\n« Immagini »: Puoi caricare tutte le immagini che desideri sui prodotti o servizi in questione.\r\n\r\nInfine guarda i cambi. Per confermare che la carica si abbia effettuato correttamente, dovrai visualizzare il pannello che corrisponda la scheda con l´informazione del prodotto o servizio caricato.\r\n\r\n(*) Il Sistema Armonizado é una nomenclatura internazzionale stabilita per l´Organizzazione Mondiale di Dogane per la classifica dei prodotti. Permette ai paesi partecipanti fare una classifica dei prodotti commercializzati in una base comune con fini doganali. Internazionalmente il Sistema Armonizado di classifica di merci é un sistema di codice di sei digiti. Tale nomenclatura non si applica per servizi, i quali sono classificati sotto una nomenclatura aggiuntiva specifica sviluppata per l´ Organizzazione Mondiale del Commercio.'),
(153, 5, 5, 'it', 'Cosa succede se non trovo il mio prodotto o servizio tra le descrizzioni del nomenclatore?', 'Se nello spazio « Prodotto o servizio » non trovi le descrizzioni che combaciano con la tua ricerca, prova con alcuna delle seguienti opzioni:\r\n\r\n« Classifica manuale »: Attraverso la « Classifica manuale » (lente d´ingrandimento) puoi aver accesso al nomenclatore completo per fare la classifica, in tre passi, scegliendo la descrizzione che sia piú adeguata a i tuoi prodotti o servizi.\r\n\r\n« Fai una consultazione a uno sperto »: Puoi domandare a uno sperto in operazioni di esportazione o importazione (ufficiale di dogana) nel tuo paese , quel´é il codice di Sistema Armonizzato (*) corrispondente al tuo prodotto poiché secondo la sua composizione o giudizio di classifica, puó avere uno o molti.\r\n\r\n« Domanda su internet »: Una scelta molte volte ultile, ma non cosí precisa, é domandare su internet il Codice di Sistema Armonizzato (*) per il tuo prodotto e analizzare l´informazione che concede la web. In ogni caso, caricare utilizzando i primi 6 digiti dei diversi Codici di Sistema Armonizzato (*) trovati, le quali descrizzioni, secondo il tuo giudizio, consideri si adecuano al tuo prodotto (ovviare questa scelta nel caso dei servizi).\r\n\r\n(*) Il Sistema Armonizado é una nomenclatura internazzionale stabilita per l´Organizzazione Mondiale di Dogane per la classifica dei prodotti. Permette ai paesi partecipanti fare una classifica dei prodotti commercializzati in una base comune con fini doganali. Internazionalmente il Sistema Armonizado di classifica di merci é un sistema di codice di sei digiti. Tale nomenclatura non si applica per servizi, i quali sono classificati sotto una nomenclatura aggiuntiva specifica sviluppata per l´ Organizzazione Mondiale del Commercio.'),
(158, 7, 7, 'it', 'Cosa significa « Valutazione »?', 'La « Valutazione » indica la media del livello d´importanza concesso (dal 1 al 5) da utenti di Sistema all´offerta o richista determinata. Puoi valutare ogni pubblicazione se lo desideri. La valutazione é di carattere anonima e senza motivi.'),
(159, 8, 8, 'it', 'Cosa significa il  « Visto »?', 'Il « Visto » indica la quantitá di utenti di Sistema che hanno entrato all´offerta o la richiesta per vedere l´informazione completa.');
INSERT INTO `faq` (`faq_id`, `faq_numero`, `faq_orden`, `idi_code`, `faq_pregunta`, `faq_respuesta`) VALUES
(160, 9, 9, 'it', 'Cosa significano i « Referimenti commerciali »?', 'I « Riferimenti commerciali » indicano che i conti di posta elettronica dell´utente che hanno pubblicato l´offerta o la richiesta sono state convalidate per terze poste elettroniche fornite per lútente, delle quali puoi visualizzare il @domini. I riferimenti commerciali permettono ottenere garanzie dell´esistenza dell´utente nel negozio. Piú numeri e qualitá di domini di riferimenti commerciali, di piú qualitá sará l´utente. Tu puoi convalidare ogni pubblicazione se lo desideri.'),
(161, 10, 10, 'it', 'Che informazione statistica trovi in ogni risultato?', 'Statistiche di commercio internazionale sul prodotto in questione che ti permetteranno conoscere, da una parte il flusso di commercio bilaterale esistente tra il tuo paese e il paese dell´utente, e dall´altra parte, il flusso di commercio che ha il paese dell´utente localizzato col resto del mondo. Entrambi dati sono di molta importanza, dato che ti faranno vedere se esistono esportazioni/importazioni (secondo il caso) del prodotto, legati al mercato dell´utente localizzato, oppure se esiste quealche barriera tariffaria o non-tariffaria che stia bloccando il commercio, e se c´é questa attivitá, se queste esportazioni/importazioni esistenti sono cresciute o no durante gli ultimi 5 anni.'),
(162, 11, 11, 'it', 'Che informazione del mio profilo é chiave per rafforzare le comunicazzioni e i negozi?', 'Nel tuo profilo di utente Sistema potrai estendere informazione su di te e/o la tua dita/societá, e optare se desideri che la stessa sia visibile per gli altri utenti.\r\n\r\nUn profilo completo con informazione veritiera denota un contatto fidebole con chi cominciare ad avviare un dialogo e relazioni commerciali. Sistema raccomanda agli utenti:\r\n\r\n1) Stabilire la maggior quantitá di vie di contatto per il resto degli utenti\r\n2) Evitare errori nell´informazzione fornita.\r\n3) Rispondere con rapiditá alle consultazioni ricevute per le differenti vie stabilite.'),
(163, 12, 12, 'it', 'Che informazione indica il pannello di prodotti e servizi con maggior attivitá?', 'Il pannello  di prodotti e servizi con maggior attivitá ti renderá conto sui prodotti e servizi che possiedono maggior quantitá di cariche, sia come offerte o come richieste, da parte degli utenti di Sistema. Informazione chiave all´ ora di saper quali sono le posizioni calde nel mondo, cioè i codici che hanno il maggior numero di contatti.'),
(164, 13, 13, 'it', 'Quali informazioni mostra il panel di prodotti e servizi con la massima attività?', 'Il panel di prodotti e servizi con la maggior parte delle attività ti mostrerà i prodotti e i servizi che hanno più carichi, sia come offerte sia come richieste, dagli utenti di Sistema. Informazioni chiave quando si tratta di sapere quali sono le posizioni hot nel mondo, cioè i codici che hanno il maggior numero di contatti.'),
(165, 14, 14, 'it', 'Cos´é il pannello di Messaggi agli utenti?', 'In questo pannello potrai lasciare consultazioni brevi (fino a 255 caratteri) relative a un prodotto o servizio e a un mercato in particolare, per essere risposte per qualsiasi degli utenti di Sistema.'),
(166, 15, 15, 'it', 'Come posso pubblicizzare la mia dita in Sistema?', 'Se desideri pubblicizzarte in Sistema, per piacere scrivici a  <a href=\"mailto: advertising@Sistema.com\">advertising@Sistema.com</a>'),
(167, 16, 16, 'it', 'Come posso contattare la squadra d´ assistenza di Sistema?', 'Se hai qualche consultazione o commento sul funzionamento del sito, per piacere scrivici a <a href=\"mailto: support@Sistema.com\">support@Sistema.com</a>'),
(168, 1, 1, 'ru', 'Как я могу зарегестрироваться на сайте Sistema? ', 'Регистрация в Sistema проста и бесплатна, вам нужно только войти на домашнюю страницу нашего сайта (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) или загрузить и открыть приложение, затем нажать « <a href=\"https://www.Sistema.com/\">Регистрация</a> », заполнить поля вашими данными, как страна, язык и ваша деловая электронная почта, создать пароль своей учетной записи и примите условия Sistema.\r\n\r\nВы также можете сделать прямую запись через следующие социальные сети: Facebook, Google+'),
(169, 2, 2, 'ru', 'Имеет какую то стоимость моя регистрация на сайте?', 'Регистрация на нашем сайте бесплатна и всегда будет так.'),
(170, 3, 3, 'ru', 'Забили пароль от аккаунта.', 'Если вы забыли пароль своей учетной записи в Sistema, вам нужно только зайти на нащу домашнюю страницу (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) или загрузить и открыть приложение, в панели ввода нажмите « <a href=\"https://www.Sistema.com/\">Запрос</a> », заполните поле с адресом электронной почты своей учетной записи Sistema, чтобы мы могли автоматически отправить вам ссылку, где вы сможете обновить пароль для своего аккаунта.'),
(171, 4, 4, 'ru', 'Как мне найти контакты для предлогаемых товаров или услуг моего интереса? ', 'Если вы хотите найти новые деловые контакты в Sistema, потенциальных клиентов или поставщиков, заинтересованных в продуктах или услугах, которые являются основной частью вашего бизнеса, вам сначала нужно загрузить то, что вы предлагаете или ищете в своём аккаунте в Sistema.\r\n\r\n1) Зайдите на домашнюю страницу нашего сайта (<a href=\"https://www.Sistema.com/\">www.Sistema.com</a>) или скачайте и откройте приложение.\r\n\r\n2) После входа в систему загрузка выполняется индивидуально в панелях « <a href=\"https://www.Sistema.com/productos/index/1\">Мои предложения</a> » и « <a href=\"https://www.Sistema.com/productos/index/2\">Мои требования</a> ». Информация, загруженная в эти панели, позволяет нам находить и связывать пользователей между собой, дополняя интересы. \r\n\r\nВ панели « <a href=\"https://www.Sistema.com/productos/index/1\">Мои предложения</a> » будут продаваться товары или услуги, которые вы продаете. В панели « <a href=\"https://www.Sistema.com/productos/index/2\">Мои требования</a> » будут загружены продукты или услуги, которые вы хотите приобрести.\r\n\r\n3) Находясь в желаемой панели, щелкните знак (+), чтобы добавить новый продукт или услуги, а затем заполните следующую ключевую информацию в каждом соответствующем поле:\r\n\r\n« Продукт или услуга »: вводя слова, фразы или первые 6 цифр кода ТН ВЭД (*) ваших продуктов, вы ищите в класификаторе продуктное описания, которое наилучшим образом соответствуют загружаемым продуктам или сервисам.\r\n« Страна »: Выберете страну в которой находится ваш бизнес и где будет оказыватся услуги или предложение товара.\r\n« Город »: Выберете город в которой находится ваш бизнес и где будет оказыватся услуги или предложение товара.\r\nЕсли ваша компания находится в нескольких странах и городах, вы можете выбрать страну и город, которые активно участвуют в транзакции, или вы можете загрузить продукт или услугу несколько раз, используя все комбинации стран и городов, на которых основана ваша компания, по вашему усмотрению.\r\n« Описание »: в этом поле вы кратко описываете особенности продуктов или услуг, которые не включают описание номенклатора, и это поможет остальным пользователям лучше узнать ваше предложение или спрос, увеличивая его продажи (используя максимум 255 букв).\r\n« Эллектронная почта »: Вы можете включить все электронные адреса, по которым вы хотите, чтобы другие пользователи Sistema могли связывязатся с вами или можете просто оставить электронный адрес вашей регистрации.\r\n« Языки »: Вы можете включить другие языки, которыми вы владеете, или контакты, которые получат электронные письма в ранее информированных аккаунтах.\r\n« Изображения »: Вы можете загружать все изображения, которые вы жилаете о соответствующих продуктах или услугах.\r\n\r\n4) Как закончите, сохраните изменения. Чтобы убедиться, что загрузка выполнена правильно, вы должны увидеть на панели, соответствующей карточку, с загруженной информацией о продукте или услуге.\r\n\r\n(*) Гармонизированная система описания и кодирования товаров (ГС) представляет собой многоцелевую международную номенклатуру товаров, разработанную Всемирной таможенной организацией (ВТО) Гармонизированная система используется для формирования таможенных тарифов и сбора статистических данных о внегней торговле. Выделенным категориям присваиваются коды из 6 цифр. Эта номенклатура не распространяется на услуги, которые классифицируются по конкретной дополнительной номенклатуре, разработанной Всемирной торговой организацией (ВТО).'),
(172, 5, 5, 'ru', 'Что делать, если я не могу найду свой продукт или услугу среди описаний номенклатора?', 'Если в поле поиска « Продукт или услуга » вы не можете найти описания, соответствующие вашему поиску, воспользуйтесь одним из следующих вариантов:\r\n\r\n« Классификация в ручную »: нажав на лупу, вы можете получить доступ к полному номенклатору, в трех шагах вы сможете выбрать описания, наиболее подходящие для ваших продуктов или услуг\r\n\r\n« Консультация у специалиста »: Вы можете проконсультироваться у эксперта по  экспортным или импортным сделкам (таможенный брокер) в вашей стране, что бы узнать, который является кодом Гармонизированной системы (*), соответствующим вашему продукту, учитывая, что согласно его составу или критерию классификации вы можете иметь 1 или несколько кодов, если есть несколько вариантов загрузите их все (исключить этот вариант в случае сервисов).\r\n\r\n« Поиск в интернете »: Вариант, который часто бывает полезным, хотя и не столь точным, - запросите систему поиска в Интернете для Гармонизированного системного кода (*) для вашего продукта и проанализировать информацию, предоставленную веб-сайтом. Всегда использовыйте первые 6 цифры различных Согласованных системных кодов (*), описание которых по вашему личному критерию,  вы считаете, более чётко подходит к вашему продукту (исключить этот вариант в случае предоставления услуг).\r\n\r\n(*) Гармонизированная система описания и кодирования товаров (ГС) представляет собой многоцелевую международную номенклатуру товаров, разработанную Всемирной таможенной организацией (ВТО) Гармонизированная система используется для формирования таможенных тарифов и сбора статистических данных о внегней торговле. Выделенным категориям присваиваются коды из 6 цифр. Эта номенклатура не распространяется на услуги, которые классифицируются по конкретной дополнительной номенклатуре, разработанной Всемирной торговой организацией (ВТО).'),
(173, 6, 6, 'ru', 'Какую важную для себя, информацию я смогу получить с каждого результата? ', 'После того как загрузите ваш товар или услугу в отделе « <a href=\"https://www.Sistema.com/productos/index/1\">Мои предложения</a> » или « <a href=\"https://www.Sistema.com/productos/index/2\">Мои запросы</a> », автоматически будут вычеслены и покажутся на вашем отделе « Результаты », те пользователи, которые ищят или предлогают, продукты или услуги соответсвующии вашем спецификациям.\r\n\r\nВ отделе « <a href=\"https://www.Sistema.com/resultados/\">Результаты</a> » вы сможете увидеть предложения или запросы, соответсвующии вашим интересам:\r\n \r\no Сможете узнать, если пользователь ищет или предлогает, товар или услуги.\r\no Увидеть изображения продукта или услуг которые загрузил пользователь.\r\no Схожии описания ТН ВЭД  товара или услуги сопоставимого интереса между вами и другово пользователя.\r\no Специфика товара или услуги, указанная пользователем.\r\no Страна и город где находится бизнес пользователя.\r\no Языки которыми владеет пользователь.\r\no Электронные адреса которые пользователь указал для обратной связи.\r\no Последнее посещение в Sistema.\r\no Рейтинг, присвоенный другими пользователями.\r\no Количество пользователей Sistema которые его видели.\r\no Коммерческие ссылки пользователей.\r\no Статистики международной торговле на обсуждаемый продукт.'),
(174, 7, 7, 'ru', 'Что означает « Классификация »?', '« Классификация » указывает на средний уровень важности (с 1 до 5), преданный пользователями Sistema для определённого предложения или спроса. Вы можете оценить каждую публикацию, если хотите. Квалификация анонимна и без причины.'),
(175, 8, 8, 'ru', 'Что означают « Просмотры »? ', '« Просмотры » указывают на количество пользователей Sistema который зашли в предложения или запросы, что бы увидеть полную информацию.'),
(178, 9, 9, 'ru', 'Что означают « Коммерческие подтверждение »?', 'Все « Коммерческие подтверждение » указывают на то, что электронные адреса, пользователя который сделал объявление предложения или запроса, были подтверждены другими адресами обозначиными пользователем, которых вы можете видить @dominio. Коммерческие подтверждение помогают иметь гарантию о том, что пользователи действительно сушествуют. Чем больше количество и качество коммерческих ссылочных доменов, тем выше качество пользователя. Вы можете подтвердить каждую публикацию, если хотите.'),
(179, 10, 10, 'ru', 'Какую статистичискую информацию вы получаете с каждым результатом?', 'Статистика международной торговли по рассматриваемому продукту, который позволит вам узнать о ценностях, с одной стороны, поток двусторонней торговли между вашей страной и страной пользователя, а с другой стороны - поток торговли, который страна пользователя со всем миром. Эти данные очень важны, потому что они покажут вам, есть ли экспорт / импорт (по соответствию) продукта в отношении рынка вычесленного пользователя или если существует тарифный или пара-тарифный барьер, который блокирует торговлю, если существующая торговля между странами выросла или нет за последние 5 лет.'),
(180, 11, 11, 'ru', 'Какая информация в моем профиле, является ключевой для повышения потенциала возможностей коммуникации и бизнеса? ', 'В своем профиле пользователя Sistema вы можете дополнять информацию о своей личности и / или вашей компании и выбрать, хотите ли вы, чтобы он был видимым для других пользователей.\r\n\r\nЗаполненый профиль, с точной информацией, означает надежный контакт с кем начать общение и деловые отношения. Sistema рекомендует пользователям:\r\n\r\n1) Указать наибольшее количество путей связи для других пользователей.\r\n2) Избегайте ошибок в предоставленной информации.\r\n3) Не задерживатся с ответом на полученные вопросы, через различкые указанные пути.'),
(181, 12, 12, 'ru', 'Какие статистики вы можете найти об международной торговле вашей страны? ', 'Отдел статистик международной торговли вашей страны, покажит список с экспортированными товарами и импортированными по всей вашей стране, у который было зарегестрированно повышение (с долларах США FOB или CIF), сравнивая суммы последних 5 лет. Таким образом вы можете узнать какие продукты имеют лучшую диамику в международном бизнессе.'),
(182, 13, 13, 'ru', 'Какую информацию показывает отдел товаров и услуг с наибольшем задействием на сайте?', 'Отдел товаров и услуг с наибольшем задействием на сайте, показывает продукты и услуги которые больше всего загружали, как предложение или как запросы, пользователи Sistema. Эта информация важна, для вычисления таможенной позиции продуктов с большим спросом. '),
(183, 14, 14, 'ru', 'Что такое, отдел Сообщения пользователям?', 'В этом отделе, вы можете оставить свои вопросы (до 255 букв) связаных с продуктами или услугами для определённого рынка, для получения ответа от любова пользователя Sistema.'),
(184, 15, 15, 'ru', 'Как мне сделать объявление своей фирмы в Sistema?', 'Если вы хотите сделать объявление в Sistema, пожалуйста свяжитесь с нами на <a href=\"mailto: advertising@Sistema.com\">advertising@Sistema.com</a>'),
(185, 16, 16, 'ru', 'Как мне связаться с группой поддержки Sistema?', 'Если у вас есть вопросы или комментарии по поводу нашего сайта, пожалуйста напишите на  <a href=\"mailto: support@Sistema.com\">support@Sistema.com</a>');
