INSERT INTO `mails_info` (`mi_id`, `mi_codigo`, `idi_code`, `mi_asunto`, `mi_titulo`, `mi_cuerpo1`, `mi_cuerpo2`, `mi_texto_crudo`) VALUES
(1, 1, 'ar', 'Sistema أهلاً بك في', '[USER MAIL] عزيزي المستخدم', 'Sistema أهلاً بك في \r\n\r\n إن هذه منصة الأعمال التجارية التي تسمح لك بطريقة بسيطة و مجانية مع أولئك الذين يبحثون عن تلك المنتجات و الخدمات التي تقدمها أو تعرضها، أو مع أولئك الذين يقدمون المنتجات و الخدمات \r\n.التي أنت تريدها\r\n', 'للأمان ، يجب عليك التحقق من صحة عنوان البريد الإلكتروني قبل الوصول إلى المجتمع. فقط \r\n:اضغط على الرابط أدناه لتأكيد عنوانك و أكمل التسجيل المختصر\r\n[LINK]\r\n\r\n إذا كان الرابط لايعمل ، بإمكانك التحقق من عنوان البريد الإلكتروني لديك بشكل يدوي عبر هذا \r\n:الرابط ، حيث يجب عليك إدخال المعلومات التالية\r\n[HTTP/:]\r\n:البريد الالكتروني\r\n[USER MAIL] \r\n:الرمز \r\n[CLAVE] \r\n\r\n.إذا لم يتم طلب الانضمام لدى Sistema، ارفض هذا البريد الإلكتروني\r\n\r\nبإخلاص\r\n Sistema LLC\r\n', NULL),
(2, 1, 'de', 'Willkommen bei Sistema', 'Sehr geehrte/r Benutzer [USER MAIL]:', 'Herzlich willkommen bei Sistema.\r\n\r\nDiese Business-Plattform wird Ihnen ermöglichen, sich einfach und kostenlos mit anderen Benutzern zu verbinden, die Ihre Produkte oder Dienstleistungen suchen oder auch mit denen, die von Ihnen gesuchten Produkte oder Dienstleistungen anbieten.', 'Aus Sicherheitsgründen muss Ihr E-Mail-Adresse vor dem ersten Zugriff auf diese Plattform überprüft werden.\r\n\r\nKlicken Sie einfach auf den untenstehenden Link, um Ihre Adresse zu bestätigen und füllen Sie ein kurzes Formular aus:\r\n[LINK]\r\n\r\nFalls dieser Link nicht funktioniert, können Sie Ihre E-Mail-Adresse auch manuell über  diesen Link überprüfen, in dem Sie folgenden Informationen eingeben:\r\n[HTTP/:]\r\nE-Mail-Adresse: [USER MAIL]\r\nSymbol: [CLAVE]\r\n\r\nFalls Sie nie gewünscht haben, sich bei uns anzumelden, ignorieren Sie diese E-Mail.\r\n\r\nMit freundlichen Grüßen\r\nSistema LLC', NULL),
(3, 1, 'en', 'Welcome to Sistema', 'Dear user [USER MAIL]:', 'Welcome to Sistema.\r\n\r\nThis business platform will allow you to connect in a more simple and inexpensive way with those who are seeking the products or services that you offer, and with those who offer products or services you want.', 'For security, you must validate your email address before accessing this community.\r\n\r\nJust click on the link below to confirm your address and complete a brief registration:\r\n[LINK]\r\n\r\nIf that link does not work, you can validate your email address manually on this link, where you must enter the following information:\r\n[HTTP/:]\r\nEmail: [USER MAIL]\r\nPassword: [CLAVE]\r\n\r\nIf you did not request to join Sistema, ignore this email.\r\n\r\nSincerely\r\nSistema LLC', NULL),
(4, 1, 'es', 'Bienvenido/a a Sistema', 'Estimado/a usuario [USER MAIL]:', 'Le damos la bienvenida a Sistema. \r\n\r\nEsta plataforma de negocios le permitirá a usted conectarse de manera simple y gratuita con quienes buscan aquellos productos o servicios que tú ofreces, o bien con aquellos que ofrecen los productos o servicios que tú buscas.\r\n', 'Por cuestiones de seguridad, debe validar su dirección de correo electrónico antes de obtener acceso a esta comunidad. \r\n\r\nSolo haga clic en el enlace a continuación para validar su dirección y completar un registro breve: \r\n[LINK] \r\n\r\nSi ese enlace no funciona, puede validar su dirección de correo electrónico manualmente en este enlace, donde deberá ingresar la siguiente información: \r\n[HTTP/:] \r\nCorreo electrónico: [USER MAIL] \r\nSímbolo: [CLAVE] \r\n\r\nSi no solicitó unirse a Sistema, desestime este correo electrónico. \r\n\r\nAtentamente \r\nSistema LLC\r\n', NULL),
(5, 1, 'fr', 'Bienvenue chez Sistema', 'Cher utilisateur [USER MAIL]:', 'Bienvenue chez Sistema.\r\n\r\nCette plateforme d´affaires vous permettra de vous connecter simplement et gratuitement, avec les acteurs à la recherche des produits ou services que vous offrez, ou avec ceux offrant les produits ou services que vous souhaitez.', 'Pour plus de sécurité, merci de valider votre adresse email pour pouvoir accéder à cette communauté.\r\n\r\nIl vous suffit de cliquer sur le lien ci-dessous afin de confirmer votre adresse et de nous renseigner quelques données:\r\n[LINK]\r\n\r\nSi ce lien ne fonctionne pas, vous pouvez valider votre adresse email manuellement sur ce lien, où vous devrez renseigner les informations suivantes:\r\n[HTTP/:]\r\nEmail: [USER MAIL]\r\nMot de passe: [CLAVE]\r\n\r\nSi vous n´avez pas demandé à vous joindre à Sistema, merci de ne pas tenir compte de ce courrier.\r\n\r\nCordialement\r\nSistema LCC', NULL),
(6, 1, 'it', 'Benvenuti a Sistema', 'Gentile utente [USER MAIL]:', 'Benvenuti a Sistema.\r\n\r\nQuesta piattaforma di business vi permetterà di collegare in  modo semplice e gratuito con coloro che cercano i prodotti o servizi che offrite, o con coloro che offrono prodotti o servizi desiderati.\r\n', 'Per motivi di sicurezza, è necessario convalidare il tuo indirizzo messaggio di posta elettronica prima di accedere questa comunità.\r\n\r\nBasta cliccare sul link sottostante per confermare il tuo indirizzo e compilare una breve registrazione:\r\n[LINK]\r\n\r\nSe il link non funziona, è possibile convalidare il tuo indirizzo messaggio di posta elettronica manualmente su questo link, dove è necessario inserire le seguenti informazioni:\r\n[HTTP/:]\r\nMessaggio di posta elettronica: [USER MAIL]\r\nSimbolo: [CLAVE]\r\n\r\nSe non hai richiesto a entrare in Sistema, rifiutare questa messaggio di posta elettronica.\r\n\r\nCordiali saluti\r\nSistema LLC', NULL),
(7, 1, 'ja', 'ようこそSistemaへ', '[USER MAIL] 様,', 'Sistemaへようこそ。\r\n\r\nこのビジネスプラットフォームでは、製品やサービスを提供する方と、それを必要としている方がお互いに、簡単な操作かつ無料で連絡を取りあうことができます。', 'セキュリティ上の理由により、当コミュニティへのアクセスを開始するにあたり、メールアドレスを確認させていただきます。\r\n\r\nお客様のメールアドレスを確認するために次のリンクをクリックし、登録作業を完了してください。\r\n[LINK]\r\n\r\n上のリンクが使用できない場合には、次のホームページアドレスを手入力すると、メールアドレスの確認を行うことができます。\r\n[HTTP/:]\r\nEメール: [USER MAIL]\r\nパスワード: [CLAVE]\r\n\r\nもしSistemaへの参加申し込みをされていない場合は、このメールを破棄してください。\r\n\r\n何卒よろしくお願いいたします。\r\nSistema LLC', NULL),
(8, 1, 'ko', 'Sistema님 환영합니다', '[USER MAIL] 회원님', 'Sistema님 환영합니다.\r\n\r\n이 사업 플랫폼은 간단한 방식과 무상으로 Sistema님이 판매하는 상품 또는 서비스를 찾는 사람들과 연결시켜주거나 당신이 찾는 상품 또는 서비스를 제공하는 사람들과 연결시켜 줍니다.', '보안상의 문제로 커뮤니티에 가입하기 위해서는 전자 우편주소를 인증해야 합니다.\r\n\r\n주소를 인증하고 간편한 등록을 완료하려면 다음의 링크를 클릭해 주세요:\r\n[LINK]\r\n\r\n해당 링크가 작동하지 않는 경우에는 같은 링크에서 직접 다음의 정보를 입력하시고 전자우편주소를 인증하시기 바랍니다:\r\n[HTTP/:]\r\n전자우편:[USER MAIL] \r\n비밀번호: [CLAVE]\r\n\r\n본인이 가입을 요청하지 않으신 경우, 메일을 보내주시기 바랍니다.\r\n\r\n감사합니다.\r\nSistema LLC', NULL),
(9, 1, 'pt', 'Bem-vindo(a) a Sistema', 'Prezado(a) usuário(a) [USER MAIL],', 'Gostaríamos de lhe dar as nossas boas-vindas a Sistema\r\n\r\nEsta plataforma de negócios permitirá que você se conecte de forma simples e gratuita com pessoas que estejam procurando os produtos ou serviços de sua empresa, assim como com aquelas empresas que estejam oferecendo os produtos e serviços que você procura.', 'Por questões de segurança, valide seu endereço de e-mail antes de obter acesso a esta comunidade.\r\n \r\nClique no link a seguir para validar seu endereço e preencher um pequeno cadastro: \r\n[LINK]\r\n\r\nSe o link não funcionar, é possível validar seu endereço de e-mail manualmente neste outro link, onde deverá inserir a seguinte informação:\r\n[HTTP/:]\r\nE-mail: [USER MAIL] \r\nSímbolo: [CLAVE]\r\n\r\nSe você não solicitou sua inclusão em Sistema, desconsidere esta mensagem.\r\n\r\nAtenciosamente\r\nSistema LLC', NULL),
(10, 1, 'ru', 'Добро пожаловать в Sistema ', 'Уважаемый пользователь [USER MAIL]:', 'Мы вас приветствуем в нашей компании Sistema \r\n\r\nНаша бизнес платформа даст вам возможность соединится, простым и бесплатным способом, с теми, кто ищет товары или услуги которые вы предлагаете, или с теми, которые предлагают товары или услуги, которые вы ищете.', 'Для вашей безопасности, необходимо подтвердить адрес электронной почты, прежде чем вступить в сообщество.\r\n\r\nНажмите на ссылку чтобы подтвердить ваш адрес электронной почты и закончить регистрацию:\r\n[LINK]\r\n\r\nЕсли ссылка не работает, можете подтвердить адрес электронной почты самостоятельно по следующей ссылке, где нужно будет заполнить следующие данные:\r\n[HTTP/:]\r\nЭлектронная почта: [USER MAIL]\r\nСимволы: [CLAVE]\r\n\r\nЕсли вы не желаете присоединятся к Sistema, проигнорируйте это сообщение.\r\n\r\nC уважением, \r\nSistema LLC', NULL),
(11, 1, 'zh', '欢迎加入Sistema', '敬爱的用户[USER MAIL]', '欢迎您到Sistema\r\n\r\n在这个生意平台上能允许您用简单又免费的方式，找到对您提供的产品及服务有兴趣的客人，或找到您需要的产品与服务。', '为了安全起见，在进入这网站之前，您必须先验证您的电子邮箱。\r\n只要点击链接，验证您的电子邮箱，再做简单的注册:\r\n[LINK]\r\n\r\n如果无法点击链接，可自行进入网站然后输入以下的资料\r\n[HTTP/:]\r\n电子邮箱: [USER MAIL]\r\n符号: [CLAVE]\r\n\r\n如果您没有申请注册到Sistema,请您忽略这封邮件。\r\n\r\nSistema LLC 敬上\r\n', NULL),
(12, 2, 'ar', 'Sistema طلب استرداد كلمة المرور', '[USER MAIL] عزيزي المستخدم', '.Sistema لقد استلمنا طلب لإعادة تعيين كلمة المرور لحسابك\r\n', '.[LINK] اضغط على الرابط أدناه لإكمال المعالجة\r\n\r\n.[HOURS][DAYS] ملاحظة : إن رابط التحقق سوف تنتهي صلاحيته في\r\n\r\nإذا كنت لم تطلب إعادة تعيين كلمة المرور ، يرجى الاتصال بفريق\r\n\r\n.عبر الرابط التالي Sistema\r\n\r\n[SISTEMA MAIL]\r\n\r\nبإخلاص\r\n\r\nSistema LLC', NULL),
(13, 2, 'de', 'Sistema Wiederherstellung von Kennwort', 'Sehr geehrte/r Benutzer [USER MAIL]:', 'Wir haben Ihre Anfrage erhalten, um das Kennwort für Ihr Konto Sistema zurückzusetzen.', 'Klicken Sie einfach auf den untenstehenden Link, um den Prozess abzuschließen: \r\n[LINK] \r\n\r\nBeachten Sie, dass der Bestätigungslink am [DAYS] um [HOURS] MEZ abläuft. \r\n\r\nFalls Sie das neue Kennwort nicht angefordert haben, kontaktieren Sie uns bitte über: \r\n[SISTEMA MAIL] \r\n\r\nMit freundlichen Grüßen \r\nSistema LLC\r\n', NULL),
(14, 2, 'en', 'Sistema password recovery request', 'Dear user [USER MAIL]:', 'We have received a request to reset the password for your Sistema account.\r\n', 'Click the link below to complete the process: \r\n[LINK] \r\n\r\nNote that the verification link will expire at [HOURS] on [DAYS]. \r\n\r\nIf you did not request to reset your password or if you have questions or concerns, please contact the Sistema Team to the following email. \r\n[SISTEMA MAIL] \r\n\r\nSincerely \r\nSistema LLC\r\n', NULL),
(15, 2, 'es', 'Solicitud de recuperación de contraseña en Sistema', 'Estimado/a usuario [USER MAIL]:', 'Hemos recibido una solicitud para restablecer la contraseña de su cuenta en Sistema.\r\n', 'Haga clic en el enlace siguiente para completar el proceso: \r\n[LINK] \r\n\r\nTenga en cuenta que el enlace de verificación caducará a las [HOURS] del [DAYS]. \r\n\r\nSi no solicitó la recuperación de su contraseña, póngase en contacto con el Equipo de Sistema al siguiente correo electrónico. \r\n[SISTEMA MAIL] \r\n\r\nAtentamente \r\nSistema LLC\r\n', NULL),
(16, 2, 'fr', 'Demande de récupération de mot de passe Sistema', 'Cher utilisateur [USER MAIL]:', 'Nous avons reçu la demande de réinitialisation de votre mot de passe pour votre compte Sistema.\r\n', 'Cliquez sur le lien ci-dessous pour terminer le processus:\r\n[LINK]\r\n\r\nNotez que le lien de vérification expirera le [DAYS] à [HOURS].\r\n\r\nSi vous n´avez pas demandé la réinitialisation de votre mot de passe, merci de contacter l´équipe Sistema à l´adresse suivante.\r\n[SISTEMA MAIL]\r\n\r\nCordialement\r\nSistema LLC', NULL),
(17, 2, 'it', 'Richiesta di recupero della parola d´ordine in Sistema', 'Gentile utente [USER MAIL]:', 'Abbiamo ricevuto una richiesta di reimpostare la parola d´ordine per l´account Sistema.\r\n', 'Clicca sul link sottostante per completare il processo:\r\n[LINK]\r\n\r\nSi noti che il link di verifica scadrà alla [DAYS] [HOURS] CET.\r\n\r\nSe non hai richiesto per reimpostare la password, si prega di contattare Sistema squadra alla seguente e-mail.\r\n[SISTEMA MAIL]\r\n\r\nCordiali saluti\r\nSistema LLC', NULL),
(18, 2, 'ja', 'Sistemaへのパスワード再発行依頼について', '[USER MAIL] 様、', 'Sistemaのアカウントのパスワード再発行依頼を受領しました。\r\n', '手続きを完了するには、次のリンクをクリックして下さい。 \r\n[LINK]\r\n\r\nこの確認用リンクは[DAYS] [HOURS] CETに期限切れとなりますのでご注意ください。\r\n\r\n もしパスワード再発行を依頼した覚えがない場合には、お手数ですがSistema事務局の下記メールアドレスまでご連絡ください。 [SISTEMA MAIL]\r\n\r\n 以上何卒よろしくお願いいたします。\r\nSistema LLC\r\n', NULL),
(19, 2, 'ko', 'Sistema 암호 복구 요청', '[USER MAIL] 회원님', 'Sistema님의 계정의 비밀번호 초기화를 요청하셨습니다.\r\n', '다음 링크를 클릭해 요청 과정을 완료해주시기 바랍니다: \r\n[LINK] \r\n\r\n이 링크는 [AÑO]년 [MES]월 [DIA]일 [HOURS] CET 이후에는 효력을 잃게 되오니 이 점을 참고해주시기 바랍니다. \r\n\r\nSistema회원님의 비밀번호 초기화 신청 되지 않은 경우에는 아래의 메일주소로 연락을 주시기 바랍니다. \r\n[SISTEMA MAIL]\r\n\r\n감사합니다. \r\nSistema LLC\r\n', NULL),
(20, 2, 'pt', 'Solicitação de recuperação de senha do Sistema', 'Prezado(a) usuário(a) [USER MAIL],', 'Recebemos uma solicitação para restaurar a senha de sua conta Sistema.\r\n', 'Clique no link a seguir para completar o processo: \r\n[LINK] \r\n\r\nLembre-se de que o link de verificação expirará no dia [DAYS] às [HOURS] CET. \r\n\r\nSe você não solicitou a restauração de sua senha, entre em contato com a equipe de Sistema no seguinte endereço de e-mail: \r\n[SISTEMA MAIL] \r\n\r\nAtenciosamente, \r\nSistema LLC\r\n', NULL),
(21, 2, 'ru', 'Запрос восстановления пароля Sistema', 'Уважаемый пользователь [USER MAIL]:', 'Мы получили запрос об восстановлении пароля для вашего аккаунта в Sistema.', 'Нажмите на ссылку ниже, чтобы завершить процесс:\r\n[LINK]\r\n\r\nПожалуйста имейте в виду что ссылка действительна до [DAYS] [HOURS] CET.\r\n\r\nЕсли вы не запрашивали восстановление пароля, тогда свяжитесь с командой Sistema по следующей электронной почте: \r\n[SISTEMA MAIL]\r\n\r\nС уважением,\r\nSistema LLC', NULL),
