(34, 4, 'ar', 'Sistema إضافة عنوان بريد إلكتروني آخر إلى حسابك', '[USER MAIL] عزيزي المستخدم', '.Sistema لحسابك ([USER MAIL 2]) تم عملية إضافة بريد إلكتروني', '.للأمان، يجب التحقق من صحة عنوان البريد الإلكتروني الجديد المُوَرَد\r\n\r\n:فقط اضغط على الرابط أدناه لتأكيد عنوان البريد الإلكتروني لديك\r\n[LINK]\r\n\r\nإذا كان الرابط لايعمل ، بإمكانك التحقق من عنوان البريد الإلكتروني لديك بشكل يدوي عبر هذا الرابط ،\r\n:حيث يجب عليك إدخال المعلومات التالية\r\n[HTTP/:]\r\n[USER MAIL] :البريد الالكتروني\r\n[CLAVE] :الرمز \r\n\r\n.ارفض هذا البريد الإلكتروني ،Sistema إذا لم يتم طلب الانضمام لدى\r\n\r\nبإخلاص\r\nSistema LLC', NULL),
(35, 4, 'de', 'Eine neue Email-Adresse wurde Ihrem Konto hinzugefügt Sistema', 'Sehr geehrte/r Benutzer [USER MAIL]:', 'Sie haben eine neue Email-Adresse ([USER MAIL 2]) für Ihr Konto bei Sistema hinzugefügt Sistema', 'Aus Sicherheitsgründen muss die neue E-Mail-Adresse überprüft werden.\r\n\r\nKlicken Sie einfach auf den untenstehenden Link, um Ihre Email-Adresse zu bestätigen.\r\n[LINK]\r\n\r\nFalls dieser Link nicht funktioniert, können Sie Ihre E-Mail-Adresse auch manuell über  diesen Link überprüfen, in dem Sie folgenden Informationen eingeben:\r\n[HTTP/:]\r\nE-Mail-Adresse: [USER MAIL]\r\nSymbol: [CLAVE]\r\n\r\nFalls Sie nie gewünscht haben, sich bei uns anzumelden, ignorieren Sie diese E-Mail.\r\n\r\nMit freundlichen Grüßen\r\nSistema LLC', NULL),
(36, 4, 'en', 'Added another email to your Sistema account ', 'Dear user [USER MAIL]:', 'You have added an additional contact email ([USER MAIL 2]) to your Sistema account.', 'For security, you should validate the new email address provided.\r\n\r\nJust click on the link below to validate your email address:\r\n[LINK]\r\n\r\nIf that link does not work, you can validate your email address manually on this link, where you must enter the following information:\r\n[HTTP/:]\r\nEmail: [USER MAIL]\r\nPassword: [CLAVE]\r\n\r\nIf you did not request to join Sistema, ignore this email.\r\n\r\nSincerely\r\nSistema LLC', NULL),
(37, 4, 'es', 'Has agregado otro correo electrónico a tu cuenta en Sistema', 'Estimado/a usuario [USER MAIL]:', 'Ha agregado un correo electrónico adicional de contacto ([USER MAIL 2]) a su cuenta en Sistema.', 'Por cuestiones de seguridad, debe validar la nueva dirección de correo electrónico suministrada.\r\n\r\nSolo haga clic en el enlace a continuación para validar su dirección de correo electrónico: \r\n[LINK]\r\n\r\nSi ese enlace no funciona, puede validar su dirección de correo electrónico manualmente en este enlace, donde deberá ingresar la siguiente información: \r\n[HTTP/:]\r\nCorreo electrónico: [USER MAIL] \r\nSímbolo: [CLAVE]\r\n\r\nSi no solicitó unirse a Sistema, desestime este correo electrónico.\r\n\r\nAtentamente\r\nSistema LLC', NULL),
(38, 4, 'fr', 'Ajout d´une autre adresse mail à votre compte Sistema', 'Cher utilisateur [USER MAIL]:', 'Vous avez ajouté un email de contact supplémentaire ([USER MAIL 2]) à votre compte Sistema.', 'Pour plus de sécurité, merci de valider la nouvelle adresse mail fournie.\r\n\r\nIl vous suffit de cliquer sur le lien ci-dessous pour valider votre adresse mail:\r\n[LINK]\r\n\r\nSi ce lien ne fonctionne pas, vous pouvez valider votre adresse email manuellement sur ce lien, où vous devrez renseigner les informations suivantes:\r\n[HTTP/:]\r\nEmail: [USER MAIL]\r\nMot de passe: [CLAVE]\r\n\r\nSi vous n´avez pas demandé à vous joindre à Sistema, merci de ne pas tenir compte de ce courrier.\r\n\r\nCordialement\r\nSistema LLC', NULL),
(39, 4, 'it', 'Hai aggiunto un´ altra posta elettronica al tuo account Sistema', 'Gentile utente [USER MAIL]:', 'Ha aggiunto una posta elettronica di contatto  ([USER MAIL 2]) al tuo account Sistema.', 'Per motivi di sicurezza, è necessario convalidare il nuovo messaggio di posta elettronica fornito.\r\n\r\nBasta cliccare sul link qui sotto per convalidare il tuo messaggio di posta elettronica:\r\n[LINK]\r\n\r\nSe il link non funziona, è possibile convalidare il tuo messaggio di posta elettronica manualmente su questo link, dove è necessario inserire le seguenti informazioni:\r\n[HTTP/:]\r\nMessaggio di posta elettronica: [USER MAIL]\r\nSimbolo: [CLAVE]\r\n\r\nSe non hai richiesto a entrare in Sistema, rifiutare questa messaggio di posta elettronica.\r\n\r\nCordiali saluti\r\nSistema LLC', NULL),
(40, 4, 'ja', 'Sistemaのアカウントへのメールアドレス追加完了のお知らせ', '[USER MAIL] 様、', 'Sistemaのアカウントにメールアドレス（[USER MAIL 2]）が追加されました。', 'セキュリティ上の理由により、新しく登録されたメールアドレスを確認させていただきます。\r\n\r\n下記のリンクをクリックして、メールアドレスの確認を行ってください。\r\n[LINK]\r\n\r\n上のリンクが使用できない場合には、次のホームページアドレスを手入力すると、メールアドレスの確認を行うことができます。\r\n[HTTP/:]\r\nEメール: [USER MAIL]\r\nパスワード: [CLAVE]\r\n\r\nもしSistemaへの参加申し込みをされていない場合は、このメールを廃棄してください。\r\n\r\n以上何卒よろしくお願いいたします。\r\nSistema LLC', NULL),
(41, 4, 'ko', 'Sistema님 계정에 새 E-mail이 추가되었습니다', '[USER MAIL]회원님', 'Sistema님 계정에 추가로 새 E-mail ([USER MAIL 2])이 추가되었습니다.', '보안상의 문제로 새롭게 추가된 전자우편 주소를 인증해야 합니다.\r\n\r\n주소를 인증하기 위해서는 다음의 링크를 클릭해 주시기 바랍니다:\r\n[LINK]\r\n\r\n해당 링크가 작동하지 않는 경우에는 같은 링크에서 직접 다음의 정보를 입력하시고 전자우편주소를 인증하시기바랍니다:\r\n[HTTP/:]\r\nE-MAIL: [USER MAIL] \r\n비밀번호: [CLAVE]\r\n\r\nSistema님의 가입을 요청하지 않으신 경우, 메일을 보내주시기 바랍니다.\r\n\r\n감사합니다.\r\nSistema LLC', NULL),
(42, 4, 'pt', 'Outro e-mail foi incluído em sua conta Sistema', 'Prezado(a) usuário(a) [USER MAIL],', 'Um e-mail adicional de contato ([USER MAIL 2]) foi incluído em sua conta no dia Sistema.', 'Por questões de segurança, você deve validaro novo endereço de e-mail cadastrado.\r\n \r\nClique no link a seguir para validar seu endereço de e-mail: \r\n[LINK]\r\n\r\nSe o link não funcionar, é possível validar seu endereço de e-mail manualmente neste outro link, onde deverá inserir a seguinte informação:\r\n[HTTP/:]\r\nE-mail válido: [USER MAIL]\r\nSímbolo: [CLAVE]\r\n\r\nSe você não solicitou sua inclusão em Sistema, desconsidere esta mensagem.\r\n\r\nAtenciosamente\r\nSistema LLC', NULL),
(43, 4, 'ru', 'Дополнительная электронная почта, успешно была добавлена к вашему аккаунту Sistema', 'Уважаемый пользователь [USER MAIL]:', 'Вы добавили дополнительный электронный адрес ([USER MAIL 2]) в ваш акаунт в Sistema.', 'Для вашей безопасности, необходимо подтвердить новый добавленый адрес электронной почты.\r\n\r\nНажмите на ссылку, чтобы подтвердить ваш адрес электронной почты и закончить регистрацию:\r\n[LINK]\r\n\r\nЕсли ссылка не работает, можете подтвердить адрес электронной почты самостоятельно по следующей ссылке, где нужно будет заполнить следующие данные:\r\n[HTTP/:]\r\nЭлектронная почта: [USER MAIL]\r\nСимволы: [CLAVE]\r\n\r\nЕсли вы не желаете присоединятся к Sistema, проигнорируйте это сообщение.\r\n\r\nC уважением, \r\nSistema LLC', NULL),
(44, 4, 'zh', '在您的Sistema帐增加另一个新的电子邮箱', '敬爱的用户[USER MAIL]', '您已在Sistema帐新增另一个电子邮箱([USER MAIL 2])', '为了安全起见，在进入这网站之前，您必须先验证您的电子邮箱。\r\n\r\n只要点击链接，验证您的电子邮箱，然后进行简单的注册:\r\n[LINK]\r\n\r\n如果无法点击链接，可自行进入网站然后输入以下的资料\r\n[HTTP/:]\r\n电子邮箱: [USER MAIL]\r\n符号: [CLAVE]\r\n\r\n如果您没有申请注册到Sistema,请您忽略这封邮件。\r\n\r\nSistema LLC 敬上', NULL),
(45, 5, 'ar', 'Sistema تطابقات جديدة في حسابك', '[USER MAIL] عزيزي المستخدم', '([X NEW RESULTS]) يرجى ملاحظة أن هناك  \r\n.اتصالات جديدة مع لمحات من العرض والطلب تلائم عمليات البحث\r\n\r\n.Nocnoode لقد قمت بتحميلها إلى حسابك\r\n', '[HTTP/:]\r\n\r\nبإخلاص\r\nSistema LLC\r\n', NULL),
