(184, 17, 'ko', '연간 광고 10 HS6/S', '[USER MAIL] 회원님', 'Sistema 회원님의 연간 광고 10 HS6/S 플랜 가입이 성공적으로 완료되었음을 알려드립니다. \r\n\r\n다음 E-mail으로 아래 내용을 보내주시기 바랍니다.\r\n[SISTEMA MAIL]:\r\n1) 광고배너 이미지는 다음의 조건에 충족시켜 주시기 바랍니다.\r\n- 크기: 12cm x 45cm\r\n- 포맷: jpg\r\n- 내용: 외설적인 내용이나 모욕적인 내용은 삼가. \r\n2) 이용자가 클릭하게 될 배너광고의 http 주소\r\n3) HS코드 6자리 또는 서비스 항목리스트를 광고가 노출될 국가에 따라 각각 10개씩 작성해주시기 바랍니다.', '해당 정보의 수신 24시간 이후, 서비스 혜택이 적용될 예정입니다.\r\n\r\n감사합니다.\r\nSistema LLC', NULL),
(185, 17, 'pt', 'Conexão – Plano Anual Propaganda10 HS6/S', 'Prezado(a) usuário(a) [USER MAIL],', 'Gostaríamos de informá-lo que recebemos corretamente seu pagamento referente ao plano mensal/anual do serviço de Propaganda 10 HS6/S no dia Sistema. \r\n\r\nPor favor envie ao e-mail [SISTEMA MAIL] o que segue:\r\n1) Imagem a ser utilizada como banner. A imagem deve cumprir com os seguintes requisitos:\r\n- Tamanho: 12cm x 45cm\r\n- Formato: jpg\r\n- Conteúdo: Não deverá conter nada obsceno nem ofensivo. \r\n2) Endereço httppara o qual serão direcionados os usuários que clicarem nobanner.\r\n3) Lista dos 10 Códigos Pautais de Produto (SH 6 dígitos) ou Categorias de Serviço, cada uma com seu país correspondente, para as quais será enviada a propaganda.', 'Após24hs do recebimento da informação solicitada você contará com todos os benefícios do serviço. \r\n\r\nAtenciosamente,\r\nSistema LLC', NULL),
(186, 17, 'ru', 'Запись – Годовой план Рекламы 10 Товарных позицийдо 6 цифр', 'Уважаемый пользователь [USER MAIL]', 'Мы сообщаем что оплата за годовой план Рекламы 10 HS6/S в Sistema, прошла успешно.\r\n\r\nПожалуйста отправьте по электронной почте, по адресу [SISTEMA MAIL]:\r\n1) Изображение которые мы используем как рекламные баннеры. Изображение должно соблюдать следующие:\r\n- Размер: 12 см х 45 см\r\n- Формат: jpg\r\n- Содержание: Оно не должно быть непристойным или оскорбительным \r\n2) httpадрес куда будут перенаправлены пользователи, которые нажмут на рекламный баннер.\r\n3) Список 10 Товарных Позиций (ТН ВЭД) до 6 цифр или категорию сервиса, каждая со своим спицефическим направлением на определенную страну. ', 'Пройдя 24 часа после нашего получение всей информации, вы начнете пользоваться всеми преимуществами нанятого сервиса.\r\n\r\nС уважением,\r\nSistema LLC', NULL),
(187, 17, 'zh', '年方案广告10H´S6/S', '敬爱的用户[USER MAIL]', '我们在此通知您， 我们已正确的收到您在Sistema帐上的H´S6/S广告服务年方案费用\r\n\r\n请寄到电子邮件[SISTEMA MAIL].\r\n1)您们可想像我们将使用广告横幅，影像必须要符合以下的条件\r\n-大小面积:12公分X45公分\r\n-格式:JPG\r\n-内容:不可淫亵及具有的伤害的内容\r\n2)在广告横幅中的http网址就是用户们使用的网址\r\n3)依各国的10关税位置产品请单或服务等级依序排在横幅广告上\r\n', '在24小时后，您将收到含有所有(6个数字)优惠服务的申请资讯\r\n\r\nSistema LLC 敬上\r\n', NULL),
