(219, 20, 'ru', 'Ваши продукты и услуги на Sistema', 'Уважаемый пользователь [USER MAIL]', 'Сообщаем о действиях, которые сделали другие пользователи Sistema над вашими продуктами и услугами: \r\n\r\n[ACTIVIDAD]\r\n\r\nПереодически обновляйте свои данные для увеличения возможности деловых контактов.', '[HTTP/:]\r\n\r\nС уважением,\r\nSistema LLC', NULL),
(220, 20, 'zh', '您在Sistema上的产品与服务信息', '敬爱的用户[USER MAIL]', '以下是其他Sistema用户就您的产品和服务进行过的操作，在此特意通知：\r\n\r\n[ACTIVIDAD]\r\n\r\n请随时更新您的帐户信息，以增加业务联系。', '[HTTP/:]\r\n\r\nSistema LLC敬上', NULL),
(221, 21, 'ar', 'Sistema طلب مرجع تجاري في', '', 'بتضمينك داخل دائرة ،[USER COMPLETE NAME]، [USER MAIL] قام مستخدم الحساب \r\n.مراجعه التجارية، مع البقاء على علاقة تجارية معك\r\n\r\n.´يمكنك تأكيد أن هناك علاقة تجارية بينكما بالنقر أدناه على زر ´التحقق', '[LINK]\r\n\r\nنحيطكم علما بأنه إذا لم نتلق الموافقة خلال الأيام الخمسة القادمة، فإننا سنعتبر أنك قد رفضت وجود علاقة تجارية بينكما. لراحة البال لن يتم نشر البريد الإلكتروني الخاص بك وسوف تبقى في الاحتياطي\r\n\r\nبإخلاص\r\nSistema LLC', NULL),
(222, 21, 'de', 'Antrag auf geschäftliche Referenz in Sistema', '', 'Der Nutzer des Kontos/Die Nutzerin des Kontos [USER MAIL], [USER COMPLETE NAME], hat bestätigt, dass er/sie eine Geschäftsbeziehung mit Ihnen unterhält.\r\n\r\nSie können bestätigen, dass zwischen Ihnen und der/dem Geschäftspartner(in) eine Geschäftsbeziehung besteht, indem Sie unten auf die Schaltfläche ´Bestätigen´ klicken.', '[LINK]\r\n\r\nFalls wir innerhalb der nächsten 5 Tage keine Bestätigung erhalten, betrachten wir diese als keine existierende Geschäftsbeziehung. Für Ihre Sicherheit wird Ihre E-Mail nicht veröffentlicht und bleibt mit Vorbehalt\".\r\n\r\nMit freundlichen Grüßen\r\nSistema LLC', NULL),
(223, 21, 'en', 'Request for commercial reference at Sistema', '', 'The user of the account [USER MAIL], [USER COMPLETE NAME], has included your contact within his circle of commercial references, stating that maintains a commercial relationship with you.\r\n\r\nIf you could confirm that there is a commercial relationship between both of you by clicking below on the ´Validate´ button.', '[LINK]\r\n\r\nWe need to inform you that if we do not receive your confirmation within the next 5 days, we will consider that you have denied the existence of a commercial relationship between both of you, and for your peace of mind your email will not be published and will be kept in reserve.\r\n\r\nSincerely\r\nSistema LLC', NULL),
(224, 21, 'es', 'Solicitud de referencia comercial en Sistema', '', 'El usuario de la cuenta [USER MAIL], [USER COMPLETE NAME], ha incluido su contacto dentro de su círculo de referencias comerciales, manifestado que mantiene una relación comercial con usted/ustedes. \n\nPodría usted confirmarnos que existe una relación comercial entre ustedes haciendo clic a continuación en el botón de ´Validar´.', '[LINK]\n\nLe informamos que de no recibir su confirmación en los próximos 5 días, consideraremos que usted ha negado la existencia de una relación comercial entre ustedes. Para su tranquilidad su correo electrónico no será publicado y se mantendra en reserva.\n\nAtentamente\nSistema LLC', NULL),
(225, 21, 'fr', 'Demande de référence commerciale dans Sistema', '', 'L´utilisateur du compte [USER MAIL], [USER COMPLETE NAME], a inclus votre contact dans son cercle de références commerciales, déclarant entretenir une relation commerciale avec vous.\r\n\r\nVous pouvez confirmer l´existence de cette relation en cliquant  sur le bouton ´Valider´ ci-dessous.', '[LINK]\r\n\r\nNous vous informons que si vous ne recevez pas votre confirmation dans les 5 prochains jours, nous considérerons que vous avez nié l´existence d´une relation commerciale entre vous. Pour votre tranquillité, votre mail ne sera pas publié et sera gardé en réserve.\r\n\r\nCordialement\r\nSistema LLC', NULL),
(226, 21, 'it', 'Richiesta di riferimento commerciale in Sistema', '', 'L´utente del conto [USER MAIL], [USER COMPLETE NAME], ha incluso il suo contatto all´interno del suo cerchio di riferimenti commerciali, affermando di mantenere un rapporto commerciale con lei/voi.\r\n\r\nPuó confermare che c´è una relazione commerciale tra di voi cliccando qui sotto sul pulsante ´Valida´.', '[LINK]\r\n\r\nTi informiamo che se non ricevi la tua conferma entro i prossimi 5 giorni, considereremo che hai negato l´esistenza di una relazione commerciale tra di te. Per la tua tranquillità, la tua email non verrà pubblicata e sarà mantenuta in riserva.\r\n\r\nCordiali saluti\r\nSistema LLC', NULL),
(227, 21, 'ja', 'Sistemaからの商用リファレンス依頼', '', 'ユーザーの[USER MAIL]、  [USER COMPLETE NAME] さんが、あなたと商業的関係にあることを表明し、あなたの連絡先をご自身の商用リファレンスのサークル内に含めました。\r\n\r\n「証明する」ボタンをクリックすると、あなたとの商業的関係の存在が立証されます。', '[LINK]\r\n\r\n今日から5日以内に確認のお返事がなければ、あなたが商業的関係の存在を否定したものとみなされます。お客様の電子メールは公開されず、守秘されますのでご安心下さい。\r\n\r\nどうぞよろしくお願いいたします。\r\nSistema LLC', NULL),
(228, 21, 'ko', 'Sistema에서 상업적 리퍼런스 요청', '', '[USER MAIL] [USER COMPLETE NAME] 계정의 사용자는 귀하와 상업적 관계를 유지하고 있다고 언급하면서 자신의 연락처를 자신의 상업 리퍼런스 (reference) 관계에 포함 시켰습니다.\r\n\r\n´확인´버튼을 클릭하면 귀하와 상업적 관계가 있음을 확인할 수 있습니다.', '[LINK]\r\n\r\n다음 5 일 내에 확인을받지 못하면 귀하는 귀하 사이의 상업 관계의 존재를 부인 한 것으로 간주합니다. 안심을 위해 이메일이 게시되지 않고 예비로 보관됩니다.\r\n\r\n대단히 감사합니다.\r\nSistema LLC', NULL),
(229, 21, 'pt', 'Pedido de referência comercial no Sistema', '', 'O usuário da conta [USER MAIL], [USER COMPLETE NAME], incluiu seu contato em seu círculo de referências comerciais, afirmando que vocês mantêm uma relação comercial.\r\n\r\nVocê pode confirmar essa relação comercial clicando abaixo no botão ´Validar´.', '[LINK]\r\n\r\nInformamos que caso não receba sua confirmação nos próximos 5 dias, consideraremos que você negou a existência de uma relação comercial entre você. Para sua tranquilidade, seu e-mail não será publicado e será mantido em reserva.\r\n\r\nAtenciosamente,\r\nSistema LLC', NULL),
(230, 21, 'ru', 'Запросить бизнес-справку в Sistema', 'Уважаемый пользователь [USER MAIL]', 'Пользователь [USER MAIL], [USER COMPLETE NAME], обозначил ваш контакт в своём круг коммерческих интересов, указал, что поддерживает с вами деловые отношения. \r\n\r\nМогли бы вы подтвердить, что между вами есть коммерческие отношения, нажмите на кнопку ´Подтверждяю´.', '[LINK]\r\n\r\nСообщаем вам, что если вы не получите подтверждение в течение следующих 5 дней, мы будем считать, что вы отрицаете существование коммерческих отношений между вами. Для вашего спокойствия ваш адрес электронной почты не будет опубликован и будет храниться в резерве.\r\n\r\nС уважением,\r\nSistema LLC', NULL),
(231, 21, 'zh', '在Sistema中请求提供商贸对象背景情况', '', '帐户为[USER MAIL]的用户[USER COMPLETE NAME]已将您的联系方式加进了他的商务圈，以表示他与您保持着商贸联系。\r\n\r\n您可以点击下面的“验证”按钮，确认你们之间存在商贸联系。', '[LINK]\r\n\r\n若五天内收不到您的确认，我们将认为您已否认你们之间存在商贸联系，特此禀告。 您的电子邮件不会被发布，将留存待命，请您放心。\r\n\r\nSistema LLC敬上', NULL),
(232, 22, 'ar', 'Sistema طلب مرجع تجاري في', '[USER MAIL] عزيزي المستخدم', 'نعلمك بأننا قد استجبنا لطلبك عن طريق إرسال طلب مرجع تجاري إلى \r\n.[REFERENCE MAIL]\r\n\r\nيرجى التحقق من استلام مرجعك التجاري لبريدنا الإلكتروني، ومن فضلك قم بتأكيد وجود علاقة تجارية بينكما (انقر على الزر ´التحقق´ ضمن البريد الإلكتروني الذي أرسلناه إليك) إذا لم نتلق\r\n .الموافقة خلال الأيام الخمسة المقبلة سوف نعتبر أن هذا الشخص قد أنكر وجود علاقة تجارية\r\n\r\n.إذا لم يتلق المرجع التجاري الخاص بك بريدنا الإلكتروني، فيرجى طلب إعادة الإرسال أدناه', '[LINK]\r\n\r\nبإخلاص\r\nSistema LLC', NULL),
(233, 22, 'de', 'Antrag auf geschäftliche Referenz in Sistema', 'Sehr geehrte/r Benutzer [USER MAIL]:', 'Wir haben Ihre Anfrage beantwortet, indem wir die geschäftliche Referenzanfrage an [REFERENCE MAIL] gesendet haben.\r\n\r\nBitte vergewissern Sie sich, dass Ihren/e Geschäftspartner(in) unsere E-Mail erhalten hat, und erinnern Sie diesen daran, dass eine Geschäftsbeziehung zwischen Ihnen besteht (klicken Sie auf die Schaltfläche \"Bestätigen\"). Wenn wir innerhalb der nächsten fünf Tagen keine Bestätigung erhalten, betrachten wir dieses nicht als existierende Geschäftsbeziehung.\r\n\r\nWenn Ihre Geschäftsreferenz keine E-Mail erhalten hat, fordern Sie bitte die Wiedervorlage an.', '[LINK]\r\n\r\nMit freundlichen Grüßen\r\nSistema LLC', NULL),
(234, 22, 'en', 'Request for commercial reference at Sistema', 'Dear user [USER MAIL]:', 'We are informing you that we have responded to your request by sending the commercial reference request to [REFERENCE MAIL].\r\n\r\nPlease make sure your commercial reference received our email, and please remind them to confirm the existence of a business relationship between both of you (click on button ´Validate´ that we´ve emailed) because if we do not receive the confirmation in the next 5 days, we will consider that this person has denied the existence of a commercial relationship.\r\n\r\nIf your commercial reference has not received our email, please request a resubmission below.', '[LINK]\r\n\r\nSincerely\r\nSistema LLC', NULL),
(235, 22, 'es', 'Solicitud de referencia comercial en Sistema', 'Estimado/a usuario [USER MAIL]:', 'Le informamos que hemos respondido a su petición enviado la solicitud de referencia comercial a [REFERENCE MAIL].\n\nPor favor asegúrese que su referencia comercial haya recibido nuestro correo electrónico, y por favor recuérdele que debe de confirmar la existencia de una relación comercial entre ustedes (haciendo clic en botón ´Validar´ que le hemos enviado por correo electrónico), ya que de no recibir su confirmación en los próximos 5 días, consideraremos que esta persona a negado la existencia de una relación comercial.\n\nSi su referencia comercial no ha recibido nuestro correo electrónico, solicite el reenvío a continuación.', '[LINK]\r\n\r\nAtentamente\r\nSistema LLC', NULL),
(236, 22, 'fr', 'Demande de référence commerciale dans Sistema', 'Cher utilisateur [USER MAIL]:', 'Nous vous informons que nous avons répondu à votre demande en envoyant la demande de référence commerciale à  [REFERENCE MAIL].\r\n\r\nMerci de vous assurer que votre référence commerciale a reçu notre e-mail, et rappelez-lui de confirmer l´existence d´une relation d´affaires entre vous (en cliquant sur le bouton ´Valider´ que nous lui avons envoyé par email). En cas d´absence de confirmation de sa part dans les 5 prochains jours, nous considérerons que cet utilisateur a nié l´existence d´une relation commerciale.\r\n\r\nSi votre référence commerciale n´a pas reçu notre e-mail, merci de la solliciter à nouveau ci-dessous.', '[LINK]\r\n\r\nCordialement\r\nSistema LLC', NULL),
(237, 22, 'it', 'Richiesta di riferimento commerciale in Sistema', 'Gentile utente [USER MAIL]:', 'Ti informiamo che abbiamo risposto alla tua richiesta inviando la richiesta di riferimento commerciale a [REFERENCE MAIL]. \r\n\r\nAssicurati che il tuo riferimento commerciale abbia ricevuto la nostra email e ricordali di confermare l´esistenza di una relazione commerciale tra di voi (clicca sul pulsante ´Convalida´ che abbiamo inviato via email). Se non si effettua la conferma nei prossimi 5 giorni, si considerara negata l´esistenza di una relazione commerciale.  \r\n\r\nSe il tuo riferimento commerciale non ha ricevuto la nostra email, ti invitiamo a richiedere il ri-invio qui sotto.', '[LINK]\r\n\r\nCordiali saluti\r\nSistema LLC', NULL),
(238, 22, 'ja', 'Sistemaからの商用リファレンス依頼', '[USER MAIL] 様、', 'お客様のご要望にお応えし、商用リファレンス依頼を[REFERENCE MAIL]に送信したことをお知らせします。\r\n\r\n商用リファレンス証明者にメールが届いているかどうか打診し、あなたとの間に商業的関係が存在することを立証してくれるよう（メールの「証明する」ボタンをクリックします）、お願いして下さい。今日から5日間以内に立証が行われない場合、商業的関係の存在が否定されたとみなされます。\r\n\r\n商用リファレンス証明者がSistemaからのメールを受け取っていない場合、次の再送信依頼を行って下さい。', '[LINK]\r\n\r\n何卒よろしくお願いいたします。\r\nSistema LLC', NULL),
(239, 22, 'ko', 'Sistema에서 상업적 리퍼런스 요청', '[USER MAIL] 회원님', '상업 리퍼런스  신청서를 [REFERENCE MAIL] (으)로 보내 귀하의 요청에 응답했음을 알려드립니다.\r\n\r\n귀하의 상업 참조가 저희 이메일을 받았는지 확인하고, 다음 5 일 내에 확인을받지 못하기 때문에 (귀하가 이메일로 보낸 ´확인´버튼을 클릭하십시오) 귀하와 비즈니스 관계의 존재를 확인하도록 상기시켜주십시오. 이 사람은 상업적 관계의 존재를 부인했다.\r\n\r\n귀하의 상업 참조가 이메일을받지 못했다면 아래의 재 제출을 요청하십시오.', '[LINK]\r\n\r\n대단히 감사합니다.\r\nSistema LLC', NULL),
(240, 22, 'pt', 'Pedido de referência comercial no Sistema', 'Prezado(a) usuário(a) [USER MAIL],', 'Informamos que respondemos ao seu pedido enviando a solicitação de referência comercial a [REFERENCE MAIL].\r\n\r\nCertifique-se de que sua referência comercial recebeu nosso e-mail e peça-lhe que confirme a existência da relação comercial entre vocês clicando no botão ´Validar´ que lhe enviamos. Se não recebermos a confirmação nos próximos 5 dias, consideraremos que não existe tal relação comercial.\r\n\r\nSe sua referência comercial não recebeu nosso e-mail, solicite uma nova submissão abaixo.', '[LINK]\r\n\r\nAtenciosamente,\r\nSistema LLC', NULL);
INSERT INTO `mails_info` (`mi_id`, `mi_codigo`, `idi_code`, `mi_asunto`, `mi_titulo`, `mi_cuerpo1`, `mi_cuerpo2`, `mi_texto_crudo`) VALUES
(241, 22, 'ru', 'Запросить бизнес-справку в Sistema', 'Уважаемый пользователь [USER MAIL]', 'Сообщаем вам, что мы передали ваш запрос, на указание коммерчесскй свзязи [REFERENCE MAIL].\r\n\r\nПожалуйста, убедитесь, что ваш партнер получил наш запрос и напомните ему что бы подтвердил о существовании деловых отношений между вами (нажав на кнопку ´Подтвердить´, которую мы отправили по электронной почте) если не получим подтверждения в течение следующих 5 дней, мы посчитаем, что этот человек отрицает существование коммерческих отношений.\r\n\r\nЕсли ваш партнер не получил нашего электронного письма, пожалуйста, сделайте повторный запрос ниже.', '[LINK]\r\n\r\nС уважением,\r\nSistema LLC', NULL),
(242, 22, 'zh', '在Sistema中请求提供商贸对象背景情况', '敬爱的用户[USER MAIL]', '我们已回复了您发来的要求提供商贸对象背景情况的请求[REFERENCE MAIL]，特此通知。\r\n\r\n请确认您的请求已收到我们的电邮回复，还请提醒他确认你们之间存在商贸联系（点击我们通过电子邮件发送的“验证”按钮），若未来5天内未收到确认，我们将认为此人否认你们间存在商贸联系。\r\n\r\n如您的商贸背景情况请求未收到我们的电邮回复，请在下面重新提交。', '[LINK]\r\n\r\nSistema LLC敬上', NULL),
(243, 23, 'ar', 'Sistema المرجع التجاري المصادق عليه في', '[USER MAIL] عزيزي المستخدم', '!أخبار جيدة\r\n\r\nقد تحقق من صحة الطلب المرجعي التجاري الذي [REFERENCE MAIL] نحيطكم علما بأن\r\n.يؤكد وجود علاقة تجارية بينكما\r\n\r\nنقترح عليك مواصلة تضمين المراجع التجارية الجديدة حيث أنها ستحسن من جودة حسابك. إذا كنت \r\n:ترغب في دمج مرجع تجاري جديد، فانقر على الرابط التالي لمتابعة المعالجة', '[LINK]\r\n\r\nبإخلاص\r\nSistema LLC', NULL),
(244, 23, 'de', 'Geschäftliche Referenz wurde in Sistema bestätigt', 'Sehr geehrte/r Benutzer [USER MAIL]:', 'Gute Nachrichten!\r\n\r\nWir informieren Sie, dass [REFERENCE MAIL] die geschäftliche Referenzanfrage bestätigt hat, in der das Vorliegen einer Geschäftsbeziehung zwischen Ihnen bestätigt wird.\r\n\r\nWir empfehlen Ihnen, weiterhin neue geschäftliche Referenzen hinzufügen, damit die Qualität Ihres Kontos verbessert wird. Wenn Sie eine neue geschäftliche Referenz aufnehmen möchten, klicken Sie auf folgenden Link:', '[LINK]\r\n\r\nMit freundlichen Grüßen\r\nSistema LLC', NULL),
(245, 23, 'en', 'Commercial reference validated at Sistema', 'Dear user [USER MAIL]:', 'Good news!\r\n\r\nWe are informing you that [REFERENCE MAIL] has validated the commercial reference request confirming the existence of a commercial relationship between both of you.\r\n\r\nWe suggest you continue to incorporate new commercial references as it will improve the quality of your account. If you wish to incorporate a new commercial reference, click on the following link to continue the process:', '[LINK]\r\n\r\nSincerely\r\nSistema LLC', NULL),
(246, 23, 'es', 'Referencia comercial validada en Sistema', 'Estimado/a usuario [USER MAIL]:', 'Buenas noticias!\r\n\r\nLe informamos que [REFERENCE MAIL] ha validado la solicitud de referencia comercial confirmando la existencia de una relación comercial entre ustedes.\r\n\r\nLe sugerimos continuar incorporando nuevas referencias comerciales ya que mejorará la calidad de su cuenta. Si desea incorporar una nueva referencia comercial haga clic en el enlace siguiente para avanzar con el proceso:', '[LINK]\r\n\r\nAtentamente\r\nSistema LLC', NULL),
(247, 23, 'fr', 'Référence commerciale validée chez Sistema', 'Cher utilisateur [USER MAIL]:', 'Bonne nouvelle!\r\n\r\nNous vous informons que [REFERENCE MAIL] a validé la demande de référence commerciale en confirmant l´existence d´une relation d´affaires entre vous.\r\n\r\nNous vous suggérons de continuer à intégrer de nouvelles références commerciales afin d´améliorer la qualité de votre compte. Si vous souhaitez intégrer une nouvelle référence, cliquez sur le lien suivant afin d´accélerer le processus:', '[LINK]\r\n\r\nCordialement\r\nSistema LLC', NULL),
(248, 23, 'it', 'Riferimento commerciale convalidato in Sistema', 'Gentile utente [USER MAIL]:', 'Buone notizie!\r\n\r\nTi informiamo che [MAIL REFERENCE] ha convalidato la richiesta di riferimento commerciale che conferma l´esistenza di una relazione commerciale tra di voi.\r\n\r\nTi consigliamo di continuare a incorporare nuovi riferimenti commerciali in quanto migliorerà la qualità del tuo account. Se desideri incorporare un nuovo riferimento commerciale, fai clic sul seguente collegamento per procedere:', '[LINK]\r\n\r\nCordiali saluti\r\nSistema LLC', NULL),
(249, 23, 'ja', 'Sistemaで商用リファレンスが証明されました', '[USER MAIL] 様、', '良いお知らせです！\r\n\r\n[REFERENCE  MAIL] さんが商用リファレンスの証明依頼に応え、あなたとの商業的関係の存在を立証したことをお知らせします。\r\n\r\nアカウントの信用を向上させるため、これからも新しい商用リファレンスを追加していくことをお勧めします。新しい商用リファレンスを追加する場合は、次のリンクをクリックして手続きを進めてください。', '[LINK]\r\n\r\n何卒よろしくお願いいたします。\r\nSistema LLC', NULL),
(250, 23, 'ko', 'Sistema에서 확인 된 상업 리퍼런스 ', '[USER MAIL] 회원님', '좋은 소식!\r\n\r\n[REFERENCE MAIL]이 (가) 상업 관계의 존재를 확인하는 상업 리퍼런스  요청을 확인했음을 알려드립니다.\r\n\r\n새로운 상업 리퍼런스 을 계속해서 포함시켜 계정의 품질을 향상시킬 것을 권장합니다. 새로운 상업 리퍼런스 를 사용하려면 다음 링크를 클릭하여 프로세스를 진행하십시오.', '[LINK]\r\n\r\n대단히 감사합니다.\r\nSistema LLC', NULL),
(251, 23, 'pt', 'Referência comercial validada no Sistema', 'Prezado(a) usuário(a) [USER MAIL],', 'Boas notícias!\r\nInformamos que [REFERENCE MAIL] validou sua solicitação de referência comercial, confirmando a parceria entre vocês.\r\n\r\nSugerimos que você continue incluindo novas referências comerciais para melhorar a qualidade da sua conta. Caso queira incluir uma nova referência comercial, clique no link abaixo:', '[LINK]\r\n\r\nAtenciosamente,\r\nSistema LLC', NULL),
(252, 23, 'ru', 'Бизнес-справка утверждена в Sistema', 'Уважаемый пользователь [USER MAIL]', 'Хорошие новости!\r\nСообщаем вам, что [REFERENCE MAIL] подтвердил вашу коммерческую связь, подтверждающий наличие коммерческих отношений между вами.\r\n\r\nМы предлагаем вам продолжыть добавлять другие коммерческие контакты, поскольку это улучшит качество вашей учетной записи. Если вы хотите включить новую коммерческую ссылку, нажмите следующую ссылку, чтобы пройти к процессу:', '[LINK]\r\n\r\nС уважением,\r\nSistema LLC', NULL),
(253, 23, 'zh', '在Sistema中核实商贸对象背景情况', '敬爱的用户[USER MAIL]', '好消息！\r\n\r\n[REFERENCE MAIL]已经认可了您的商贸背景情况介绍请求，确认了你们之间存在的商贸联系，特此通知。\r\n\r\n建议您添加新的商贸背景情况介绍，这会提升您帐户的质量。 如果您希望添加新的商贸背景情况介绍，请单击以下链接以推进此过程：', '[LINK]\r\n\r\nSistema LLC敬上', NULL),
(254, 24, 'ar', 'Sistema في انتظار الإشارة التجارية في', '', 'تضمن ،[USER COMPLETE NAME]،[USER MAIL] نذكركم بأن مستخدم الحساب\r\n.اتصاله داخل دائرة مراجعه التجارية، مشيرا إلى أنه يحافظ على علاقة تجارية معك\r\n\r\n.´يمكنك تأكيد أن هناك علاقة تجارية بينك بالنقر أدناه على زر ´التحقق', '[LINK]\r\n\r\nنحيطكم علما بأنه إذا لم نتلق الموافقة خلال اليومين القادمين، سنعتبر أنك قد رفضت وجود علاقة تجارية بينكما. لراحة البال لن يتم نشر البريد الإلكتروني الخاص بك وسوف تبقى في الاحتياطي\r\n\r\nبإخلاص\r\nSistema LLC', NULL),
(255, 24, 'de', 'Ausstehende geschäftliche Referenz in Sistema', '', 'Wir weisen Sie darauf hin, dass der/die Nutzer(in) des Kontos [USER MAIL], [USER COMPLETE NAME], Ihre Kontaktanfrage angenommen hat und bestätigt, dass er/sie eine Geschäftsbeziehung mit Ihnen unterhält.\r\n\r\nSie können bestätigen, dass zwischen Ihnen eine Geschäftsbeziehung besteht, indem Sie unten auf die Schaltfläche ´Bestätigen´ klicken.', '[LINK]\r\n\r\nFalls wir innerhalb der nächsten 2 Tage keine Bestätigung erhalten, betrachten wir diese als nicht existierende Geschäftsbeziehung. Für Ihre Sicherheit wird Ihre E-Mail nicht veröffentlicht und bleibt vertraulich\".\r\n\r\nMit freundlichen Grüßen\r\nSistema LLC', NULL),
(256, 24, 'en', 'Pending commercial reference at Sistema', '', 'We need to remind you that the user of the account [USER MAIL], [USER COMPLETE NAME], has included his contact within his circle of commercial references, stating that he maintains a commercial relationship with you.\r\n\r\nYou could confirm that there is a commercial relationship between both of you by clicking below on the ´Validate´ button.', '[LINK]\r\n\r\nWe need to inform you that if we do not receive your confirmation within the next 2 days, we will consider that you have denied the existence of a commercial relationship between both of you. For your peace of mind your email will not be published and will be kept in reserve.\r\n\r\nSincerely\r\nSistema LLC', NULL),
(257, 24, 'es', 'Referencia comercial pendiente en Sistema', '', 'Le recordamos que el usuario de la cuenta [USER MAIL], [USER COMPLETE NAME], ha incluido su contacto dentro de su círculo de referencias comerciales, manifestado que mantiene una relación comercial con usted/ustedes. \r\n\r\nPodría usted confirmarnos que existe una relación comercial entre ustedes haciendo clic a continuación en el botón de ´Validar´.', '[LINK]\r\n\r\nLe informamos que de no recibir su confirmación en los próximos 2 días, consideraremos que usted ha negado la existencia de una relación comercial entre ustedes. Para su tranquilidad su correo electrónico no será publicado y se mantendrá en reserva.\r\n\r\nAtentamente\r\nSistema LLC', NULL),
(258, 24, 'fr', 'Référence commerciale en attente chez Sistema', '', 'Nous vous rappelons que l´utilisateur du compte [USER MAIL], [USER COMPLETE NAME], vous a inclus dans son cercle de références commerciales, déclarant entretenir une relation commerciale avec vous.\r\n\r\nVous pouvez confirmer l´existance de cette relation entre vous en cliquant sur le bouton ´Valider´ ci-dessous.', '[LINK]\r\n\r\nNous vous informons que si vous ne recevez pas votre confirmation dans les 2 prochains jours, nous considérerons que vous avez nié l´existence de cette relation. Pour votre tranquilité, votre email ne sera pas publié et garder sous réserve.\r\n\r\nCordialement\r\nSistema LLC', NULL),
(259, 24, 'it', 'Riferimento commerciale in sospeso in Sistema', '', 'Ricordiamo che l´utente del conto [USER MAIL], [USER COMPLETE NAME], ha incluso il suo contatto all´interno del suo circolo di riferimenti commerciali, affermando di mantenere un rapporto commerciale con lei.\r\n\r\nPotrebbe confermare che c´è una relazione commerciale tra di voi cliccando qui sotto sul pulsante ´Valida´.', '[LINK]\r\n\r\nTi informiamo che se non ricevi la tua conferma entro i prossimi 2 giorni, considereremo che hai negato l´esistenza di una relazione commerciale tra di te. Per la tua tranquillità, la tua email non verrà pubblicata e sarà mantenuta in riserva.\r\n\r\nCordiali saluti\r\nSistema LLC', NULL),
(260, 24, 'ja', 'Sistemaで商用リファレンスが保留中です', '', '\r\nユーザーの[USER MAIL]、  [USER COMPLETE NAME] さんが、あなたと商業的関係にあることを表明し、あなたの連絡先をご自身の商用リファレンスのサークル内に含めたことを再度お知らせします。\r\n\r\n「証明する」ボタンをクリックすると、あなたとの商業的関係の存在が立証されます。', '[LINK]\r\n\r\n今日から2日以内に確認のお返事がなければ、あなたが商業的関係の存在を否定したものとみなされます。お客様の電子メールは公開されず、守秘されますのでご安心下さい。\r\n\r\nどうぞよろしくお願いいたします。\r\nSistema LLC', NULL),
(261, 24, 'ko', 'Sistema에서 상업 리퍼런스 이 보류 중입니다', '', '[USER MAIL] [USER COMPLETE NAME] 계정의 사용자는 귀하와 상업 관계를 유지하고 있다고 언급하면서 자신의 연락처를 자신의 상업 참조 서클에 포함 시켰음을 상기시킵니다.\r\n\r\n´확인´버튼을 클릭하면 귀하와 상업적 관계가 있음을 확인할 수 있습니다.', '[LINK]\r\n\r\n다음 2 일 내에 확인을받지 못하면 귀하는 귀하 사이의 상업적 관계의 존재를 부인했다고 간주합니다. 안심을 위해 이메일이 게시되지 않고 예비로 보관됩니다.\r\n\r\n대단히 감사합니다.\r\nSistema LLC', NULL),
(262, 24, 'pt', 'Referência comercial pendente no Sistema', '', 'Informamos que o usuário da conta [USER MAIL], [USER COMPLETE NAME], incluiu seu contato em seu círculo de referências comerciais, afirmando que mantém uma relação comercial com você.\r\n\r\nPara confirmar a existência dessa relação comercial, clique abaixo no botão ´Validar´.', '[LINK]\r\n\r\nNós informamos que se você não receber sua confirmação nos próximos 2 dias, consideraremos que você negou a existência de uma relação comercial entre você. Para sua tranquilidade, seu e-mail não será publicado e será mantido em reserva.\r\n\r\nAtenciosamente,\r\nSistema LLC', NULL),
(263, 24, 'ru', 'В ожидании бизнес-справки в Sistema', '', 'Напоминаем вам, что пользователь учетной записи [USER MAIL], [USER COMPLETE NAME], включил ваш контакт в свой круг партнёров, указывая на то, что он поддерживает коммерческие отношения с вами.\r\n\r\nМогли бы вы подтвердить, что между вами есть коммерческая связь, нажав на кнопку ´Подтвердить´.', '[LINK]\r\n\r\nСообщаем вам, что если вы не получите подтверждение в течение следующих 2 дней, мы будем считать, что вы отрицаете существование коммерческих отношений между вами. Для вашего спокойствия ваш адрес электронной почты не будет опубликован и будет храниться в резерве.\r\n\r\nС уважением,\r\nSistema LLC', NULL),
(264, 24, 'zh', '有待Sistema提供商贸对象背景情况', '', '帐户为[USER MAIL]的用户[USER COMPLETE NAME]已将您的联系方式加进了他的商务圈，以表示他与您保持着商贸联系，特此禀告。\r\n\r\n您可以点击下面的“验证”按钮，以确认你们之间存在商贸联系。', '[LINK]\r\n\r\n若两天内收不到您的确认，我们将认为您已否认你们之间存在商贸联系，特此禀告。 您的电子邮件不会被发布，将留存待命，请您放心。\r\n\r\nSistema LLC敬上', NULL),
(265, 25, 'ar', 'Sistema في انتظار الإشارة التجارية في', '[USER MAIL] عزيزي المستخدم', '.لم يثبت بعد طلب المرجع التجاري [REFERENCE MAIL] نحيطكم علما بأن \r\n\r\nيرجى التأكد من استلام مرجعك التجاري للبريد الإلكتروني الخاص بنا، ومن فضلك قم بتأكيد وجود علاقة عمل بينكما (انقر على زر ´التحقق من صحة´ أرسلنا عن طريق البريد الإلكتروني)إذا لم نتلق \r\n.الموافقة في اليومين المقبلين سوف نعتبر أن هذا الشخص قد أنكر وجود علاقة تجارية\r\n\r\n.إذا لم يتلق المرجع التجاري الخاص بك بريدنا الإلكتروني، فيرجى طلب إعادة الإرسال أدناه', '[LINK]\r\n\r\nبإخلاص\r\nSistema LLC', NULL),
(266, 25, 'de', 'Ausstehende geschäftliche Referenz in Sistema', 'Sehr geehrte/r Benutzer [USER MAIL]:', 'Wir informieren Sie, dass [REFERENCE MAIL] die geschäftliche Referenzanfrage noch nicht bestätigt hat.\r\n\r\nBitte vergewissern Sie sich, dass Ihre/Ihr Geschäftspartner(in) unsere E-Mail erhalten hat, und erinnern Sie diese(n) daran, dass eine Geschäftsbeziehung zwischen Ihnen (klicken Sie auf die Schaltfläche \"Bestätigen\") per E-Mail bestätigt wurde. Wenn wir innerhalb der nächsten 2 Tage keine Bestätigung erhalten, betrachten wir diese als nicht existierende Geschäftsbeziehung. \r\n\r\nFalls Ihr(e) Geschäftspartner(in) keine E-Mail erhalten hat, fordern Sie diese bitte hier erneut an.', '[LINK]\r\n\r\nMit freundlichen Grüßen\r\nSistema LLC', NULL),
(267, 25, 'en', 'Pending commercial reference at Sistema', 'Dear user [USER MAIL]:', 'We need to inform you that [REFERENCE MAIL] has not yet validated the commercial reference request.\r\n\r\nPlease make sure your commercial reference received our email, and please remind them to confirm the existence of a business relationship between both of you (click on button ´Validate´ that we´ve emailed) , because if we do not receive the confirmation in the next 2 days, we will consider that this person has denied the existence of a commercial relationship.\r\n\r\nIf your commercial reference has not received our email, please request a resubmission below.', '[LINK]\r\n\r\nSincerely\r\nSistema LLC', NULL),
(268, 25, 'es', 'Referencia comercial pendiente en Sistema', 'Estimado/a usuario [USER MAIL]:', 'Le informamos que [REFERENCE MAIL] aun no ha validado la solicitud de referencia comercial.\r\n\r\nPor favor asegúrese que su referencia comercial haya recibido nuestro correo electrónico, y por favor recuérdele que debe de confirmar la existencia de una relación comercial entre ustedes (haciendo clic en botón ´Validar´ que le hemos enviado por correo electrónico), ya que de no recibir su confirmación en los próximos 2 días, consideraremos que esta persona a negado la existencia de una relación comercial.\r\n\r\nSi su referencia comercial no ha recibido nuestro correo electrónico, solicite el reenvío a continuación.', '[LINK]\r\n\r\nAtentamente\r\nSistema LLC', NULL),
(269, 25, 'fr', 'En attente de référence commerciale chez Sistema', 'Cher utilisateur [USER MAIL]:', 'Nous vous informons que [REFERENCE MAIL] n´a pas encore validé votre demande de référence commerciale.\r\n\r\nVeuillez vous assurer que cette référence a bien reçu notre email, et rappelez-lui de confirmer l´existence d´une relation commerciale entre vous (en cliquant sur le bouton ´Valider´ envoyé par courrier électronique). À défaut d´une confirmation de sa part dans les 2 prochains jours, nous considérerons que cette personne a nié l´existence de cette relation.\r\n\r\nSi votre référence commerciale n´a pas reçu notre e-mail, merci de la solliciter à nouveau ci-dessous.', '[LINK]\r\n\r\nCordialement\r\nSistema LLC', NULL),
(270, 25, 'it', 'Riferimento commerciale in sospeso in Sistema', 'Gentile utente [USER MAIL]:', 'Ti informiamo che [REFERENCE MAIL] non ha ancora convalidato la richiesta di riferimento commerciale.\r\n\r\nAssicurati che il tuo riferimento commerciale abbia ricevuto la nostra email e  ricordali di confermare l´esistenza di un rapporto di business tra di voi (cliccando sul pulsante ´Convalida´ inviato alla posta elettronica) se non si riceve la conferma nei prossimi 2 giorni si considererà che questa persona ha negato l´esistenza di una relazione commerciale.\r\n\r\nSe il tuo riferimento commerciale non ha ricevuto la nostra email, ti invitiamo a richiedere l´invio qui sotto.', '[LINK]\r\n\r\nCordiali saluti\r\nSistema LLC', NULL),
(271, 25, 'ja', 'Sistemaで商用リファレンスが保留中です', '[USER MAIL] 様、', '[REFERENCE MAIL]さんが、まだ商用リファレンス依頼を証明していないことをお知らせします。\r\n\r\n商用リファレンス証明者にメールが届いているかどうか打診し、あなたとの間に商業的関係が存在することを立証してくれるよう（メールの「証明する」ボタンをクリックします）、お願いして下さい。今日から2日間以内に立証が行われない場合、商業的関係の存在は否定されたものとみなされます。\r\n\r\n商用リファレンス証明者がSistemaからのメールを受け取っていない場合、次の再送信依頼を行って下さい。', '[LINK]\r\n\r\n何卒よろしくお願いいたします。\r\nSistema LLC', NULL),
(272, 25, 'ko', 'Sistema에서 상업 모증이 보류 중입니다', '[USER MAIL] 회원님', '[REFERENCE MAIL]이 아직 상업 리퍼런스  요청을 확인하지 않았 음을 알려드립니다.\r\n\r\n귀하의 상업 리퍼런스 인이 저희 이메일을 받고도, 이후 2 일 내에 확인을 받지 못하였습니다. 귀하와 비즈니스 관계가 있는것을 상기시켜주시고,  귀하가 이 메일로 보낸 ´확인 버튼을 클릭하도록 요청하십시오. 그렇지 않으면 이 사람이 상업적 관계를 부인했다고 생각할 것입니다.\r\n\r\n귀하의 상업 리퍼런스 인이 이메일을받지 못했다면 아래의 재 제출을 요청하십시오.', '[LINK]\r\n\r\n대단히 감사합니다.\r\nSistema LLC', NULL),
(273, 25, 'pt', 'Referência comercial pendente no Sistema', 'Prezado(a) usuário(a) [USER MAIL],', 'Informamos que [REFERENCE MAIL] ainda não validou sua solicitação de referência comercial.\r\n\r\nCertifique-se de que sua referência comercial recebeu nosso e-mail e peça-lhe que confirme a existência da relação comercial entre vocês clicando no botão ´Validar´ que lhe enviamos. Se não recebermos a confirmação nos próximos 5 dias, consideraremos que não existe tal relação comercial.\r\n\r\nSe sua referência comercial não recebeu nosso e-mail, solicite a nova submissão abaixo.', '[LINK]\r\n\r\nAtenciosamente,\r\nSistema LLC', NULL),
(274, 25, 'ru', 'В ожидании бизнес-справки в Sistema', 'Уважаемый пользователь [USER MAIL]', 'Сообщаем вам, что мы передали ваш запрос, на указание коммерчесскй свзязи [REFERENCE MAIL].\r\n\r\nПожалуйста, убедитесь, что ваш партнер получил наш запрос и напомните ему что бы подтвердил о существовании деловых отношений между вами (нажав на кнопку ´Подтвердить´, которую мы отправили по электронной почте) если не получим подтверждения в течение следующих 2 дней, мы посчитаем, что этот человек отрицает существование коммерческих отношений.\r\n\r\nЕсли ваш партнер не получил нашего электронного письма, пожалуйста, сделайте повторный запрос ниже.', '[LINK]\r\n\r\nС уважением,\r\nSistema LLC', NULL),
(275, 25, 'zh', '有待Sistema提供商贸对象背景情况', '敬爱的用户[USER MAIL]', '兹通知[REFERENCE MAIL]尚未确认商贸背景情况调查请求。\r\n\r\n请确认您的请求已收到我们的电邮回复，还请提醒他确认你们之间存在商贸联系（点击我们通过电子邮件发送的“验证”按钮），若未来2天内未收到确认，我们将认为此人否认你们间存在商贸联系。\r\n\r\n如果您的商贸背景情况请求没有收到我们的电邮回复，请在下面重新提交。', '[LINK]\r\n\r\nSistema LLC敬上', NULL),
(276, 26, 'ar', 'Sistema تم رفض المرجع التجاري في', '[USER MAIL] عزيزي المستخدم', 'قد رفض الطلب المرجعي التجاري الذي ينفي وجود [REFERENCE MAIL] نحيطكم علما بأن \r\n.علاقة تجارية بينكما\r\n\r\nنقترح عليك مواصلة تضمين المراجع التجارية الجديدة حيث أنها ستحسن من جودة حسابك. إذا كنت \r\n:ترغب في دمج مرجع تجاري جديد، فانقر على الرابط التالي لمتابعة المعالجة', '[LINK]\r\n\r\nبإخلاص\r\nSistema LLC', NULL),
(277, 26, 'de', 'Geschäftliche Referenz auf Sistema wurde abgelehnt', 'Sehr geehrte/r Benutzer [USER MAIL]:', 'Wir informieren Sie darüber, dass [REFERENCE MAIL] die geschäftliche Referenzanfrage abgelehnt hat und somit das Bestehen einer Geschäftsbeziehung zwischen Ihnen nicht bestätigt wurde.\r\n\r\nWir empfehlen Ihnen, weiterhin neue Geschäftsreferenzen aufzunehmen. Wenn Sie eine neue geschäftliche Referenz veröffentlichen möchten, klicken Sie auf den folgenden Link:', '[LINK]\r\n\r\nMit freundlichen Grüßen\r\nSistema LLC', NULL),
(278, 26, 'en', 'Commercial reference rejected at Sistema', 'Dear user [USER MAIL]:', 'We need to inform you that [REFERENCE MAIL] has rejected the commercial reference request denying the existence of a commercial relationship between both of you.\r\n\r\nWe suggest you continue to incorporate new commercial references as it will improve the quality of your account. If you wish to incorporate a new commercial reference, click on the following link to continue the process:', '[LINK]\r\n\r\nSincerely\r\nSistema LLC', NULL),
(279, 26, 'es', 'Referencia comercial rechazada en Sistema', 'Estimado/a usuario [USER MAIL]:', 'Le informamos que [REFERENCE MAIL] ha rechazado la solicitud de referencia comercial negando la existencia de una relación comercial entre ustedes.\r\n\r\nLe sugerimos continuar incorporando nuevas referencias comerciales ya que mejorará la calidad de su cuenta. Si desea incorporar una nueva referencia comercial haga clic en el enlace siguiente para avanzar con el proceso:\r\n', '[LINK]\r\n\r\nAtentamente\r\nSistema LLC', NULL),
(280, 26, 'fr', 'Référence commerciale rejetée chez Sistema', 'Cher utilisateur [USER MAIL]:', 'Nous vous informons que [REFERENCE MAIL] a rejeté la demande de référence commerciale, niant l´existence de cette relation entre vous.\r\n\r\nNous vous suggérons de continuer à intégrer de nouvelles références commerciales afin d´améliorer la qualité de votre compte. Si vous souhaitez intégrer une nouvelle référence, cliquez sur le lien suivant afin d´accélerer le processus:', '[LINK]\r\n\r\nCordialement\r\nSistema LLC', NULL),
(281, 26, 'it', 'Riferimento commerciale rifiutato a Sistema', 'Gentile utente [USER MAIL]:', 'Ti informiamo che [REFERENCE MAIL] ha rifiutato la richiesta commerciale di riferimento negando l´esistenza di una relazione commerciale tra di voi.\r\n\r\nTi consigliamo di continuare a incorporare nuovi riferimenti commerciali in quanto migliorerà la qualità del tuo account. Se desideri incorporare un nuovo riferimento commerciale, fai clic sul seguente collegamento per procedere:', '[LINK]\r\n\r\nCordiali saluti\r\nSistema LLC', NULL),
(282, 26, 'ja', 'Sistemaで商用リファレンスが却下されました', '[USER MAIL] 様、', '[REFERENCE MAIL] さんが、商用リファレンス証明を却下し、あなたとの商業的関係の存在を否定したことをお知らせします。\r\n\r\n\r\nアカウントの信用を向上させるため、これからも新しい商用リファレンスを追加していくことをお勧めします。新しい商用リファレンスを追加する場合は、次のリンクをクリックして手続きを進めてください。', '[LINK]\r\n\r\n何卒よろしくお願いいたします。\r\nSistema LLC', NULL),
(283, 26, 'ko', 'Sistema에서 거부 된 상업 리퍼런스  참조', '[USER MAIL] 회원님', '[REFERENCE MAIL]이 귀하와 상업적 관계의 존재를 부인하는 상업적 리퍼런스  요청을 거부했음을 알려드립니다.\r\n\r\n새로운 상업 리퍼런스 을 계속해서 포함시켜 계정의 품질을 향상시킬 것을 권장합니다. 새로운 상업 참조를 사용하려면 다음 링크를 클릭하여 프로세스를 진행하십시오.', '[LINK]\r\n\r\n대단히 감사합니다.\r\nSistema LLC', NULL),
(284, 26, 'pt', 'Referência comercial rejeitada no Sistema', 'Prezado(a) usuário(a) [USER MAIL],', 'Informamos que [REFERENCE MAIL] rejeitou sua solicitação de referência comercial, negando a existência de uma relação comercial entre vocês.\r\n\r\nSugerimos que continue incluindo novas referências comerciais para melhor a qualidade da sua conta. Se deseja incorporar uma nova referência comercial, clique no link abaixo:', '[LINK]\r\n\r\nAtenciosamente,\r\nSistema LLC', NULL),
(285, 26, 'ru', 'Бизнес-справка отклонена в Sistema', 'Уважаемый пользователь [USER MAIL]', 'Сообщаем вам, что [REFERENCE MAIL] отклонил коммерческий ссылочный запрос, отрицая сушествования партнёрских отношений между вами.\r\n\r\nМы предлагаем вам продолжыть добавлять другие коммерческие контакты, поскольку это улучшит качество вашей учетной записи. Если вы хотите включить новую коммерческую ссылку, нажмите следующую ссылку, чтобы пройти к процессу:', '[LINK]\r\n\r\nС уважением,\r\nSistema LLC', NULL),
(286, 26, 'zh', 'Sistema拒绝提供商贸对象的背景情况', '敬爱的用户[USER MAIL]', '兹通知[REFERENCE MAIL]已拒绝了您的商贸背景情况调查请求，否认你们之间存在商贸关系。\r\n\r\n建议您添加新的商贸背景情况介绍，以提升您的帐户质量。 如果您希望添加新的商贸背景情况介绍，请单击以下链接以推进此过程：', '[LINK]\r\n\r\nSistema LLC敬上', NULL),
(287, 27, 'ar', 'Sistema استعلام', '[USER MAIL] عزيزي المستخدم', ':من أجل تحسين خدماتنا نطلب منك الإجابة على الأسئلة التالية\r\n\r\n[FORM]', '!شكراً جزيلاً\r\n\r\nبإخلاص\r\nSistema LLC\r\n', NULL),
(288, 27, 'de', 'Sistema-Umfrage', 'Sehr geehrte/r Benutzer [USER MAIL]:', 'Um unser Service zu verbessern, bitten wir Sie darum, folgende Fragen zu beantworten:', 'Vielen Dank im Voraus für Ihre Hilfe!\r\n\r\nMit freundlichen Grüßen\r\nSistema LLC', NULL),
