(290, 27, 'es', 'Cuestionario de Sistema', 'Estimado/a usuario [USER MAIL]:', 'Con el fin de mejorar nuestros servicios le solicitamos que por favor nos responda las siguientes consultas:\r\n\r\n[FORM]', 'Desde ya muchas gracias.\r\n\r\nAtentamente\r\nSistema LLC', NULL),
