(293, 27, 'ja', 'Sistemaアンケートフォーム', '[USER MAIL] 様、', 'サービスを改善するために、以下の質問にお答えください。\r\n\r\n[FORM]', '誠にお手数おかけいたしますが、何卒よろしくお願いいたします。\r\nSistema LLC', NULL),
