(295, 27, 'pt', 'Consulta Sistema', 'Prezado(a) usuário(a) [USER MAIL],', 'Para melhorar nossos serviços, por gentileza responda às seguintes perguntas:\r\n\r\n[FORM]', 'Agradecemos de antemão.\r\n\r\nAtenciosamente,\r\nSistema LLC', NULL),
