(309, 29, 'en', 'Sistema´s Advertising Services', 'A new way of doing business.', 'Sistema is a free and simple way to help you connect with those seeking products or services you offer, or those offering products or services you look for.\r\n\r\nInstitutional video:\r\n\r\nhttps://youtu.be/mWCN47BwVIk', 'Log in to our website or download the app on to your mobile device.', 'Estimado\r\n\r\nMi nombre es Flavio Gariglio y formo parte del equipo de Sistema.com\r\n\r\nSistema.com es un plataforma web que permite localizar exportadores e importadores en todo el mundo.\r\n\r\nDesarrollada en 11 idiomas sobre la base de un nomenclador inteligente, ubica contrapartes de manera automática, clientes o proveedores, con un alto nivel de precisión entre los productos o servicios de interés de las partes involucradas, deviniendo en una mayor potencialidad comercial de las vinculaciones realizadas.\r\n\r\nSistema.com y Sistema app es actualmente la herramienta clave para el desarrollo de mercados internacionales de más de 9.000 usuarios alrededor del mundo.\r\n\r\n\r\n\r\nVideo institucional de Sistema:\r\n\r\nhttps://youtu.be/mWCN47BwVIk\r\n\r\n\r\n\r\nSistema´s Advertising Services conforma el sistema de avisos publicitarios que funcionan dentro del entorno de Sistema.com, que permiten a nuestros clientes de todo el mundo promocionar en la plataforma en forma directa a diversos segmentos de público objetivo:\r\n\r\n * Sistema Target Ads - Avisos direccionados a exportadores / importadores por Códigos HS (6 dígitos).\r\n\r\n * Sistema Market Ads - Avisos direccionados a exportadores / importadores por mercados. \r\n\r\n * Sistema Premium User - Ofertas y demandas diferencias.\r\n\r\n\r\n\r\nMas información sobre los servicios:\r\n\r\nhttps://www.dropbox.com/s/ujl6rw7f581n0dk/SISTEMA%20Advertising%20Services.doc?dl=0\r\n\r\n\r\n\r\nAtento a sus comentarios, y por favor si requiere que nos comuniquemos con usted solo debe solicitarlo.\r\n\r\nEquipo Sistema'),
(310, 30, 'es', 'Invitación a cobranza', '', 'El usuario de la cuenta [USER MAIL], [USER COMPLETE NAME], lo ha invitado a una operación de cobranza documentaria.\r\n\r\nPodría usted confirmarnos que que quiere participar haciendo clic a continuación en el botón de ´Validar´.', '[LINK]\r\n\r\nLe informamos que de no recibir su confirmación en los próximos 5 días, consideraremos que usted ha negado la invitación. Para su tranquilidad su correo electrónico no será publicado y se mantendra en reserva.\r\n\r\nAtentamente\r\nSistema LLC', NULL);
