(102, '一个新的形态做生意，简单又免费，可提供你的产品及服务给需要的人也可找到你需要的产品及服务的联系', 'Una nueva forma de hacer negocios. Sistema te conecta de manera simple y gratuita con quienes buscan los productos o servicios que tú ofreces, o bien con quienes ofrecen los productos o servicios que tú buscas.', 'A new way of doing business. Sistema is a free and simple way to help you connect with those seeking products or services you offer, or those offering products or services you look for.', '', 'طريقة جديدة لقيام بالأعمال التجارية\r\nيربط لك طريقة بسيطة و مجانية مع الذين يسعون إلى المنتجات والخدمات التي تقدمها. أو مع أولئك Sistema\r\n.الذين يقدمون منتجات أو خدمات أنت تبحث عنها', 'Uma nova forma de fazer negócios. Sistema o conecta de forma simples e gratuita com pessoas que estejam procurando os produtos ou serviços de sua empresa, assim como com aquelas empresas que estejam oferecendo os produtos e serviços que você procura.   ', 'Новый способ ведения бизнеса. Sistema соединяет вас, простым и бесплатным способом, с теми, кто ищет товары или услуги которые вы предлагаете, или с теми, которые предлагают товары или услуги, которые вы ищете.', '新たなビジネススタイル。Sistema は、製品やサービスを提供したい方と、それを必要とする方を簡単に、しかも無料でつなぎます。', 'Eine neue Art Geschäfte zu machen. Sistema verbindet Sie einfach und kostenlos, mit denen, die die Produkte oder Dienstleistungen suchen, die Sie anbieten, oder mit denen, die die Produkte oder Dienstleistungen anbieten, die Sie suchen.', 'Une nouvelle façon de faire des affaires. Sistema vous met en contact, de manière simple et gratuite, avec ceux qui cherchent les produits ou services que vous offrez, ou avec ceux qui offrent des produits ou des services que vous souhaitez.', '비지니스를 하는 새로운 방법. Sistema는 당신이 판매하는 제품과 서비스를 찾는 사람들과 간편하고 자유롭게 연결시켜주고 당신이 찾는 제품과 상품을 찾을 수 있도록 연결시켜 줍니다.', 'Un nuovo modo di fare negozi. Sistema si collega in modo semplice e gratuito con coloro che cercano i prodotti o servizi offerti, o con coloro che offrono i prodotti o servizi che cercate.'),
(103, '关于我们', 'Sobre nosotros', 'About us', '', 'معلومات عنا', 'Sobre nós', 'О нас', 'Sistemaについて', 'Über uns', 'À propos', '회사소개', 'Circa noi'),
(104, '我们的使命', 'Nuestra misión', 'Our mission', '', 'مهمتنا ', 'Nossa missão', 'Наша миссия', 'Sistemaのミッション', 'Unsere Aufgabe', 'Notre mission', '회사비젼', 'La nostra missione'),
(105, '提供全球生意的平台，简化了供应商与客人的联系', 'Otorgar al mundo de los negocios una plataforma global que simplifique la búsqueda y el contacto de potenciales clientes o proveedores tanto para productos como servicios.', 'Give the business world a global platform that simplifies the search and contact of the potential customers or suppliers for both products and services.', '', 'إعطاء عالم الأعمال منصة عالمية يبسط من خلالها البحث والاتصال مع الزبائن أو المُوردين المحتملين لكل من المنتجات و الخدمات', 'Oferecer ao mundo dos negócios uma plataforma global que simplifique a busca e o contato de clientes em potencial ou fornecedores tanto para produtos como para servicios.', 'Создание глобальной платформы для делового мира, которая упрощает поиск и контакт потенциальных клиентов или поставщиков, как для продуктов, так и для услуг.', '製品やサービスの将来的なクライアントやサプライヤーを探しコンタクトすることが簡単にできるような、グローバルなプラットフォームをビジネスの世界に提供します。', 'Geben Sie der Business-Welt eine globale Plattform, die die Suche und Kontakt der potentiellen Kunden und Lieferanten untereinander sowohl für Produkte als auch Dienstleistungen vereinfacht.', 'Offrir au monde des affaire une plateforme mondiale simplifiant la recherche et la mise en contact de potentiels clients ou fournisseurs tant pour les produits que pour les services.', '상품 및 서비스의 잠재고객 및 배급업자의 연락처와 검색을 단순화 시켜주는 국제 플렛폼으로 세계 비지니스로 도양하세요.', 'Dare al mondo degli affari una piattaforma globale che semplifica la ricerca e il contatto dei potenziali clienti o fornitori sia per i prodotti e servizi.'),
(106, '我们的团队', 'Nuestro equipo', 'Our team', '', 'فريقنا', 'Nossa equipe', 'Наша команда', 'Sistema運営チーム', 'Unser Team', 'Notre équipe', '팀 소개 ', 'La nostra squadra'),
