(115, '可用X@X.com联络我们', 'Si deseas contactarnos puedes escribirnos a X@X.com', 'If you wish to contact us please email us at X@X.com', '', 'X@X.com إذا كنت ترغب في الاتصال بنا يرجى الكتابة إلى ', 'Para entrar em contato conosco escreva para X@X.com', 'Если желаете связаться с нами пишите по адресу X@X.com', '私共へのご連絡をご希望の場合は、X@X.comまでメールをお送りください。', 'Wenn Sie uns kontaktieren wollen, bitte an X@X.com schreiben', 'Pour nous contacter, écrire à X@X.com', '문의 사항이 있으신 경우에는 X@X.com 로 메일을 보내주시기 바랍니다', 'Se volete contattarci potete scrivere a X@X.com'),
(116, '服务条件', 'Condiciones del servicio', 'Terms of service', '', 'شروط الخدمة', 'Condições do serviço', 'Условие услуг', '利用規約', 'Nutzungsbedingungen', 'Conditions d´utilisation', '서비스 약관', 'Termini del servizio'),
