(118, 'Sistema 将为你联系生意，在全球帮你找产商或客户', 'Sistema te conecta con los negocios. Localiza clientes y proveedores en todo el mundo.', 'Sistema connects you with the business. Locates customers and suppliers worldwide.', '', '.تصلك مع قطاع الأعمال\r\n.Sistema تحديد مواقع الزبائن و العملاء المُوردين في جميع أنحاء العالم ', 'Sistema conecta você com os negócios. Localiza clientes e fornecedores no mundo todo.', 'Sistema соединяет вас с бизнесом. Находит клиентов и поставщиков по всему миру.', 'Sistema はビジネスとあなたをつなぎます。世界規模でクライアント/サプライヤーを見つけましょう。', 'Sistema ist Ihre Verbindung zum Business. Suchen Sie Kunden und Lieferanten weltweit.', 'Sistema vous met en contact avec les entreprises. Localisez les clients et les fournisseurs dans le monde entier.', 'Sistema님이 거래를 요청하였습니다. 고객과 전세계 공급처의 위치를 확인해주세요.', 'Sistema ti collega con gli affari. Localizza clienti e fornitori in tutto il mondo.'),
(119, '进入我们的网站或下载App到你的手机', 'Ingresá a nuestro sitio web o bien descarga la App para tu celular.', 'Log in to our website or download the app on to your mobile device.', '', '.أُدخل إلى موقعنا على شبكة الإنترنت أو تنزيل التطبيق على الهاتف المحمول الخاص بك', 'Acesse nossa página web ou descarregue o aplicativo no celular.', 'Приглашаем вас посетить наш веб-сайт или скачать преложение на ваш телефон.', 'Webサイトからログイン、もしくは携帯からアプリをダウンロードしてください。', 'Besuchen Sie unsere Website oder laden Sie die App auf Ihr Handy.', 'Entrez sur notre site ou téléchargez l´application pour téléphone portable.', '우리 웹사이트에 들어가거나 스마트폰에 어플리케이션을 설치해주시기 바랍니다.', 'Entra al nostro sito web o scarica l´applicazione nel telefono cellulare.'),
(120, '免费注册', 'Registrate gratis.', 'Sign up free.', '', '.التسجيل مجاناً', 'Registre-se gratuitamente.', 'Зарегистрируйся бесплатно.', '登録は無料です。', 'Melden Sie sich kostenlos an.', 'Enregistrez-vous gratuitement.', '무료가입하세요.', 'Registrati gratis.'),
(121, '添加你有的产品及服务', 'Agrega todos los productos y servicios que ofreces.', 'Add all the products and services you offer.', '', '.إضافة كافة المنتجات و الخدمات التي تقدمها', 'Incluia todos os produtos e serviços que você oferece.', 'Добавить все продукты и услуги, которые вы предлагаете.', 'あなたが提供する製品やサービスを全て登録してください。', 'Geben Sie alle Produkte und Dienstleistungen an, die Sie anbieten.', 'Ajoutez les produits et services que vous offrez.', '당신의 판매 상품과 서비스를 추가하세요.', 'Aggiungi tutti i prodotti e servizi che offri.'),
(122, '添加你所需的产品及服务', 'Agrega todos los productos y servicios que tú necesitas.', 'Add all the products and services you need.', '', '.إضافة كافة المنتجات و الخدمات التي تحتاجها', 'Inclua todos os produtos e serviços de que você precisa.', 'Добавить все продукты и услуги, которые вам нужны.', 'あなたが必要としている製品やサービスを全て登録してください。', 'Nennen Sie alle Produkte und Dienstleistungen, die Sie benötigen.', 'Ajoutez les produits et services que vous cherchez.', '당신이 필요한 상품과 서비스를 추가하세요.', 'Aggiungi tutti i prodotti e servizi che cerchi.'),
(123, '填写个人资料以方便产商或客户的联系', 'Completa tú información de perfil para facilitar el contacto con tus potenciales clientes y proveedores.', 'Fill out your profile information to simplify the contact with your potential customers and suppliers.', '', '.استكمال المعلومات الشخصية الخاصة بك لتسهيل الاتصال مع الزبائن المحتملين والعملاء المُوردين', 'Complete sua informação de perfil para facilitar o contato com seus fornecedores e clientes em potencial.', 'Заполните свой профиль, что бы ваши потенциальные клиенты могли связаться с вами.', '将来のクライアント/サプライヤーがコンタクトしやすいように、あなたのプロフィール情報を入力して下さい。', 'Vervollständigen Sie Ihre Profildaten, um den Kontakt mit Ihren potenziellen Kunden und Lieferanten zu ermöglichen.', 'Complétez votre profil personnel afin de faciliter la mise en contact avec des clients ou fournisseurs potentiels.', '프로필 정보를 입력해서 잠재적 고객과 공급처들에게 편의를 제공해주시기 바랍니다.', 'Completa il tuo profilo per facilitare il contatto con i vostri potenziali clienti e fornitori.'),
(124, '最后，查看你所获得的联系', 'Por último, observa los contactos generados a partir de la información que has suministrado.', 'Finally, observes the leads generated from the information you´ve provided.', '', '.أخيراً تلاحظ الاتصالات المتولدة من المعلومات التي قدمتها لنا', 'Por último, observe os contatos gerados a partir da informação fornecida por você. ', 'В итоге наблюдайте за созданием контактов за счет предоставленной информацией.', '最後に、あなたが登録した情報に基づいて作成されたコンタクト先を見てみましょう。', 'Schließlich prüfen Sie die generierten Vorschläge, mit den von Ihnen bereitgestellten Informationen.', 'Enfin découvrez les contacts générés à partir des informations que vous avez entré.', '마지막으로 당신이 제공한 정보로 부터 어떤 연락처들이 생성되는지 확인하시기 바랍니다.', 'Infine, osserva i contatti generati dalle informazioni che ci hai fornito.'),
(125, '你也可以有销受点统计资料 知己知彼', 'También cuentas con información estadística que te permitirá visualizar el flujo de comercio existente con los mercados donde se localizan tus contrapartes. ', 'Also include statistical information that allows you visualize the flow of trade with the markets there where your counterparts are located.', '', '.تشمل أيضاً المعلومات الإحصائية التي تسمح لك بتصور تدفق التجارة مع الأسواق حيث هناك نظائرك', 'Você também conta com informações estatísticas que lhe permitirão visualizar o fluxo de comércio existente com os mercados onde estão localizados seus possíveis parceiros comerciais.', 'Так же возможно визуализировать статистику, комерчиской информации, которая позволит наблюдать за конкурентами в других странах.', 'また、あなたの取引先の地元の市場に関する統計情報もご用意しています。これによって、現状どのような取引が行われているかをビジュアルに把握することができます。', 'Sie bekommen auch statistische Informationen, welche Ihnen ermöglicht, die Handelsströme mit den Märkten zu visualisieren, wo sich Ihre Partner befinden.', 'Vous avez également accès à des informations statistiques qui vous permettront de visionner les flux de commerce existant sur les marchés où se situent vos partenaires. ', '또한 당신이 허락하는 당신의 파트너가 위치한 시장의 시장흐름을 시각화하는 통계정보를 채워주세요.', 'Include anche l´informazione statistica che ti consente di visualizzare il flusso del commercio giá esistente con i mercati dove si trovano le tue controparti.'),
(126, '欢迎到 Sistema', 'Bienvenido a Sistema', 'Welcome to Sistema', '', 'Sistema أهلاً بك في', 'Bem-vindo a Sistema', 'Добро пожаловать в Sistema', 'Sistema にようこそ', 'Wilkommen bei Sistema', 'Bienvenue à Sistema', 'Sistema 방문하신 것을 환영합니다', 'Benvenuti a Sistema'),
