(174, '成为一个突出的用户', 'Ser un Usuario Destacado', 'Become a Renowned User', '', 'أصبح مستخدماً شهيراً', 'Ser um Usuário Premium', 'Стать Выделенным Пользователем', '「注目のユーザー」になる', 'Werden Sie Premium Mitglied', 'Devenir un Utilisateur Renommé', '우수 회원 되기', 'Diventa Utente Rinomato'),
(175, '成为一个突出的用户可以在竞争中脱颖而出', 'Siendo Usuario Destacado podrás resaltar tus ofertas y demandas en forma permanente del resto de los resultados de obtenidos por tus contrapartes.', 'As a Renowned User you can highlight your offers and demands permanently from the rest of the results obtained by your counterparts.', '', 'كمستخدم شهير يمكنك تسليط الضوء على العروض و الطلبات لديك بشكل استمراري من بقية النتائج التي يحصل عليها نظائرك.', 'Sendo um Usuário Premium você poderá ressaltar suas ofertas e demandas dos demais resultados obtidos por seus possíveis parceiros comerciais de forma permanente.', 'Будучи вы Выделенный Пользователь вы можете выделить свои предложение и запросы из результатов поиска среди своих конкурентов.', '「注目のユーザー」になると、相手に表示された検索結果中で、常にあなたのオファー／ニーズが目立つように表示されるようになります。', 'Als Premium Mitglied können Sie Ihre Angebote und Nachfragen dauerhaft vom Rest der von Ihren Partnern / Wettbewerbern erzielten Ergebnisse hervorheben.', 'En tant qu´utilisateur renommé, vous pouvez mettre en valeur de façon permanente vos offres et demandes.', '우수회원이 되면 당신의 파트너가 얻은 정보의 나머지로부터 당신의 수요와 상품이 강조할 수 있습니다.', 'Come Utente Rinomato è possibile evidenziare le vostre richieste e offerte in modo permanente dal resto dei risultati ottenuti dalle vostre controparti.'),
(176, '突出用户的服务费用', 'Costo del servicio de Usuario Destacado', 'Renowned User Service cost', '', 'تكلفة المستخدم الشهير', 'Custo do serviço de Usuário Premium', 'Стоимость услуги за Выделение своего пользователя', '「注目のユーザー」サービスの料金', 'Kosten für Premium Mitgliedschaft', 'Coût du service d´Utilisateur Renommé', '우수 회원 비용', 'Costo del servizio per l´Utente Rinomato'),
(177, '聘请', 'Contratar', 'Contract', '', '(العقد (الاتفاقية', 'Contratar', 'Нанять', '契約する', 'Vertrag', 'Contracter', '연락처', 'Assumere'),
(178, '登于Sistema', 'Publicitar en Sistema', 'Advertise in Sistema', '', 'Sistema الإعلان في', 'Fazer propaganda em Sistema', 'Ставте свое обявление в Sistema', 'Sistemaに広告を出す', 'Werben Sie bei Sistema', 'Faire de la publicité en Sistema', 'Sistema 광고하기', 'Pubblicità su Sistema');
INSERT INTO `palabras` (`pal_id`, `pal_desc_zh`, `pal_desc_es`, `pal_desc_en`, `pal_desc_hi`, `pal_desc_ar`, `pal_desc_pt`, `pal_desc_ru`, `pal_desc_ja`, `pal_desc_de`, `pal_desc_fr`, `pal_desc_ko`, `pal_desc_it`) VALUES
(179, '海关在Sistema 登广告， 您可依您需要的国家，产品及服务等级刊登广告', 'Al publicitar en Sistema, tu podrás segmentar de manera precisar por país y producto (Posición Arancelaria HS) ó servicio (Categoría), y así dirigir tu aviso al público objetivo deseado.', 'Sistema to advertise in, you can accurately target by country and product (tariff HS) or service (category), so direct your notice to the desired target audience.', '', 'للإعلان في Sistema . يمكنك استهداف بشكل دقيق و صحيح حسب البلد والمنتج (تعريف الرمز HS) أو خدمة (الفئة) وبالتالي توجيه نظركم إلى الجمهور المستهدف المطلوب.', 'Ao fazer propaganda em Sistema, você poderá segmentar de forma precisa por país e produto (Código Pautal SH) ou serviço (Categoría), e assim dirigir seu anúncio ao público-alvo desejado.', 'Делая свое объявление в Sistema, вы можете сегментировать по странам, по продукту (ТН ВЭД) или сервису (по это категории), и таким образом точно направить ваше объявление.', 'Sistemaの広告では、国別および製品(HSコード）/サービス（分類コード）別に正確なターゲット選別を行うことができるので、対象とするお客様に対し広告を確実に届けることができます。', 'Werben Sie bei Sistema. Hier können Sie genau nach Land und Zolltarifnummer oder Dienstleistung (Kategorie) sortieren. So kann sich Ihre Mitteilung an die gewünschte Zielgruppe richten.', 'En promotionnant sur Sistema, vous pourrez segmenter, de manière précise, par pays et produit (tarif Position SH) ou service (Catégorie) et ainsi diriger votre publicité au public souhaité.', 'Sistema 광고하기 위해서, 당신은 국가와 상품(HS 관세) 또는 서비스(품목)의 타켓을 정할 수 있어서 잠재 고객에게 직접 광고가 노출 될 수 있습니다.', 'Per aver pubblicitato su Sistema potrai segmentare in maniera precisa per paese e per prodotto (tariffa HS) o per servizio (categoria), e arrivare cosí al pubblico obiettivo desiderato.'),
(180, '广告费', 'Costo del servicio publicitario', 'Advertising service cost', '', 'تكلفة خدمة الإعلان', 'Custo do serviço de propaganda', 'Стоимость услуги публикации на сайте', '広告費用', 'Werbekosten', 'Coût du service publicitaire', '광고 서비스 비용', 'Costo del servizio di pubblicità'),
