(182, '一旦有了此服务，请寄到电子邮件X@X.com.\r\n\r\n1)您们可想像我们将使用广告横幅，影像必须要符合以下的条件\r\n\r\n-大小面积:12公分X45公分\r\n\r\n-格式:JPG\r\n\r\n-内容:不可淫亵及具有的伤害的内容\r\n\r\n2)在广告横幅中的http网址就是用户们使用的网址\r\n\r\n3)依各国的10位置关税产品请单或服务等级依序排在横幅广告上', 'Tras haber contratado el servicio, proceda a enviar al correo electrónico X@X.com:\r\n1) Imagen que utilizaremos como banner publicitario. La imagen debe cumplir con los siguientes requisitos. \r\n- Tamaño: 12cm x 45cm (4,17 inches x 17,72 inches)\r\n- Formato: jpg \r\n- Contenido: No debe ser obsceno ni ofensivo.\r\n2) Dirección http a la cual serán direccionados los usuario que hagan clic en el banner publicado.\r\n3) Listado de las Posiciones Arancelarias de Producto (HS 6 dígitos) ó Categorías de Servicio, cada una con su correspondiente país, a las que será dirigido el aviso publicitario en base al plan contratado.', 'Having contracted the service proceeds to send email X@X.com:\r\n1) image to use as an advertising banner. The image must meet the following requirements.\r\n- Size: 12cm x 45cm (4,17 inches x 17,72 inches)\r\n- Format: jpg\r\n- Content: It should not be obscene or offensive.\r\n2) HTTP address where will be routed the user who click on the banner posted.\r\n3) List of Tariff Codes Product (HS 6 digits) or service categories, each with its corresponding country, which will run the advertisement based on the contracted plan. \"\"', '', 'بعد أن استأجرت الخدمة ، تتقدم بإرسال بريد إلكتروني إلى X@X.com يتضمن:\r\n1ّّ) صورة لاستخدامها بمثابة لافتة إعلانية.\r\nهذه الصورة يجب أن تستوفي الشروط التالية:\r\n*القياس : 12 سم × 45 سم\r\n*الصيغة : JPG.\r\nالمحتوى : يجب أن لا يكون فاضح أو جارح مُسيئ.\r\n2) عنوان الصفحة (HTTP) حيث يتم توجيه المستخدم من خلال النقر على اللافتة المنشورة.\r\n3) قائمة من الرموز التعريفية للمنتج (تتألف من 6 خانات) أو فئات الخدمة، مع توافق لكل منها البلد الملائم والتي ستوجه الإعلان على أساس خطة الاتفاق والتعاقد. ', 'Após haver contratado o serviço, envie ao e-mail X@X.com: \r\n1) Imagem a ser utilizada como banner. A imagem deve cumprir com os seguintes requisitos: \r\n- Tamanho: 12cm x 45cm (4,17 inches x 17,72 inches)\r\n- Formato: jpg \r\n- Conteúdo: Não deverá conter nada obsceno nem ofensivo. \r\n2) Endereço http para o qual serão direcionados os usuários que clicarem no banner.\r\n3) Lista dos 10 Códigos Pautais de Produto (SH 6 dígitos) ou Categorias de Serviço, cada uma com seu país correspondente, para as quais será enviada a propaganda com base no plano contratado.', 'Пожалуйста отправьте по электронной почте, на адрес X@X.com:\r\n1) Изображение которые мы используем как рекламные баннеры. Изображение должно соблюдать следующие:\r\n- Размер: 12 см х 45 см (4,17 inches x 17,72 inches)\r\n- Формат: jpg\r\n- Содержание: Оно не должно быть непристойным или оскорбительным \r\n2) http адрес куда будут перенаправлены пользователи, которые нажмут на рекламный баннер.\r\n3) Список 10 Товарных Позиций (ТН ВЭД) до 6 цифр или категорию сервиса, каждая со своим спицефическим направлением на определенную страну, по нанятому вами плану.', 'サービスの契約が完了しましたら、下記を X@X.com までメールでお送りください。\r\n\r\n１）宣伝バナー素材。次の条件を満たす画像フォーマットでお願いいたします。\r\n-サイズ: 12cm x 45cm (4,17 inches x 17,72 inches)\r\n-フォーマット: jpg\r\n-内容: わいせつな内容や攻撃的な内容でないこと\r\n \r\n２）ユーザーが宣伝バナーをクリックした際にジャンプする先のhttpアドレス\r\n \r\n３）ご契約のプランが対象とする、広告の表示先となる国での輸入統計品目（HSコード6桁）10個のリスト、もしくはサービスの分類コード10個のリスト', 'Nachdem der Vertrag abgeschlossen wurde, schicken Sie bitte eine eMail an X@X.com mit folgenden Daten:\r\n1)      Bild zu benutzen für das Werbebanner. Das Bild muss den folgenden Anforderungen entsprechen:\r\n-   Größe: 12cm x 45cm (4,17 inches x 17,72 inches)\r\n-   Format: JPG\r\n-   Inhalt: Es sollte nicht obszön oder anstößig sein\r\n2)      HTTP-Adresse, an welche die Benutzer geroutet werden, die auf das gepostete Banner klicken.\r\n3)      Liste der 10 Zolltarifnummern (6-stellig) oder Dienstleistungskategorien für die Werbung, jeweils mit dem entsprechenden Land, wie bereits vertraglich vereinbart.', 'Après avoir souscrit au service, merci d´envoyer par mail à X@X.com :\r\n1) L´image que nous utiliserons comme bannière publicitaire. L´image doit répondre aux critères suivants :\r\n- Taille : 12cm x 45cm (4,17 inches x 17,72 inches)\r\n- Format : jpg\r\n- Contenu : non obscène ou offensant \r\n2) L´adresse URL où sera renvoyé l´utilisateur qui cliquera sur la bannière affichée.\r\n3) La liste des codes tarifaires produit (HS 6 chiffres) ou catégories de services, chacun indiqué avec  son pays correspondant, \r\nauxquels sera dirigé la publicité selon le forfait choisi.', 'X@X.com로 이메일을 보내 해당 서비스를 구독해주시기 바랍니다.\r\n1) 광고배너 이미지는 다음의 조건에 충족시켜 주시기 바랍니다.\r\n- 크기: 12cm x 45cm (4,17 inches x 17,72 inches)\r\n- 포맷: jpg\r\n- 내용: 외설적인 내용이나 모욕적인 내용은 삼가\r\n2) 이용자가 클릭하게 될 배너광고의 http 주소.\r\n3) HS코드 6자리 또는 서비스 항목리스트를 광고가 노출될 국가에 따라 각각 10개씩 작성해주시기 바랍니다.', 'Dopo aver contratto il ricavato servizio per inviare e-mail X@X.com:\r\n1) l´immagine da utilizzare come un banner pubblicitario. L´immagine deve soddisfare i seguenti requisiti.\r\n- Dimensioni: 12cm x 45 cm (4,17 inches x 17,72 inches)\r\n- Formato: jpg\r\n- Contenuto: Non deve essere osceno o offensivo.\r\n2) l´indirizzo HTTP verrà instradata se l´utente clicca sul banner che ha postato.\r\n3) Elenco dei codici tariffari del prodotto (HS 6 cifre) o le categorie di servizi, ognuno con il suo paese corrispondente, che verrà eseguito la pubblicità sulla base del piano di contratto.'),
