(197, '0.00 亿 (2014年估计)', '$ 0.00 millones (2014 estimado)', '$ 0.00 million (Estimated 2014)', '', 'إحصائية 2014)0.00 مليون)', '$ 0.00 milhões (2014 estimado)', '0.00 миллиона $ (предварительно для 2014 года)', '$ 0.00 百万（2014年推定）', '0.00 Mio. USD (geschätzt im 2014)', '$ 0.00 millions (estimation 2014)', '0.00억 $ (2014년)', '0.00 milioni di $ (2014 stima)'),
(198, '你已注册成功，请到你的电子邮件，跟随链接到网址启动你的帐号', 'Tú registro se ha realizado correctamente. Debes activar tu cuenta siguiendo el link que ha sido enviado a tu correo electrónico.', 'Your registration has been successful. You must activate your account by following the link that has been sent to your email.', '', 'تم تسجيلك بنجاح ، يجب عليك تفعيل حسابك من خلال الرابط الذي تم إرساله إلى البريد الإلكتروني الخاص بك.', 'Seu registro foi realizado corretamente. Para ativar sua conta clique no link que foi enviado ao seu e-mail.', 'Ваша регистрация прошла успешно. Вам необходимо активировать свой аккаунт, перейдя по ссылке, которая была отправленна на ваш адрес электронной почты.', '登録が完了しました。あなたのメールアドレスに送られたリンクをクリックして、ユーザーアカウントを有効にしてください。', 'Ihre Anmeldung war erfolgreich. Um Ihr Benutzerkonto zu aktivieren, klicken Sie bitte auf den Aktivierungslink, den wir Ihnen per E-Mail gesendet haben.', 'Inscription réalisée avec succès. Vous devez activer votre compte à partir du lien qui vous a été envoyé par courriel.', '등록이 성공적으로 완료되었습니다. 회원님의 이메일로 전송된 링크를 따라 계좌를 활성화 시켜야합니다.', 'La tua registrazione ha avuto successo. È necessario attivare il tuo account seguendo il link che è stato inviato alla posta elettronica.'),
(199, '恭喜你！你的帐号已成功启动了，请输入你的资料注册', 'Felicitaciones! Tu cuenta ha sido activada. Ingresa tus datos para iniciar sesión.', 'Congratulations! Your account has been activated. Enter your information to login.', '', '.تهنئة ! تم تفعيل حسابك، أدخل معلوماتك لتسجيل الدخول', 'Parabéns! Sua conta foi ativada. Insira seus dados para começar a sessão.', 'Поздравляем! Ваш аккаунт был успешно создан. Введите свои данные что бы войти.', 'お疲れ様でした！これであなたのユーザーアカウントが有効になりました。データを入力してログインしてください。', 'Herzliche Glückwünsche! Dein Konto wurde aktiviert. Geben Sie Ihre Daten ein, um sich anzumelden.', 'Félicitations! Votre compte a été activé. Entrz vos informations pour initier la session.', '축하합니다! 회원님의 계좌가 활성화 되었습니다.로그인을 위해서는 회원님의 정보를 입력해주시기 바랍니다.', 'Complimenti! Il tuo account è stato attivato. Inserisci i tuoi dati per il login.'),
(200, '你的密码已寄到你填写的电子邮件', 'Tu contraseña ha sido enviada al correo electrónico de ingresado.', 'Your password has been sent to the email entered.', '', '.كلمة المرور الخاصة بك أُرسلت إلى البريد الإلكتروني المُدخل', 'Sua senha foi enviada ao e-mail de registro.', 'Ваш пароль был отправлен на указанный имейл.', 'あなたのパスワードが、入力されたメールアドレスに送信されました。', 'Ihr Passwort wurde an die angegebene E-Mail versendet.', 'Votre mot de passe a été envoyé à l´adresse courriel fournie.', '회원님의 비밀번호는 입력된 이메일로 전송되었습니다.', 'La parola d´ordine è stata inviata all´indirizzo di posta elettronica inserito.'),
(201, '你填写的电子邮件不符', 'El correo electrónico ingresado no corresponde a ningún usuario activo.', 'The email entered does not correspond to any active user.', '', '.البريد الإلكتروني الذي أدخلته لا يتطابق مع أي مستخدم نشط', 'O e-mail inserido não corresponde a nenhum usuário ativo.', 'Пользователя с таким email не сушествует.', 'このメールアドレスに一致するユーザーは、登録されておりません。', 'Die angegebene eMail-Adresse ist ungültig.', 'L´adresse courriel renseignée ne correspond à auun utilisateur actif.', '본 메일은 활성화된 회원과 일치하지 않습니다.', 'La posta elettronica non corrisponde a nessun utente attivo.'),
(202, '你的帐号还没启动，到你的电子邮件链接启动', 'Tu cuenta todavía no ha sido activada. Sigue el link enviado en el correo electrónico de bienvenida para activarla.', 'Your account has not yet been activated. Follow the link sent in the welcome email to activate it.', '', 'لم يتم تفعيل حسابك، اتبع الرابط الذي تم إرساله في رسالة الترحيب بالبريد الإلكتروني الخاص بك لتنشيطه', 'Sua conta ainda não foi ativada. Clique no link de boas-vindas enviado ao seu e-mail para ativá-la.', 'Ваш аккаунт еще не открылся. Что бы его активировать следуйте линк который есть в приветственном письме.', 'あなたのユーザーアカウントはまだ有効になっていません。「ようこそ」のメールで送られたリンクをクリックすると、有効にすることができます。', 'Ihr Konto wurde noch nicht aktiviert. Folgen Sie dem Aktivierungslink in der an Sie gesendeten Begrüßungsmail, um dieses zu aktivieren.', 'Votre compte n´a pas encore été activé. Pour l´activer, suivez le lien qui vous a été envoyé dans le courriel de bienvenue.', '계정이 활성화되어있지 않습니다. 가입환영 메일에 담긴 링크를 확인해 주시기 바랍니다.', 'Il tuo account non è stato ancora attivato. Segui il link inviato nel messaggio di benvenuto per attivarlo.'),
