(260, '本人的背景资料均为公开性质，可供Sistema所有客户查阅', 'Toda la información de mi perfil es de carácter público, y por lo tanto puede ser vista por todos los usuarios de Sistema.', 'All the information on my profile is public, and therefore can be seen by all Sistema users.', '', 'جميع المعلومات في ملف التعريف الخاص بي عامة ، وبالتالي يمكن رؤيتها من قبل جميع مستخدمي .Sistema', 'Todas as informações do meu perfil são públicas e, por tanto, podem ser vistas por todos os usuários do Sistema.', 'Мой профиль содержит публичную информацию, по этому все пользователи Sistema могут её видеть.', '私のプロフィール情報は公開するためのものであり、Sistemaのすべてのユーザーが閲覧しても差し支えのないものです。', 'Alle Informationen in meinem Profil sind öffentlich sichtbar und können daher von allen Sistema-Nutzern gesehen werden.', 'Toute information de mon profil est de caractère public, et peut donc être vu par tous les utilisateurs Sistema.', '모든 정보는 공개로 되어있으며, 모든  Sistema 사용자가 볼 수 있습니다.', 'Tutta l´informazione del mio profilo é pubblica e puó essere vista da tutti gli utenti di Sistema.'),
(261, '您的报盘与询价找不到有意向的客户', 'No se han encontrado usuarios interesados en sus ofertas y demandas.', 'No users found related to your offers and demands.', '', '.لم يتم العثور على مستخدمين متعلقين بعروضك ومطالبك', 'Não foram encontrados usuários interessados em suas ofertas e demandas.', 'Не найдено заинтересованых пользователей на ваше предложение или спрос.', 'あなたのオファーやニーズに関連するユーザーが見つかりませんでした。', 'Keine zu Ihren Angeboten und Bedarfen passende Nutzer gefunden.', 'Nous n´avons pas trouvé d´utilisateurs intéressés par vos offres et demandes.', '고객님의 매매에 관련된 사용자를 발견하지 못했습니다.', 'Nessun utente è interessato alle tue offerte e domande (richieste).'),
(262, '请再试一次', 'Por favor, inténtelo de nuevo.', 'Please try again.', '', '.حاول مرة اخرى', 'Por favor, tente novamente.', 'Пожалуйста, попробуйте еще раз.', '再度試して下さい。', 'Bitte versuchen Sie es noch einmal.', 'Merci d´essayer à nouveau.', '다시 시도해주세요.', 'Per piacere, riprova.'),
(263, '全球贸易如今容易多了', 'El comercio global ahora es simple.', 'Global trade, now simple.', '', '.التجارة العالمية ، الآن بسيطة', 'O comércio global agora é simples.', 'Мировая торговля, теперь проще.', 'グローバルビジネスがシンプルになりました。', 'Globaler Handel ist einfach.', 'Le commerce mondial est désormais simple.', '국제무역, 이제 간단합니다.', 'Il commercio globale è ormai semplice.'),
(264, '本人的背景资料可与Sistema用户一起分享', 'Comparto la información suministrada en mi perfil con el resto de los usuarios de Sistema.', 'I am agreeing to share the information provided in my profile with the rest of Sistema users.', '', '.Sistema أوافق على مشاركة المعلومات المقدمة في ملفي الشخصي مع بقية مستخدمي', 'Concordo em compartilhar as informações do meu perfil com os demais usuários do Sistema.', 'Делюсь всей информацией в моём профиле, с другими пользователями Sistema.', '私のプロフィールとして提供した情報を、他のSistemaユーザーと共有します。', 'Ich stimme zu, die Informationen in meinem Profil mit den anderen Nutzern von Sistema zu teilen.', 'Je suis d´accord à partager les informations de mon profil avec le reste des utilisateurs Sistema.', '나의 프로필에 제공된 정보를 Sistema 사용자들과 공유하는 것에 동의합니다.', 'Condivido le informazioni fornite nel mio profilo con il resto degli utenti Sistema.'),
(265, '（2014年大概）', '(2014 aproximado)', '(Approx 2014)', '', '(حوالي 2014)', '(Aproximadamente 2014)', '(Примерно 2014)', '（2014年度推定）', '(Etwa 2014)', '(2014 Approximatif)', '(2014년 기준 견적)', '(Circa 2014)'),
(266, '这样您的发盘与询价将会得到Sistema的客户更大的关注', 'Así todas tus ofertas y demandas captarán mayor atención en el resto de los usuarios de Sistema.', 'So all your offers and demands will capture more attention in the rest of Sistema users.', '', '.Sistema لذا فإن جميع عروضك ومطالبك سوف تجذب المزيد من الاهتمام في بقية مستخدمي', 'Assim, todas as suas ofertas e demandas chamarão mais a atenção dos demais usuários do Sistema.', 'Таким образом, все предложения и требования будут привлекать больше внимания у остальных пользователей Sistema.', 'そうすれば、あなたのオファーやニーズが、他のSistemaユーザーからより注目されやすくなります。', 'So werden all Ihre Angebote und Bedarfe bei den Sistema-Nutzern mehr Aufmerksamkeit erregen.', 'Ainsi, toutes vos offres et demandes retiendront une meilleure attention de la part des autres utilisateurs Sistema.', '당신의 매매내용이 Sistema 사용자들에게 더 주목을 끌 것입니다.', 'Quindi tutte le tue offerte e richieste cattureranno maggiore attenzione nel resto degli utenti Sistema.'),
