(274, '想看全部查询结果,请将过滤器置零', 'Por favor resetea los filtros si deseas ver todos los resultados.', 'Please reset the filters if you want to see all the results.', '', '.يرجى إعادة ضبط الفلاتر إذا كنت تريد مشاهدة جميع النتائج', 'Por favor, redefina os filtros para ver todos os resultados.', 'Пожалуйста, перезагрузите фильтры что бы увидеть все результаты.', '結果をすべてご覧になりたい場合は、フィルターをリセットして下さい。', 'Bitte setzen Sie die Filter zurück, wenn Sie die Ergebnisse sehen möchten.', 'Merci de réinitialiser vos filtres si vous souhaitez voir tous les résultats.', '전체의 결과를 확인하려면 필터를 다시 셋팅해주시기 바랍니다.', 'Se si desidera visualizzare i risultati, reimpostare i filtri.'),
