(276, '如因故收不到我方电子邮件，我们可将链接直接发至您手机（短讯）', 'Si por algún motivo no estás recibiendo nuestro correo electrónico, podemos enviarte el link para activar tu cuenta directamente a tu móvil (SMS).', 'If for some reason you are not receiving our e-mail, we can send you the link to activate your account directly to your mobile device (SMS).', '', 'إذا كنت لا تتلقى رسائل البريد الإلكتروني الخاصة بنا لسبب ما ، يمكننا أن نرسل لك الرابط لتفعيل .(SMS) حسابك مباشرة إلى جهازك المحمول', 'Se por alguma razão você não estiver recebendo nosso e-mail, podemos enviar um link para que possa acessar sua conta diretamente do celular (SMS).', 'Если по какой-то причине, вы не получаете наши письма, мы можем отправить на сотовый телефон, ссылку для активации вашего аккаунта (через СМС).', 'もし何らかの原因でSistemaからのメールを受け取れない場合は、アクティベートするためのリンクをSMSであなたの携帯電話に送ることができます。', 'Wenn Sie aus irgendeinem Grund unsere E-Mail nicht erhalten, können wir Ihnen den Link zur Aktivierung Ihres Kontos direkt auf Ihr Handy (SMS) senden.', 'Si pour une raison quelconque, vous ne pouvez recevoir notre e-mail, nous pouvons vous envoyer le lien afin d´activer votre compte directement à votre téléphone mobile (SMS).', '어떤 이유로 자사의 이메일을 받지 못하고 있다면, SMS로 당신의 계좌를 활성화할 수 있는 링크를 보내드릴 수 있습니다.', 'Se per qualche motivo non ricevi la nostra mail, ti possiamo inviare il link per attivare il tuo account direttamente al tuo cellulare (SMS).'),
