(315, '要比较描述说明，请选择语言', 'Selecciona el idioma si deseas comparar la descripción', 'Select the language if you want to compare the description', '', 'اختر اللغة إذا كنت ترغب في مقارنة الوصف', 'Selecione o idioma para comparar a descrição', 'Выберите язык, если вы хотите сравнить описание', '記述を比較したい場合は、言語を選択して下さい。', 'Wählen Sie die Sprache, wenn Sie die Beschreibung vergleichen möchten', 'Séleccioner la langue si vous souhaitez comparer la description', '세부내용 비교를 원하시면, 언어를 선택하시기 바랍니다.', 'Selezionare la lingua se si desidera confrontare la descrizione'),
(316, '发送', 'Enviar', 'Submit', '', 'عرض', 'Enviar', 'Отправить', '送信する', 'Senden', 'Envoyer', '보내기', 'Inviare'),
(317, '复制链接 ', 'Copiar link', 'Copy link', '', 'انسخ الرابط', 'Copiar link', 'Скопировать ссылку', 'リンクをコピー', 'Link kopieren', 'Copier le lien', '링크 복사하기', 'Copia link'),
(318, '由第三方确认电子信箱帐号', 'Validación de las cuentas de correo electrónico por terceros', 'Validation of email accounts by third parties', '', 'التحقق من حسابات البريد الإلكتروني من قبل أطراف ثلاثة', 'Validação das contas de e-mail por terceiros', 'Подтвердите учётную запись для других подписчиков', '第三者によってメールアドレスを証明する', 'Validierung von E-Mail-Konten durch Dritte', 'Validation des comptes d´adresses e-mail par des tiers', '제 3자를 통해 e-mail 계정 유효화하기', 'Convalida di conti di posta elettronica da parte di terzi');
INSERT INTO `palabras` (`pal_id`, `pal_desc_zh`, `pal_desc_es`, `pal_desc_en`, `pal_desc_hi`, `pal_desc_ar`, `pal_desc_pt`, `pal_desc_ru`, `pal_desc_ja`, `pal_desc_de`, `pal_desc_fr`, `pal_desc_ko`, `pal_desc_it`) VALUES
(319, '如果您不知道产品的代码，请尝试在互联网上搜索以下内容«您的产品的HS代码是什么»，或者您可以通过访问完整的命名器手动进行排序', 'Si no sabes cuál es el código de tu producto, intenta buscando lo siguiente en internet «Cuál es el HS código para (tu producto)», o bien puedes buscarlo manualmente accediendo al Nomenclador completo.', 'If you do not know the HS code of your product, try searching for the following on the internet «What is the HS code for (your product)», or you can search it manually by accessing the complete Nomenclator.', '', 'الخاص بمنتجك ، فحاول البحث عن ما يلي على الإنترنت ´´ما هو رمز HS إذا كنت لا تعرف رمز  \r\nالخاص (بالمنتج الخاص بك)´´ ، أو يمكنك البحث عنه يدويًا عن طريق الوصول إلى HS  \r\n.الكامل Nomenclator', 'Caso não saiba o código do seu produto, tente buscar na internet «Qual é o código HS para (seu produto)», ou faça a busca manualmente acessando a nomenclatura completa.', 'Если вы не знаете таможенны код товара, попробуйте поискать следующее в интернете «ТН ВЭД код для (ваш товар)», или можете в ручную сделать поиск в нашем Полном Классификаторе.', 'あなたの商品に相当するコードが分からない場合は、インターネット「上で（あなたの製品）のHSコード」と検索するか、完全なHSコード表を入手して、その中で探して見て下さい。', 'Wenn Sie den HS-Code Ihres Produkts nicht kennen, suchen Sie im Internet nach «Was ist der HS-Code für (Ihr Produkt)», oder suchen Sie manuell auf der vollständigen HS-Nomenklatur.', 'Si vous ne savez quel est le code de votre produit, vous pouvez essayer de le chercher sur internet de la manière suivante : «Quel est le HS code pour (votre produit)», ou bien même le chercher manuellement en accédent à la Nomenclature complète.', '자신의 상품 HS코드를 모를 경우, «(상품명)에 대한 HS 코드»를 인터넷에 검색하시거나, Nomenclator를 통해 개별적으로 검색할수 있습니다.', 'Se non si conosce il codice HS del prodotto, prova a cercare quanto segue su Internet «Qual è il codice HS (il prodotto)» oppure è possibile ordinarlo manualmente accedendo al Nomenclator completo.'),
(320, '若查询无果请别担心，我们一发现有您感兴趣的新对象会及时通知您', 'Si no logras obtener resultados, no te preocupes, te estaremos avisando cuando detectemos nuevas contrapartes de tu interés.', 'If you do not get results, do not worry, we will be warning you when we detect new partners interested.', '', '.إذا لم تحصل على نتائج ، فلا داعي للقلق ، فسوف نعلمك عندما نكتشف شركاء جدد مهتمين', 'Caso não obtenha resultados, não se preocupe. Avisaremos quando encontrarmos novos parceiros que sejam do seu interesse.', 'Если у вас не удаётся получить результат на ваш поиск, не волнуйтесь, мы вам дадим знать, когда появятся новые объявления вашего интереса.', '結果が今のところ見つからなくても、心配しなくて下さい。あなたの興味対象と合致する相手が現れた時に、Sistemaからお知らせします。', 'Wenn Sie keine Ergebnisse erhalten, machen Sie sich keine Sorgen, wir werden Sie benachrichtigen, sobald wir neue und für Sie passende Kontakte entdecken.', 'Si vous n´arrivez pas à obtenir de résultats, ne vous inquiétez pas, nous vous tiendrons informé dès lors que nous détecterons des contreparties de votre intérêt.', '검색결과를 얻지못하셨다고, 걱정하지 마십시오. 당신 관심사에 맞는 새로운 상품이나 사용자를 발견하면 알려드리겠습니다.', 'Se non ottieni risultati, non ti preoccupare, ti avvertiremo quando rileviamo nuovi partner del tuo interesse.'),
(321, '您对Sistema的客户有什么话要说？', 'Qué deseas decirles a los usuarios de Sistema?', 'What do you want to message the users of Sistema?', '', '؟ Sistema ماذا تريد مراسلته إلى مستخدمي', 'O que você gostaria de dizer aos usuários do Sistema?', 'Что бы вы хотели сказать пользователям Sistema?', 'Sistemaユーザーに何を伝えたいですか？', 'Was möchten Sie den Nutzern von Sistema mitteilen?', 'Que désirez-vous dire aux utilisateurs de Sistema?', 'Sistema 사용자에게 하고 싶은 말은?', 'Cosa vuoi chiedere agli utenti di Sistema?'),
(322, '请上传能反映您商务背景的工作联系邮件，以提升您邮箱的质量。我们只向Sistema用户提供域名（@Sistema.com),您可放心。', 'Carga los correos electrónicos de contactos laborales que sirvan de referencias comerciales y mejoren la calidad tu cuenta. No te preocupes solo mostraremos el dominio de estos correos al resto de los usuarios de la Sistema (ej. @Sistema.com).', 'Upload the emails from work contacts that serve as commercial references and improve the quality of your account. Do not worry we will only show the domain of these e-mails to the rest of the Sistema users (ex @Sistema.com).', '', 'تحميل رسائل البريد الإلكتروني من جهات اتصال العمل التي تعمل كمراجع تجارية وتحسين جودة حسابك. لا تقلق فقط سوف نعرض مجال رسائل البريد الإلكتروني هذه إلا لبقية مستخدمي \r\n.(ex @ Sistema.com) Sistema', 'Faça o upload dos e-mails de contatos que servirão como referências comerciais e melhorarão a qualidade da sua conta. Não se preocupe, só mostraremos o domínio desses e-mails para os demais usuários Sistema (ex@Sistema.com).', 'Загрузите электронные адреса ваших деловых контактов для улучшение качества вашего аккаунта. Не волнуйтесь, мы их не покажим другим пользователям Sistema (например @Sistema.com).', '商用レファレンスになってくれる仕事上のコンタクト先を入力し、あなたのアカウントの信用を向上させましょう。他のSistemaユーザーからは、ドメイン名（例：@Sistema.com）しか見えませんので、安心して下さい。', 'Laden Sie die E-Mails von Kollegen hoch, die als geschäftliche Referenzen dienen, und verbessern Sie so die Qualität Ihres Kontos. Keine Sorge, wir werden den anderen Sistema-Nutzern nur die Domain dieser E-Mails zeigen (ex@Sistema.com).', 'Chargez les adresses e-mail de contacts professionnels servant de référence commerciale, afin d´améliorer la qualité de votre compte. Rassurez-vous, seuls les utilisateurs Sistema pourront voir le domaine de ces courriers électroniques.', '업무관련 지인들의 이메일을 추가해주세요. 상업보증 및 당신의 계정이 더 좋아집니다. 이메일주소의 도메인만 노출되니 걱정하지 마십시오. Sistema(예시@Sistema.com).', 'Carica le email dei contatti di lavoro che servono per riferimenti commerciali e migliora la qualità del tuo account. Non ti preoccupare faremmo vedere solo il dominio di questi mail al resto degli utenti Sistema (ad esempio @Sistema.com).'),
(323, '您从已建立联系的Sistema用户方面得到过什么回复吗？', 'Has obtenido algún tipo de respuesta por parte del/los usuario/s de Sistema contactado? ', 'Did you received some response by the user(s) of Sistema contacted?', '', '؟ Sistema هل تلقيت بعض الاستجابات من أحد المستخدمين المتصلين بك في', 'Você recebeu alguma resposta do(s) usuário(s) Sistema contatado(s)?', 'Вы получили ответ от пользователей Sistema с которыми вы связались?', 'コンタクトしたSistemaユーザーから、何らかの返事をもらいましたか？', 'Haben Sie irgendeine Antwort vom/von bereits kontaktierten Sistema-Nutzer(n) erhalten?', 'Avez-vous obtenu des réponses de la part de/des utlisateur/s Sistema que vous avez contacté?', 'Sistema 로 연결된 사용자 또는 담당자로부터 답변을 받으셨습니까?', 'Hai ricevuto risposta dagli utenti di Sistema contattati?'),
(324, '您认为已建立联系的Sistema用户对您的生意有用吗？', 'Considera de utilidad para su negocio el/los usuario/s de Sistema que has contactado? ', 'Consider useful for your business the user(s) of Sistema that you contacted?', '', '؟ Sistema هل تجد الفائدة في عملك للمستخدمين المتصلين بك في', 'Você considera útil para o seu negócio o(s) usuário(s) Sistema que você contatou?', 'Вам были полезны, для вашего вида деятельности те пользователи Sistema с которыми вы связались?', 'あなたがコンタクトしたSistemaユーザーは、ビジネスの役に立ちましたか？', 'Halten Sie den/die von Ihnen kontaktierten Sistema-Nutzer für Ihr Geschäft nützlich?', 'Considérez-vous que le/les utilisateur/s Sistema que vous avez contacté vous soient d´utilité pour votre affaire? ', '당신이 연락을 취한 Sistema 사용자(들)이 당신 비지니스에 도움이 되었습니까?', 'Consideri utili per la tua azienda gli utenti di Sistema che hai contattato?'),
(325, '您目前与您已建立联系的Sistema用户正在进行交易活动吗？', 'Se encuentra actualmente negociando alguna operación comercial con el/los usuario/s de Sistema que has contactado?', 'Are you currently negotiating a commercial transaction with the Sistema user(s) you have contacted? ', '', 'Sistema (هل تقوم حاليا بالتفاوض على معاملة تجارية مع مستخدم (مستخدمين\r\n الذين قمت بالاتصال بهم؟  ', 'Você está atualmente negociando uma transação comercial com o(s) usuário(s) Sistema que você contatou?', 'В данным момент, вы находитесь торговом процессе с пользователями Sistema с которыми связались?', 'あなたがコンタクトしたSistemaユーザーと、現在何らかの取引を交渉中ですか？', 'Führen Sie zurzeit eine Verhandlung mit dem/den Sistema-Nutzer(n), die Sie kontaktiert haben?', 'Êtes-vous actuellement en train de négocier une opération commerciale avec le/les utilisateur/s de Sistema que vous avez contacté/s ?', '현재 당신이 연락한 Sistema 사용자(들)과 상거래를 협상하고 있습니까?', 'Stai negoziando una transazione commerciale con gli utenti Sistema che hai contattato?'),
(326, '您目前与您已建立联系的Sistema用户正敲定哪项交易活动吗？', 'Se encuentra actualmente realizando alguna operación comercial en firme con el/los usuario/s de Sistema que has contactado? ', 'Are you currently doing any firm business operation with the Sistema user(s) you have contacted?', '', 'الذي Sistema (هل تقوم حاليًا بأي عملية تجارية ثابتة مع مستخدم (مستخدمي \r\nقمت بالاتصال به؟', 'Você está realizando efetivamente uma operação comercial com o(s) usuário(s) Sistema que você contatou?', 'В данным момент, вы закрываете сделку с пользователями Sistema с которыми связались?', 'あなたがコンタクトしたSistemaユーザーと、現在何らかの取引を成立させ、取引を実施中ですか？', 'Wickeln Sie Sie derzeit ein Geschäft mit dem/den von Ihnen kontaktierten Sistema-Nutzer(n) ab?', 'Êtes-vous actuellement en train de réaliser une opération commerciale avec le/les utilisateur/s de Sistema que vous avez contacté/s ?', '현재 당신이 연락한 Sistema 사용자(들)과 상거래를 하고 있습니까?', 'Stai attualmente svolgendo un´operazione di business con gli utenti Sistema che hai contattato? '),
(327, '您与您已建立联系的Sistema用户完成过什么交易活动吗？', 'Has realizando alguna operación comercial en firme con el/los usuario/s de Sistema que has contactado?', 'Have you made any firm commercial transactions with the Sistema user(s) that you have contacted? ', '', 'Sistema (هل قمت بإجراء أي معاملات تجارية ثابتة مع مستخدم (مستخدمين\r\nالذين قمت بالاتصال بهم؟', 'Você já realizou efetivamente alguma operação comercial com o(s) usuário(s) Sistema que você contatou?', 'Вам удалось закрыть деловую сделку с пользователями Sistema с которыми связались?', 'あなたがコンタクトしたSistemaユーザーと、過去に何らかの取引を成立させ、実施しましたか？', 'Haben Sie mit dem/den von Ihnen kontaktierten Sistema-Nutzer(n) einen Geschäftsabschluss getätigt?', 'Avez-vous réalisé et concrétisé une opération commerciale avec le/les utilisateur/s de Sistema que vous avez contacté/s ?', '당신이 연락한 Sistema 사용자(들)과 상거래를 완료하였습니까?', 'Hai effettuato qualche transazione commerciale forte con gli utenti Sistema che hai contattato?'),
(328, '汇总报告', 'Reportar', 'Report', '', 'أبلغ عن', 'Relatar', 'Пожаловаться', '報告する', 'Melden', 'Dénoncer', '신고하기', 'Riferire'),
(329, '汇总留言一览', 'Reportar mensaje', 'Report message', '', 'الإبلاغ عن رسالة', 'Relatar mensagem', 'Пожаловаться на сообщение', 'メッセージについて報告する', 'Nachricht melden', 'Dénoncer le message', '메시지 신고하기', 'Riferire messaggio'),
(330, '汇总评论一览', 'Reportar comentario', 'Report comment', '', 'الإبلاغ عن تعليق', 'Relatar comentário', 'Пожаловаться на комментарий', 'コメントについて報告する', 'Kommentar melden', 'Dénoncer le commentaire', '답변 신고하기', 'Riferire commento'),
(331, '非常感谢您的合作！', 'Muchas gracias por su colaboración!', 'Thank you very much for your help!', '', '!شكرا جزيلا لتعاونكم', 'Muito obrigado por sua colaboração!', 'Спасибо за ваше участие!', 'ご協力ありがとうございます。', 'Danke für Ihre Mitarbeit!', 'Merci pour votre collaboration!', '협조해주셔서 감사합니다. ', 'Grazie per la sua collaborazione!'),
(332, '任何', '无', 'Nothing', '', 'لا شيء', 'Nenhuma', 'любой', '該当なし', 'Keine', 'Aucune', '결과 없음', 'Nessuna'),
(333, '如您不能看到视频，请尝试以下链接：', 'Sino puede ver el video, intentá accediendo en el siguiente link: ', 'If you can not see the video, try accessing the following link:', '', ':إذا لم تتمكن من مشاهدة الفيديو ، حاول الوصول إلى الرابط التالي', 'Se você não conseguir ver o vídeo, tente clicando no seguinte link:', 'Если у вас не получилось увидеть видео, попробуйте через следующyю ссылку:', 'ビデオがご覧になれない場合、次のリンクをお試し下さい：', 'Falls Sie Probleme bei der Wiedergabe des Videos haben, klicken Sie auf den unten stehenden Link:', 'Si vous ne pouvez voir la vidéo, essayez en cliquant sur le lien suivant:', '비디오를 보기 위해서는 링크를 클릭해주시기 바랍니다. ', 'il video non si potesse vedere, cerca di accedere con il seguente collegamento:'),
(334, '（以.jpg, .gif的格式）', '(en formatos .jpg, .gif)', '(in .jpg, .gif formats)', '', '(in .jpg ، .gif formats)', '(em formatos .jpg, .gif)', '(в формате .jpg, .gif)', '（.jpgまたは.gifのファイル形式で）', '(in jpg, gif Formate)', '(en format .jpg, .gif)', 'jpg 또는 gif 파일 ', '(nei formati .jpg, .gif)'),
(335, '通知', 'Notificaciones', 'Notifications', '', 'الإشعارات', 'Notificações', 'Оповещения', '通知', 'Benachritigungen', 'Notifications ', '알림 ', 'Notifiche'),
(336, '新的通知', 'Nuevas notificaciones', 'New notifications', '', 'إشعارات جديدة', 'Novas notificações', 'Новые оповещения ', '新規通知', 'Neue Benachrichtigungen', 'Nouvelles notifications', '새로운 알림 ', 'Nuove notifiche'),
(337, '«商贸参考资料»表示公布发盘和询价信息的客户的电子邮箱帐号已经由客户所提供的第三方帐户所确认，您可以在@dominio中查到', 'Las « Referencias comerciales » indican que las cuentas de correo electrónico del usuario que ha publicado la oferta o la demanda han sido validadas por terceras cuentas de correo electrónico suministradas por el usuario, de la que tu puedes visualizar el @dominio', 'The « Commercial references » indicate that the email accounts of the user that has published the offer or demand have been validated by third email accounts supplied by the user, from which you can view the @domain', '', 'تشير ´´المراجع التجارية´´ إلى أن حسابات البريد الإلكتروني للمستخدم التي نشرت العرض أو الطلب تم التحقق من صحتها من خلال حسابات البريد الإلكتروني الثالثة التي يقدمها المستخدم، والتي يمكنك من خلالها عرض المجال @domain تسمح المراجع التجارية بالحصول على ضمانات نسبية لوجود المستخدم في', 'As « Referências comerciais » indicam que as contas de e-mail do usuário que publicou a oferta /demanda foram validadas por outras contas de e-mails providas pelo usuário, da qual você pode visualizar o @domínio', 'Все « Коммерческие подтверждение » указывают на то, что электронные адреса, пользователя который сделал объявление предложения или запроса, были подтверждены другими адресами обозначиными пользователем, которых вы можете видить @dominio', '「商用レファレンス」とは、オファー又はニーズを公開したユーザーのメールアドレスが、そのユーザーが依頼した第三者によって証明されていることを意味し、その第三者のメールアドレスのドメイン名（＠以下）が表示されます', 'Die « Geschäftsreferenzen » weisen darauf hin, dass die E-Mail-Konten von dem Nutzer, der das Angebot oder den Bedarf veröffentlicht hat, bereits von anderen E-Mail-Konten für gültig erklärt wurden, bei denen die @Domain angezeigt werden kann', 'Les « Références commerciales » vous indiquent que les comptes de l´adresse e-mail de l´utilisateur qui a publié l´offre ou la demande, ont été validés par d´autres comptes d´adresses e-mail fournis par cet utilisateur, desquels vous pouvez voir le @domaine', '«상업적 리퍼런스» 는 제 3자에 의해 현재 개시된 매매내용의 개시자의 e-mail 계정이 유효확인되었다는 것을 뜻하고, 당신은 그 사용자의 도메인을 확인할 수 있습니다', 'I « Riferimenti commerciali » indicano che i conti di posta elettronica dell´utente che hanno pubblicato l´offerta o la richiesta sono state convalidate per terze poste elettroniche fornite per lútente, delle quali puoi visualizzare il @domini'),
(338, '如果我在名册内找不到我的产品或服务该怎么办？\r\n一种常常有用却不一定精确的做法是上网查找您产品的协同编码系统编码，并分析网页所提供的信息。不管怎么说，只要您觉得依您个人的看法，其描述说明与您的产品接近，您就将您所找到的几个不同协同编码的前六位数字统统输入并加以上传就对了。', 'Qué pasa si no encuentro mi producto o servicio entre las descripciones del Nomenclador?\r\nUna opción muchas veces útil, aunque no tan precisa, es consultar en el buscador de internet cual es el Código del Sistema Armonizado para tu producto y analizar la información que otorga la web. En todo caso cargar utilizando los 6 primeros dígitos de los distintos Códigos de Sistema Armonizado encontrados cuyas descripciones por tu criterio personal consideras se ajustan más a tu producto (obviar esta opción en caso de servicios).', 'What happens if I do not find my product or service among the Nomenclator descriptions?\r\nAn option that is many times useful, but not so precise, is to consult the Internet browser which is the Harmonized System Code for your product and analyze the information provided by the website. In any case upload using the first 6 digits of the different Harmonized System Codes found whose descriptions by your personal criterion you consider are more fit to your product (avoid this option in case of services).', '', 'ماذا يحصل اذا لم أجد المنتج أو الخدمة الخاصة بي ضمن تسميات النظام\r\nالمنسق؟\r\nخيار مفيد ولكن ليس دقيقا جدا، هو استشارة \r\nمتصفح الإنترنت الذي هو رمز النظام المنسق للمنتج الخاص بك \r\nوتحليل المعلومات التي يقدمها الموقع. في أي حال تحميل باستخدام أول 6 \r\nأرقام من النظام المنسق المختلفة التي وجدت مواصفاتها موافقة لمعايير \r\n.(منتجك (تجنب هذا الخيار في حالة الخدمات', 'O que acontece se não encontrar meu produto ou serviço entre as descrições do Nomenclador?\r\nUma opção que muitas vezes é útil, embora não tão precisa, é procurar num serviço de busca o Código do Sistema Harmonizado do seu produto e analisar a informação encontrada na web. Em todo caso, utilize os 6 (seis) primeiros dígitos dos diferentes Códigos do Sistema Harmonizado cujas descrições, na sua opinião, forem as mais adequadas para descrever seu produto (marcar esta opção em caso de serviços).', 'Что делать, если я не могу найду свой продукт или услугу среди описаний номенклатора?\r\nВариант, который часто бывает полезным, хотя и не столь точным, - запросите систему поиска в Интернете для Гармонизированного системного кода для вашего продукта и проанализировать информацию, предоставленную веб-сайтом. Всегда использовыйте первые 6 цифры различных Согласованных системных кодов, описание которых по вашему личному критерию, вы считаете, более чётко подходит к вашему продукту (исключить этот вариант в случае предоставления услуг).', 'コード表の記述の中に、私の製品やサービスに相当するものがない場合はどうしたらいいでしょうか？\r\n正確性に欠けることもあるものの、多くの場合に役立つ手段です。インターネットの検索エンジンで、あなたの製品に対するHSコードが何であるかを探し、検索結果を調べてみて下さい。そして、Webで見つかったHSコードの中で、あなたが最も自分の製品にふさわしいと考える記述を持ったHSコードの、始めの6桁を入力して下さい（この方法は、サービスの場合には該当しません）。', 'Was passiert, wenn ich mein Produkt oder Dienstleistung nicht unter den Beschreibungen des Nomenklators finde?\r\nEine andere gute Option ist –wenn auch manchmal nicht so genau – sich mit Hilfe einer Internet-Suchmaschine nach dem genauen HS-Code gemäß des Harmonischen Systems zu informieren (ignorieren Sie diese Option im Falle von Dienstleistungen).', 'Que se passe-t-il si je ne trouve pas mon produit ou mon service parmi les descriptions de la Nomenclature?\r\nUne option souvent utile, bien que moins précise, est de consulter dans le chercheur d´Internet quel est le Code du Système Harmonisé pour votre produit et d´analyser l´information donnée par le Web. Dans tous les cas, afin de les télécharger, utilisez les 6 premiers chiffres des différents Codes du Système Harmonisé trouvés, dont les descriptions correspondent le mieux à votre produit, selon vos critères personnels (Omettre cette option s´il s´agit de services).', '내 상품 또는 서비스를 용어집 목록에서 찾을 수 없으면 어쩌죠?\r\n항상 정확하지는 않지만 인터넷을 통해 찾는 방법도 있습니다. 검색 엔진을 통해서 상품에 맞는 HS 코드가 무엇인지 확인하시고, 정보가 맞는지 확인해보세요. HS 코드의 첫 6 자리 숫자를 이용하면, 당신상품에 가장 적합하다고 판단되는 설명을 찾을 수 있습니다. (서비스의 경우에는 이 방법을 지양하시기 바랍니다.)', 'Cosa succede se non trovo il mio prodotto o servizio tra le descrizzioni del nomenclatore?\r\nUna scelta molte volte ultile, ma non cosí precisa, é domandare su internet il Codice di Sistema Armonizzato per il tuo prodotto e analizzare l´informazione che concede la web. In ogni caso, caricare utilizzando i primi 6 digiti dei diversi Codici di Sistema Armonizzato trovati, le quali descrizzioni, secondo il tuo giudizio, consideri si adecuano al tuo prodotto (ovviare questa scelta nel caso dei servizi).'),
