(418, '我们无法知道你的位置，改变你的手机的配置，使用Nocprice。', 'No podemos saber tu ubicación, cambie las configuraciones de su teléfono para usar Nocprice', 'We can´t know your location, change the configurations of your mobile to use Nocprice.', '', 'لا يمكننا أن نعرف موقعك، تغيير تكوينات من هاتفك النقال لاستخدام Nocprice.', 'Não podemos saber a sua localização, alterar as configurações de seu celular para usar Nocprice.', 'Мы не можем знать свое местоположение, изменить конфигурацию вашего мобильного телефона использовать Nocprice.', '私たちは、あなたの場所を知っているNocpriceを使用するために、あなたの携帯電話の設定を変更することはできません。', 'Wir können wissen, dass Ihr Standort nicht, ändern Sie die Konfigurationen Ihres Mobil Nocprice zu verwenden.', 'Nous ne pouvons pas connaître votre position, de modifier la configuration de votre téléphone portable pour utiliser Nocprice.', '우리는 당신의 위치를 ​​알고 Nocprice를 사용하는 모바일의 구성을 변경할 수 없습니다.', 'Non possiamo conoscere la vostra posizione, modificare le configurazioni del tuo cellulare per utilizzare Nocprice.'),
