(420, '店里面，扫描所需的产品的条形码。', 'Dentro del comercio escanea el código de barras del producto deseado.', 'Inside the shop, scan the barcode of the desired product.', '', 'داخل المحل، مسح الباركود من المنتج المطلوب.', 'Dentro da loja, escanear o código de barras do produto desejado.', 'Внутри магазина, сканировать штрих-код нужного продукта.', 'お店の中に、所望の生成物のバーコードをスキャンします。', 'Innerhalb des Geschäftes, scannen den Barcode des gewünschten Produkts.', 'A l´intérieur du magasin, scanner le code barre du produit désiré.', '가게 내부, 원하는 제품의 바코드를 스캔합니다.', 'All´interno del negozio, eseguire la scansione del codice a barre del prodotto desiderato.'),
(421, '再充的话显示价格，并分享与用户的其他信息。', 'Luego carga el precio exhibido, y compartí la información con el resto de los usuarios.', 'Then charge the displayed price, and share the information with the rest of the users.', '', 'ثم توجيه الاتهام الى السعر المعروض، وتبادل المعلومات مع بقية المستخدمين.', 'Em seguida, cobrar o preço apresentado, e compartilhar a informação com o resto dos usuários.', 'Затем зарядите отображаемую цену, а также обмениваться информацией с остальными пользователями.', 'そして、表示された価格を請求し、残りのユーザーと情報を共有します。', 'Dann laden Sie den angezeigten Preis und teilen sich die Informationen mit dem Rest der Nutzer.', 'Ensuite, chargez le prix affiché, et partager les informations avec le reste des utilisateurs.', '그런 다음 표시 가격을 책정하고, 나머지 사용자와 정보를 공유 할 수 있습니다.', 'Poi caricare il prezzo indicato, e condividere le informazioni con il resto degli utenti.'),
(422, '知道有多少相同的产品成本在你的周围，', 'Así conoce cuánto vale el mismo producto a tus alrededores,', 'Know how much the same product cost in your surroundings,', '', 'تعرف كم نفس تكلفة المنتج في محيطك،', 'Saber quanto o mesmo custo do produto em seu entorno,', 'Знать, сколько же стоимость продукта в вашем окружении,', 'お使いの環境の中でどのくらいの同じ製品コストを知っています、', 'Wissen, wie viel die gleichen Produktkosten in Ihrer Umgebung,', 'Savoir combien le même coût des produits dans votre environnement,', '얼마나 동일한 제품 비용을 주변에서 알고,', 'Sapere quanto lo stesso costo del prodotto nel vostro ambiente,'),
(423, '时报了！去商店并再次扫描代码来比较价格。比较选项可用于24hs扫描后制成。', '¡Se acabo el tiempo! Ve a la tienda y escanea el código de barra nuevamente para comparar precios. La opción de comparar está disponible durante 24hs de efectuado el escaneo.', 'Times up!, go to the store and scan the code again to compare prices. Compare option is available for 24hs after scan is made.', '', 'مرات حتى !، الذهاب الى المتجر ومسح الرمز مرة أخرى لمقارنة الأسعار. مقارنة خيار متاح لل24hs بعد إجراء المسح الضوئي.', 'Vezes Up !, ir até a loja e digitalizar o código novamente para comparar preços. Compare opção está disponível para 24hs após a digitalização é feita.', 'Времена вверх !, идут в магазин и сканировать код еще раз, чтобы сравнить цены. Сравнить опция доступна для 24hs после сканирования производится.', '！、アップ・タイムズは、店に行くと価格を比較するために、再度コードをスキャンします。オプションの比較スキャンが行われた後24hsのために利用可能です。', 'Zeiten up !, in den Laden zu gehen und den Code scannen wieder Preise zu vergleichen. Vergleichen Option für 24 Uhr verfügbar ist, nachdem Scan durchgeführt wird.', 'Times Up !, aller au magasin et de scanner le code à nouveau pour comparer les prix. Comparer option est disponible pour 24hs après la numérisation est faite.', '최대 시간은 가게에 가서 가격을 비교하기 위해 다시 코드를 스캔!. 스캔이 이루어진 후 옵션 24hs 사용할 수 있습니다 비교.', 'Volte Up !, andare al negozio e scansione di nuovo il codice per confrontare i prezzi. Confronta opzione è disponibile per 24hs dopo la scansione è fatto.'),
