(453, '我们只用摄像头扫描产品的条形码。', 'Solo usamos la cámara para escanear el código de barras de los productos.', 'We only use the camera to scan the barcode of the products.', '', 'نحن فقط استخدام الكاميرا لمسح الباركود من المنتجات.', 'Nós só usamos a câmera para escanear o código de barras dos produtos.', 'Мы используем только камеру для сканирования штрих-кодов продуктов.', '私たちは、製品のバーコードをスキャンするためにカメラを使用しています。', 'Wir verwenden nur die Kamera den Barcode der Produkte zu scannen.', 'Nous utilisons uniquement l´appareil photo pour scanner le code-barres des produits.', '우리는 제품의 바코드를 스캔 카메라를 사용합니다.', 'Usiamo solo la telecamera per eseguire la scansione del codice a barre dei prodotti.'),
(454, '我们只使用您的位置知道在哪个交易的产品进行扫描。', 'Solo usamos tu ubicación para saber en que comercio se escanean los productos.', 'We only use your location to know in which trade the products are scanned.', '', 'نحن فقط استخدام موقعك لتعرف في أي تداول يتم فحص المنتجات.', 'Nós só usar a sua localização para saber em que o comércio dos produtos são verificados.', 'Мы используем только ваше местоположение, чтобы знать, в какой торговле продуктами сканируются.', '私たちはここで製品がスキャンされ、貿易を知っているあなたの場所を使用します。', 'Wir verwenden Ihre Lage zu wissen, in welchem ​​Handel der Produkte gescannt werden.', 'Nous utilisons votre emplacement pour savoir dans quel commerce les produits sont analysés.', '우리는있는 제품은 스캔 무역 알고 위치를 사용합니다.', 'Useremo il tuo luogo di sapere in quale commercio i prodotti vengono sottoposti a scansione.'),
