(459, '你把X，支付ÿ', 'Llevas X pagas Y', 'Take X pagás Y', '', 'كنت تأخذ X، Y دفع', 'Você toma X, Y pagar', 'Вы берете X, Y платить', 'あなたは、Xを取るYを支払います', 'Sie nehmen X, Y zahlen', 'Vous prenez X, Y payer', '당신은 Y를 지불, X을', 'Si prende X, Y pagare'),
(460, '有多少单位你有', 'Cuantas unidades llevas', 'How many units do you take?', '', 'عدد الوحدات التي لديك', 'Quantas unidades você tem', 'Сколько единиц у вас есть', 'あなたはどのように多くのユニット持っています', 'Wie viele Einheiten haben Sie', 'Combien d´unités avez-vous', '얼마나 많은 단위를 당신이 할', 'Quante unità avete'),
(461, '有多少单位，你付？', 'Cuantas unidades pagas', 'How many units do you pay?', '', 'عدد الوحدات لم تدفعه؟', 'Quantas unidades você paga?', 'Сколько единиц вы платите?', 'あなたはどのように多くのユニットを支払うのですか？', 'Wie viele Einheiten zahlen Sie?', 'Combien d´unités payez-vous?', '당신은 얼마나 많은 단위를 지불합니까?', 'Quante unità si fa a pagare?'),
(462, '和在哪里买。提高你的购买秒。', 'y donde comprarlo. Mejora tu compra segundos.', 'and where to buy it. Improve your purchase in seconds.', '', 'وحيث لشرائه. تحسين شراء الخاصة بك في ثوان.', 'e onde comprá-lo. Melhorar a sua compra em segundos.', 'и где его купить. Улучшить вашу покупку в считанные секунды.', 'どこでそれを購入します。秒でのご購入を向上させます。', 'und wo es zu kaufen. Verbessern Sie Ihren Kauf in Sekunden.', 'et où l´acheter. Améliorez votre achat en quelques secondes.', '어디를 구입합니다. 초 구매를 향상시킬 수 있습니다.', 'e dove comprarlo. Migliora il tuo acquisto in pochi secondi.');
INSERT INTO `palabras` (`pal_id`, `pal_desc_zh`, `pal_desc_es`, `pal_desc_en`, `pal_desc_hi`, `pal_desc_ar`, `pal_desc_pt`, `pal_desc_ru`, `pal_desc_ja`, `pal_desc_de`, `pal_desc_fr`, `pal_desc_ko`, `pal_desc_it`) VALUES
(490, '搜索半径', 'Radio de busqueda', 'Search radius', '', 'نطاق البحث', 'pesquisa raio', 'радиус поиска', '検索半径', 'Suchradius', 'Rayon de recherche', '검색 반경', 'raggio di ricerca'),
(491, '为世界各地的人们提供了强大的工具，简化的价格比较，并增加他们的购买力。', 'Brindar a las personas de todo el mundo una herramienta poderosa que simplifique la comparación de precios y aumente su capacidad de compra.', 'Provide people around the world with a powerful tool that simplifies price comparison and increases their purchasing power.', '', 'توفر للناس في جميع أنحاء العالم مع أداة قوية التي تبسط مقارنة الأسعار ويزيد من قدرتهم الشرائية.', 'Proporcionar às pessoas ao redor do mundo com uma ferramenta poderosa que simplifica a comparação de preços e aumenta seu poder de compra.', 'Обеспечить человек по всему миру мощного инструмента, который упрощает сравнение цен и повышает их покупательную способность.', '価格比較を簡素化し、彼らの購買力を高める強力なツールで、世界中の人々を提供します。', 'Geben Sie Menschen auf der ganzen Welt mit einem leistungsstarken Werkzeug, das Preisvergleich vereinfacht und erhöht ihre Kaufkraft.', 'Fournir aux gens à travers le monde avec un outil puissant qui simplifie la comparaison des prix et augmente leur pouvoir d´achat.', '가격 비교를 단순화하고 구매력을 증가시키는 강력한 도구를 사용하여 전 세계 사람들을 제공합니다.', 'Fornire persone in tutto il mondo con un potente strumento che semplifica il confronto dei prezzi e aumenta il loro potere d´acquisto.'),
(492, '应用程序可用于Android或iOS手机。', 'App disponible para teléfonos con Andriod o iOS.', 'App available for phones with Andriod or iOS.', '', 'التطبيق متوفر للهواتف مع ANDRIOD أو دائرة الرقابة الداخلية.', 'App disponível para telefones com Andriod ou iOS.', 'App доступно для телефонов с Andriod или прошивкой.', 'AndriodまたはiOSとの電話で利用可能なアプリケーション。', 'App für Handys mit Andriod oder iOS.', 'App disponible pour les téléphones avec Andriod ou iOS.', '에서 Andriod 또는 iOS와 전화에 사용할 응용 프로그램.', 'App disponibile per i telefoni con Andriod o iOS.'),
(493, '其中，出口商和进口商所在的地方。', 'El lugar donde se encuentran los exportadores e importadores.', 'The place where exporters and importers are located.', '', 'في المكان الذي توجد المصدرين والمستوردين.', 'O lugar onde os exportadores e os importadores estão localizados.', 'Место, где экспортеры и импортеры расположены.', '輸出と輸入が置かれている場所。', 'Der Ort, an dem Exporteuren und Importeuren befinden.', 'L´endroit où sont situés les exportateurs et les importateurs.', '수출과 수입이있는 장소.', 'Il luogo in cui si trovano esportatori e importatori.'),
(494, '不要你的钱吗？', '¿No te alcanza el dinero?', 'Do not you get the money?', '', 'لا يمكنك الحصول على المال؟', 'Você não conseguir o dinheiro?', 'Вы не получите деньги?', 'あなたはお金を得ることはありませんか？', 'Sie nicht das Geld bekommen?', 'Ne vous obtenez l´argent?', '당신은 돈을받을 수 없습니까?', 'Non si ottiene il denaro?'),
(495, '你花了很多？', '¿Estás gastando mucho?', 'Are you spending a lot?', '', 'هل تنفق الكثير؟', 'Você está gastando muito?', 'Вы тратите много?', 'あなたは多くを費やしていますか？', 'Verbringen Sie viel?', 'Consacrez-vous beaucoup?', '당신은 많은 지출을하고 있습니까?', 'È necessario impiegare un sacco?'),
(496, '你需要钱？', '¿Necesitas dinero?', 'You need money?', '', 'تحتاج للمال؟', 'Você precisa de dinheiro?', 'Тебе нужны деньги?', 'お金がありますか？', 'Sie brauchen Geld?', 'Tu as besoin d´argent?', '너는 돈이 필요해?', 'Hai bisogno di soldi?'),
(497, '你买呢？', '¿Estás comprando bien?', 'Are you buying well?', '', 'هل شراء جيدا؟', 'Você está comprando bem?', 'Покупаете ли Вы хорошо?', 'あなたはよく買っていますか？', 'Kaufst du gut geschlafen?', 'Achetez-vous bien?', '당신은 잘 사는거야?', 'Stai acquistando bene?'),
(498, '你想少花钱？', '¿Querés gastar menos?', 'Do you want to spend less?', '', 'هل تريد أن تنفق أقل؟', 'Você quer gastar menos?', 'Хотите тратить меньше?', 'あなたはあまりを過ごしたいですか？', 'Wollen Sie weniger Geld ausgeben?', 'Voulez-vous dépenser moins?', '당신은 더 적은 지출 하시겠습니까?', 'Vuoi spendere meno?'),
(499, '扫描你的产品的条形码，并知道在哪里买它在最好的价格。', 'Scaneá los códigos de barra de tus productos y sabe dónde comprarlo al mejor precio.', 'Scan the barcodes of your products and know where to buy it at the best price.', '', 'مسح الباركود من المنتجات الخاصة بك وأعرف من أين لشرائه بأفضل الأسعار.', 'Digitalize o código de barras de seus produtos e saber onde comprá-lo com o melhor preço.', 'Сканирование штрих-коды ваших продуктов и знать, где купить по лучшей цене.', 'お使いの製品のバーコードをスキャンし、どこで最高の価格でそれを購入する知っています。', 'Scannen Sie die Barcodes Ihrer Produkte und wissen, wo es zu kaufen zum besten Preis.', 'Numérisez les codes à barres de vos produits et savoir où acheter au meilleur prix.', '제품의 바코드를 스캔 곳의 저렴한 가격에 구입하는 것을 알고있다.', 'Scansione i codici a barre dei vostri prodotti e sapere dove comprarlo al miglior prezzo.'),
(500, '现在你可以照顾你的口袋里，扫描和知道哪里最便宜的价格。', 'Ahora sí podes cuidar tu bolsillo, scaneá y conoce dónde se están los mejores precios.', 'Now you can take care of your pocket, scan and know where the best prices are.', '', 'الآن يمكنك أن تأخذ الرعاية من جيبه الخاص، والمسح الضوئي ونعرف أين هي أفضل الأسعار.', 'Agora você pode cuidar do seu bolso, digitalização e saber onde estão os melhores preços são.', 'Теперь вы можете заботиться о своем кармане, сканировать и знать, где лучшие цены.', '今、あなたは、あなたのポケットの世話をスキャンして、最高の価格がどこにあるかを知ることができます。', 'Jetzt können Sie die Pflege Ihrer Tasche nehmen, scannen und wissen, wo die besten Preise.', 'Maintenant, vous pouvez prendre soin de votre poche, scanner et savoir où les meilleurs prix sont.', '지금 당신은, 당신의 주머니 알아서 스캔하고 최적의 가격은 위치를 알 수 있습니다.', 'Ora si può prendere cura della vostra tasca, scansione e sapere dove i migliori prezzi sono.'),
(501, '改善您的购物方式知道在哪里可以找到最低的价格在你身边。', 'Mejorá tu forma de comprar sabiendo dónde encontrar el precio más bajo cerca tuyo.', 'Improve your way of shopping knowing where to find the lowest price near you.', '', 'تحسين طريقتك في التسوق معرفة مكان العثور على أدنى سعر بالقرب منك.', 'Melhorar a sua forma de fazer compras saber onde encontrar o menor preço perto de você.', 'Улучшить свой путь покупок, зная, где найти самые низкие цены рядом с вами.', 'お近くの最低価格を見つけるために知っショッピングのあなたの方法を改善します。', 'Verbessern Sie Ihre Art und Weise zu wissen, Einkaufsmöglichkeiten, wo Sie Preise und Verfügbarkeit in Ihrer Nähe zu finden.', 'Améliorez votre façon de shopping en sachant où trouver le prix le plus bas près de chez vous.', '가까운 최저 가격을 찾을 수 알고 쇼핑의 길을 향상시킬 수 있습니다.', 'Migliora il tuo modo di fare shopping sapere dove trovare il prezzo più basso più vicino a te.'),
(502, '停止价格上涨，扫描你的产品和知道去哪里买。', 'Detene la inflación en los precios, scaneá tus productos y sabe dónde deber comprarlos.', 'Stop price inflation, scan your products and know where to buy them.', '', 'وقف تضخم أسعار، تفحص المنتجات الخاصة بك وأعرف من أين لشرائها.', 'Pare a inflação de preços, digitalizar seus produtos e saber onde comprá-los.', 'Остановить рост цен, сканировать продукты и знать, где их купить.', '、物価上昇を停止し、あなたの製品をスキャンし、それらを購入する場所を知っています。', 'Stoppen Sie die Preisinflation, scannen Sie Ihre Produkte und wissen, wo sie zu kaufen.', 'Arrêtez l´inflation des prix, analyser vos produits et savoir où les acheter.', ', 물가를 중지 제품을 검사하고 그들을 살 곳을 알고있다.', 'Smettere di inflazione dei prezzi, eseguire la scansione dei prodotti e sapere dove acquistarli.'),
(503, '下载', 'Descargar', 'Download', '', 'تحميل', 'baixar', 'Скачать', 'ダウンロード', 'Herunterladen', 'Télécharger', '다운로드', 'Scaricare'),
(504, '工具', 'Herramientas', 'Tools', '', 'أدوات', 'Ferramentas', 'инструменты', 'ツール', 'Werkzeuge', 'Outils', '도구', 'Utensili'),
(505, 'Sistema广告', 'Sistema Ads', 'Sistema Ads', '', 'إعلانات Sistema', 'Anúncios Sistema', 'Sistema Объявления', 'Sistema広告', 'Sistema Anzeigen', 'Sistema annonces', 'Sistema 광고', 'Sistema annunci'),
(506, '我们的平台上的广告提高您公司在国际市场上曝光，定位在这些国家潜在的利益合格的企业合作伙伴和部门为您的企业的发展。', 'Publicitar en nuestra plataforma mejora la exposición de tu empresa en el mercado internacional, localizando potenciales socios comerciales calificados en aquellos países y sectores de interés para el crecimiento de tu negocio.', 'Advertising on our platform improves your company´s exposure in the international market, locating potential qualified business partners in those countries and sectors of interest for the growth of your business.', '', 'الإعلان على منصتنا يحسن التعرض شركتك في السوق الدولية، وتحديد الشركاء المحتملين المؤهلين الأعمال في تلك البلدان والقطاعات ذات الأهمية لنمو الأعمال التجارية الخاصة بك.', 'Publicidade na nossa plataforma melhora a exposição da sua empresa no mercado internacional, localizar potenciais parceiros de negócio qualificados nesses países e sectores de interesse para o crescimento do seu negócio.', 'Реклама на нашей платформе улучшает экспозицию Вашей компании на международном рынке, поиске потенциальных квалифицированных деловых партнеров в тех странах и секторах, представляющих интерес для роста вашего бизнеса.', '当社のプラットフォーム上の広告はあなたのビジネスの成長のために関心のある国やセクターの潜在的有資格ビジネスパートナーを見つけ、国際市場であなたの会社の露出を向上させます。', 'Werbung auf unserer Plattform verbessert die Gesellschaft ausgesetzt ist auf dem internationalen Markt, potenzielle qualifizierte Geschäftspartner in diesen Ländern und Sektoren von Interesse für das Wachstum Ihres Unternehmens zu lokalisieren.', 'Publicité sur notre plate-forme améliore l´exposition de votre entreprise sur le marché international, la recherche de partenaires commerciaux potentiels qualifiés dans les pays et secteurs d´intérêt pour la croissance de votre entreprise.', '우리의 플랫폼에 광고가 귀하의 비즈니스의 성장에 대한 관심의 잠재적 인 자격을 갖춘 비즈니스 이들 국가의 파트너 섹터의 위치, 국제 시장에서 회사의 노출을 향상시킨다.', 'Pubblicità sulla nostra piattaforma migliora l´esposizione della vostra azienda nel mercato internazionale, individuando potenziali partner commerciali qualificati in quei paesi e settori di interesse per la crescita del vostro business.'),
(507, 'Sistema广告形式的广告告示Sistema环境下，从服务领域的用户的任何一部分企业可以管理自己的广告，并引导他们到平台内的目标受众的特定领域内的工作，制度。', 'Sistema Ads conforma el sistema de avisos publicitarios que funcionan dentro del entorno de Sistema, donde las empresas de cualquier parte del mundo usuarias del servicio puede gestionar sus anuncios y dirigirlos a segmentos especificos de su público objetivo dentro de la plataforma.', 'Sistema Ads forms the system of advertising notices that work within the Sistema environment, where companies from any part of the world users of the service can manage their ads and direct them to specific segments of their target audience within the platform.', '', 'Sistema إعلانات يشكل نظام إشعارات الإعلان التي تعمل ضمن بيئة Sistema، حيث يمكن للشركات من أي جزء من المستخدمين العالم لخدمة إدارة إعلاناتهم وتوجيهها لشرائح محددة من الجمهور المستهدف داخل المنصة.', 'Anúncios Sistema forma o sistema de avisos publicitários que trabalham dentro do ambiente Sistema, onde as empresas de qualquer parte dos usuários mundiais de serviço podem gerenciar seus anúncios e encaminhá-los para segmentos específicos de seu público-alvo dentro da plataforma.', 'Sistema Объявление формирует систему рекламных уведомлений, которые работают в среде Sistema, где компании из любой части мира пользователей сервиса может управлять их объявлениями и направлять их к конкретным сегментам своей целевой аудитории в рамках платформы.', 'Sistema広告は、サービスの世界のユーザーの任意の部分から企業が広告を管理し、プラットフォーム内で彼らのターゲットオーディエンスの特定のセグメントにそれらを指示することができSistema環境内で動作する広告通知のシステムを形成しています。', 'Sistema Anzeigen bilden das System der Werbung bemerkt, dass innerhalb der Sistema Umgebung arbeiten, in denen Unternehmen aus allen Teilen der Welt Nutzer des Dienstes ihre Anzeigen verwalten und sie auf bestimmte Segmente ihrer Zielgruppe innerhalb der Plattform leiten.', 'Sistema annonces forme le système d´avis de publicité qui travaillent dans l´environnement Sistema, où les entreprises de toute partie des utilisateurs du monde du service peuvent gérer leurs annonces et les diriger vers des segments spécifiques de leur public cible au sein de la plate-forme.', 'Sistema 광고 서비스의 세계 사용자의 어떤 부분에서 기업들이 광고를 관리하고, 플랫폼 내에서 타겟 고객의 특정 세그먼트에 직접 할 수있는 Sistema 환경 내에서 작동 광고 통지 시스템을 형성한다.', 'Sistema annunci costituisce il sistema di avvisi pubblicitari che lavorano all´interno dell´ambiente Sistema, dove le aziende provenienti da ogni parte del mondo gli utenti del servizio possono gestire i propri annunci e indirizzarli a specifici segmenti del loro target di riferimento all´interno della piattaforma.'),
(508, 'Sistema目标广告', 'Sistema Target Ads', 'Sistema Target Ads', '', 'Sistema الإعلانات المستهدفة', 'Segmente anúncios Sistema', 'Sistema Целевые объявления', 'Sistemaターゲット広告', 'Sistema Zielanzeigen', 'Sistema annonces cible', 'Sistema 대상 광고', 'Sistema annunci target'),
(509, '广告针对与特定的HS编码的用户。', 'Anuncios dirigidos a usuarios con código HS específico.', 'Ads aimed at users with specific HS code.', '', 'الإعلانات التي تستهدف المستخدمين مع رمز HS معين.', 'Anúncios destinados a usuários com código HS específico.', 'Объявления, направленные на пользователей с определенным кодом ГС.', '特定のHSコードを持つユーザーに向けた広告。', 'Anzeigen richtet sich an Anwender mit spezifischen HS-Code.', 'Annonces destinées aux utilisateurs avec le code spécifique de HS.', '특정 HS 코드와 사용자를 대상으로 광고.', 'Annunci volti a utenti con NCP specifica.'),
