(519, '有一个更好的价格。', 'Hay un precio mejor', 'There is a better price.', '', 'هناك على سعر أفضل.', 'Há um preço melhor.', 'Существует более высокая цена.', 'より良い価格があります。', 'Es gibt einen besseren Preis.', 'Il y a un meilleur prix.', '더 나은 가격이 있습니다.', 'C´è un prezzo migliore.'),
(520, '性价比最好的是靠近你，知道在哪里可以找到它。', 'El mejor precio esta cerca tuyo, conoce donde encontrarlo.', 'The best price is near you, know where to find it.', '', 'أفضل الثمن هو بالقرب منك، ونعرف أين يمكن العثور عليه.', 'O melhor preço está perto de você, sabe onde encontrá-lo.', 'Лучшая цена рядом с вами, знаю, где найти его.', '最高価格はあなたの近くにある、それを見つけるために場所を知ります。', 'Der beste Preis ist in der Nähe von Ihnen wissen, wo sie zu finden.', 'Le meilleur prix est près de chez vous, savoir où trouver.', '가장 좋은 가격은 당신 가까이에, 그것을 어디서 찾을 수 있는지 알고있다.', 'Il miglior prezzo è vicino a te, sai dove trovarlo.'),
(521, '教程', 'Tutorial', 'Tutorial', '', 'الدورة التعليمية', 'Tutorial', 'Руководство', 'チュートリアル', 'Lernprogramm', 'Didacticiel', '지도 시간', 'lezione'),
(522, '扫描，比较，并购买了最好的价格。', 'Escaneá, compará, y compra al mejor precio.', 'Scan, compare, and buy at the best price.', '', 'مسح ومقارنة، وشراء على سعر أفضل.', 'Digitalizar, comparar e comprar ao melhor preço.', 'Сканирование, сравнить и купить по лучшей цене.', 'スキャン、比較、そして最高の価格で購入。', 'Scannen, vergleichen und kaufen zum besten Preis.', 'Scan, comparer et acheter au meilleur prix.', '스캔, 비교하고, 최고의 가격에 구입.', 'Scansione, confrontare e acquistare al miglior prezzo.'),
(523, '观察产品的价格在所有门店在全国迅速和容易。', 'Observá los precios de productos en todos los comercios del país en forma rápida y sencilla.', 'Observe the prices of products in all stores in the country quickly and easily.', '', 'مراقبة أسعار المنتجات في جميع محلات في البلاد بسرعة وسهولة.', 'Observe os preços dos produtos em todas as lojas no país de forma rápida e facilmente.', 'Обратите внимание на цены на продукты во всех магазинах в стране быстро и легко.', '迅速かつ容易に国内のすべての店舗で商品の価格を確認します。', 'Beachten Sie die Preise der Produkte in allen Filialen in dem Land schnell und einfach.', 'Observez les prix des produits dans tous les magasins dans le pays rapidement et facilement.', '쉽고 빠르게 전국의 모든 매장에서 제품의 가격을 관찰한다.', 'Osservare i prezzi dei prodotti in tutti i negozi del paese rapidamente e facilmente.'),
(524, '随着4个简单的步骤，你知道哪个行业具有最佳的性价比。', 'Con 4 simples pasos conoce que comercio tiene el mejor precio.', 'With 4 simple steps, you know which trade has the best price.', '', 'مع 4 خطوات بسيطة، كما تعلمون التجارية التي لديها أفضل سعر.', 'Com 4 passos simples, você sabe que o comércio tem o melhor preço.', 'С 4 простых шага, вы знаете, какая сделка имеет лучшую цену.', '4つの簡単な手順で、あなたは最高の価格を持っている貿易知っています。', 'Mit 4 einfachen Schritten, wissen Sie, welche den Handel den besten Preis hat.', 'Avec 4 étapes simples, vous savez que le commerce a le meilleur prix.', '4 간단한 단계로, 당신은 무역 최고의 가격을 가지고있는 것을 알고있다.', 'Con 4 semplici passaggi, si sa che il commercio ha il miglior prezzo.'),
(525, '与我们分享您在我们的网络体验。', 'Compartí tu experiencia en nuestras redes. ', 'Share your experience in our networks.', '', 'تجربتكم في شبكاتنا.', 'Partilhe a sua experiência em nossas redes.', 'Поделитесь своим опытом в наших сетях.', '私たちのネットワークであなたの経験を共有しています。', 'Teilen Sie Ihre Erfahrungen in unseren Netzwerken.', 'Partagez votre expérience dans nos réseaux.', '우리의 네트워크에서 당신의 경험을 공유 할 수 있습니다.', 'Condividi la tua esperienza nelle nostre reti.'),
(526, '下载在苹果商店或谷歌Play的应用程式。', 'Descargate la aplicación en Apple Store o Google play.', 'Download the application in Apple Store or Google play.', '', 'تحميل تطبيق في متجر أبل أو جوجل اللعب.', 'Faça o download do aplicativo na Apple Store ou Google Play.', 'Загрузите приложение в Apple Store или Google Play.', 'アップルストアやGoogleのプレイでアプリケーションをダウンロードしてください。', 'Laden Sie die Anwendung in Apple Store oder Google Play.', 'Télécharger l´application Apple Store ou Google Play.', '애플 스토어 또는 구글 플레이에서 응용 프로그램을 다운로드합니다.', 'Scarica l´applicazione in Apple Store o Google Play.'),
(527, '在店内，扫描所需的产品的条形码。', 'Dentro del comercio escanea el código de barras del producto deseado.', 'Inside the store, scan the barcode of the desired product.', '', 'داخل المحل، مسح الباركود من المنتج المطلوب.', 'Dentro da loja, escanear o código de barras do produto desejado.', 'Внутри магазина, сканировать штрих-код нужного продукта.', '店内に、所望の生成物のバーコードをスキャンします。', 'Im Laden scannen den Barcode des gewünschten Produktes.', 'A l´intérieur du magasin, scanner le code barre du produit désiré.', '가게 내부, 원하는 제품의 바코드를 스캔합니다.', 'All´interno del negozio, eseguire la scansione del codice a barre del prodotto desiderato.'),
(528, '然后加载所显示的价格和它的折扣。', 'Luego carga el precio exhibido y sus descuentos.', 'Then load the displayed price and its discounts.', '', 'ثم تحميل السعر المعروض والخصومات لها.', 'Em seguida, carregar o preço exibido e os seus descontos.', 'Затем загрузите отображаемую цену и свои скидки.', 'そして、表示された価格とその割引をロードします。', 'Dann laden Sie den angezeigten Preis und seine Rabatten.', 'Chargez ensuite le prix affiché et ses remises.', '그런 다음 표시 가격과 할인 혜택을로드합니다.', 'Poi caricare il prezzo indicato e le sue sconti.'),
(529, '直接可视化，其中最便宜的价格定位在地图上，并且知道你应该买。', 'Visualiza directamente en el mapa donde se encuentran los mejores precios, y sabe donde debes comprar.', 'Visualize directly on the map where the best prices are located, and know where you should buy.', '', 'تصور مباشرة على الخريطة حيث توجد أفضل الأسعار، وتعرف أين يجب عليك شراء.', 'Visualizar diretamente no mapa onde estão os melhores preços estão localizados, e saber onde você deve comprar.', 'Визуализируйте непосредственно на карте, где лучшие цены находятся, и знать, где вы должны купить.', '最高の価格が配置されている地図上に直接視覚化し、そしてあなたが買うべき場所を知っています。', 'Visualisieren Sie direkt auf der Karte, wo die besten Preise befinden und wissen, wo Sie kaufen sollten.', 'Visualiser directement sur la carte où les meilleurs prix sont situés, et savoir où vous devriez acheter.', '최적의 가격이있는지도를 직접 시각화 및 구입해야하는 위치 알고있다.', 'Visualizzare direttamente sulla mappa dove si trovano i prezzi migliori, e sapere dove si dovrebbe comprare.'),
(530, 'Nocprice密切协作，给用户提供了有关价格在不同的存储信息。', 'Nocprice funciona de manera colaborativa, dado que los usuarios aportan la información sobre los precios en los distintos comercios.', 'Nocprice works collaboratively, given that users provide information about prices in different stores.', '', 'يعمل Nocprice تعاوني، بالنظر إلى أن توفر للمستخدمين معلومات عن الأسعار في المتاجر المختلفة.', 'Nocprice trabalha em colaboração, uma vez que os usuários fornecem informações sobre preços em diferentes lojas.', 'Nocprice работает в тесном сотрудничестве, учитывая, что пользователи предоставляют информацию о ценах в различных магазинах.', 'Nocpriceは、ユーザーが別の店舗での価格についての情報を提供することを考えると、共同で動作します。', 'Nocprice arbeitet eng, da den Nutzern Informationen über die Preise in verschiedenen Geschäften.', 'Nocprice travaille en collaboration, étant donné que les utilisateurs fournissent des informations sur les prix dans différents magasins.', 'Nocprice 사용자가 다른 상점에서 가격에 대한 정보를 제공하는 것이 주어진, 협력하여 일하고 있습니다.', 'Nocprice collabora, dato che gli utenti forniscono informazioni sui prezzi in diversi negozi.'),
