(550, '您的付款并具有以下细节已成功处理：', 'Su pago fue procesado con el siguiente detalle:', 'Your Payment has been successfully processed with the following details:', '', 'وقد تم تجهيز الدفع بنجاح مع التفاصيل التالية:', 'O seu pagamento foi processado com sucesso com os seguintes detalhes:', 'Ваш платеж успешно обработан со следующими данными:', 'あなたのお支払いが成功し、次の詳細が処理されています。', 'Ihre Zahlung wurde mit folgenden Angaben erfolgreich verarbeitet:', 'Votre paiement a été traité avec succès avec les détails suivants:', '귀하의 지불이 성공적으로 다음과 같은 세부 사항을 처리하고있다 :', 'Il vostro pagamento è stato effettuato con successo con i seguenti dati:'),
