(564, 'Nocprice作品在全球超过11种语言。', 'Nocprice funciona en todo el mundo en más de 11 idiomas.', 'Nocprice works worldwide in more than 11 languages.', '', 'يعمل Nocprice في جميع أنحاء العالم في أكثر من 11 لغة.', 'Nocprice funciona em todo o mundo em mais de 11 idiomas.', 'Nocprice работает по всему миру в более чем 11 языках.', 'Nocpriceは、11の以上の言語で世界的に動作します。', 'Nocprice arbeitet weltweit in mehr als 11 Sprachen.', 'Nocprice travaille dans le monde entier dans plus de 11 langues.', 'Nocprice은 11 개 이상의 언어로 전 세계적으로 작동합니다.', 'Nocprice lavora in tutto il mondo in più di 11 lingue.'),
(565, '谢谢！你是第一个到的价格收取该产品，更多的用户将很快加入。', 'Muchas gracias! Eres el prímero en cargar un precio sobre este producto, pronto se sumarán más usuarios.', 'Thank you! You are the first to charge a price on this product, more users will soon be added.', '', 'شكرا! كنت أول من تهمة سعر على هذا المنتج، وسيتم قريبا إضافة المزيد من المستخدمين.', 'Obrigado! Você é o primeiro a cobrar um preço para este produto, em breve será adicionado mais usuários.', 'Спасибо! Ты первый, чтобы зарядить цену на этот продукт, скоро будет добавлено больше пользователей.', 'ありがとうございました！あなたがこの製品の価格を充電する最初のもので、より多くのユーザーはすぐに追加されます。', 'Danke! Sie sind der Erste, der einen Preis für dieses Produkt, mehr Nutzer in Kürze hinzugefügt werden aufzuladen.', 'Je vous remercie! Vous êtes le premier à payer un prix pour ce produit, plus les utilisateurs seront bientôt ajoutés.', '감사합니다! 당신이 제품에 가격을 책정 첫 번째이며, 더 많은 사용자가 곧 추가 될 예정입니다.', 'Grazie! Tu sei il primo a pagare un prezzo per questo prodotto, saranno presto aggiunti più utenti.'),
(566, '我们很抱歉', 'Lo sentimos', 'We are sorry', '', 'نحن اسفون', 'Nos desculpe', 'Мы сожалеем', '申し訳ありません', 'Es tut uns leid', 'Nous sommes désolés', '미안 해요', 'Ci dispiace'),
(567, '要加载超过5级的产品或服务，您必须订阅付费用户。欲了解更多信息，请在此输入XXXX', 'Para cargar mas de 5 productos o servicios debes suscribirte a usuarios premium. Para mas información ingresa aquí XXXX', 'To load more than 5 products or services you must subscribe to premium users. For more information enter here XXXX', '', 'لتحميل أكثر من 5 المنتجات أو الخدمات يجب الاشتراك للمستخدمين متميزة. لمزيد من المعلومات ادخل هنا XXXX', 'Para carregar mais de 5 produtos ou serviços que você deve se inscrever para usuários premium. Para mais informações entrar aqui XXXX', 'Чтобы загрузить более 5 товаров или услуг, вы должны подписаться на премиум пользователей. Для получения более подробной информации введите здесь XXXX', 'あなたはプレミアムユーザーに登録する必要があります以上の5つの製品やサービスをロードします。詳細については、ここで入力したXXXX', 'So laden Sie mehr als 5 Produkte oder Dienstleistungen, die Sie Premium Benutzer anmelden müssen. hier für weitere Informationen eingeben XXXX', 'Pour charger plus de 5 produits ou services que vous devez vous abonner aux utilisateurs Premium. Pour plus d´informations ici entrer XXXX', '당신이 고급 사용자에 가입해야 5 개 이상의 제품이나 서비스를로드합니다. 자세한 내용은 XXXX 여기에 입력', 'Per caricare più di 5 prodotti o servizi è necessario abbonarsi al utenti premium. Per ulteriori informazioni, inserisci XXXX'),
(568, 'Nocprice是让你购买之前评估价格的最佳工具。', 'Nocprice es la mejor herramienta para evaluar los precios antes de efectuar tus compras.', 'Nocprice is the best tool to evaluate prices before making your purchases.', '', 'Nocprice هو أفضل وسيلة لتقييم الأسعار قبل الشراء الخاصة بك.', 'Nocprice é a melhor ferramenta para avaliar os preços antes de fazer suas compras.', 'Nocprice является лучшим инструментом для оценки цены, прежде чем сделать свои покупки.', 'Nocpriceは、あなたの購入を行う前に、価格を評価するための最適なツールです。', 'Nocprice ist das beste Werkzeug Preise zu bewerten, bevor Sie Ihre Einkäufe.', 'Nocprice est le meilleur outil pour évaluer les prix avant de faire vos achats.', 'Nocprice은 구매하기 전에 가격을 평가하는 가장 좋은 도구입니다.', 'Nocprice è lo strumento migliore per valutare i prezzi prima di fare i vostri acquisti.'),
