(571, '成为我们社会的一部分', 'Forma parte de nuestra comunidad', 'Be part of our community', '', 'كن جزءا من مجتمعنا', 'Faça parte da nossa comunidade', 'Станьте частью нашего сообщества', '私たちのコミュニティの一部であります', 'Seien Sie Teil unserer Gemeinschaft', 'Faites partie de notre communauté', '우리 사회의 일부가 될', 'Essere parte della nostra comunità'),
(572, '分享与您的家人和朋友，您对我们的社交网络体验的最佳价格。', 'Compartí los mejores precios con tus familiares y amigos, y tu experiencia en nuestras redes sociales.', 'Share the best prices with your family and friends, and your experience in our social networks.', '', 'تبادل أفضل الأسعار مع عائلتك وأصدقائك، وتجربتك في الشبكات الاجتماعية.', 'Compartilhe os melhores preços com a sua família e amigos, e sua experiência em nossas redes sociais.', 'Поделитесь лучшие цены с вашей семьей и друзьями, и ваш опыт в наших социальных сетях.', 'あなたの家族や友人、そして私たちのソーシャルネットワークであなたの経験を持つ最高の価格を共有します。', 'Teilen Sie die besten Preise mit Ihrer Familie und Freunden, und Ihre Erfahrungen in unseren sozialen Netzwerken.', 'Partagez les meilleurs prix avec votre famille et vos amis, et votre expérience dans nos réseaux sociaux.', '가족과 친구, 그리고 우리의 소셜 네트워크에서의 경험과 최적의 가격을 공유 할 수 있습니다.', 'Condividere le migliori tariffe con la famiglia e gli amici, e la vostra esperienza nei nostri social network.'),
(573, '查看其他用户收取你的周围同样的产品价格。', 'Observa los precios del mismo producto cargados por otros usuarios a tus arrededores.', 'See the prices of the same product charged by other users to your surroundings.', '', 'انظر أسعار نفس المنتج من قبل مستخدمين آخرين المحملة على محيطك.', 'Veja os preços do mesmo produto cobrado por outros usuários ao seu redor.', 'Смотреть цены одного и того же продукта, порученных другими пользователями вашего окружения.', 'あなたの周囲に他のユーザーによって充電同じ製品の価格を参照してください。', 'Sehen Sie die Preise des gleichen von anderen Benutzern in Ihrer Umgebung geladen Produkts.', 'Voir les prix du même produit facturé par d´autres utilisateurs à votre environnement.', '주변에 다른 사용자가 부과되는 동일한 제품의 가격을 참조하십시오.', 'Vedere i prezzi dello stesso prodotto praticati da altri utenti per l´ambiente circostante.'),
