(647, '', 'A miles de km de distancia, con culturas, leyes y valores distintos lograr una operación transparente, clara y sencilla es fundamental. Las empresas de distintos tamaños, países y rubros pactan reglas de juego que no son las previstas por los organismos internacionales y requieren acuerdos documentados con las últimas tecnologías que garanticen la buena fe de las partes. Por eso Sistema con el módulo de Sistema Boarding logra documentar toda la operatoria desde el inicio de la negociación hasta llegar a su destino final, incluyendo las cuestiones logísticas, financieras, los peritajes y la gestión de los distintos riesgos.', '', '', '', '', '', '', '', '', '', ''),
(648, '', 'La gestión de la operación de comercio exterior en Sistema permite a las empresas tener toda la información en un solo lugar, notificando automaticamente a las partes vinculadas a la operación (exportador, importador, broker, trading company) de las necesidades de información y documentación, administrando los cambios de manera eficiente para el correcto desarrollo de la actividad.', '', '', '', '', '', '', '', '', '', ''),
(649, '', 'Sistema notificará sobre cada uno de los sucesos en las distintas etapas de la operación indicando a los distintos usuarios sobres aquellas acciones requeridas.', '', '', '', '', '', '', '', '', '', ''),
