(5, '05', 1, '其他动物产品', 'Otros productos de origen animal no expresados ni comprendidos en otra parte', 'Products of animal origin, not elsewhere specified or included', '', 'منتجات أخر من أصل حيوانى ، غير مذكورة ولا داخلة فى مكان أخر', 'Outros produtos de origem animal, não especificados nem compreendidos noutros capítulos', 'Продукты животного происхождения, в другом месте не поименованные или не включенные', '動物性生産品（他の類に該当するものを除く。）', 'Andere waren tierischen ursprungs, anderweit weder genannt noch inbegriffen', 'Autres produits d´origine animale, non dénommés ni compris ailleurs  ', '다른 류에 분류되지 아니한 동물성 생산품', 'Altri prodotti di origine animale, non nominati né compresi altrove'),
(6, '06', 2, '活植物、茎、根芽、插花、簇叶', 'Plantas vivas y productos de la floricultura', 'Live trees and other plants; bulbs, roots and the like; cut flowers and ornamental foliage', '', 'أشجار ونباتات أخرى حية ؛ أبصال وجذور وماشابهها ؛ أزهار مقطوفة وأغصان مورقة للزينة', 'Plantas vivas e produtos de floricultura', 'Деревья живые и другие растения; луковицы, корни и прочие аналогичные части растений; срезанные цветы и декоративная зелень', '生きている樹木その他の植物及びりん茎、根その他これらに類する物品並びに切花及び装飾用の葉', 'Lebende pflanzen und waren des blumenhandels', 'Plantes vivantes et produits de la floriculture ', '산 수목과 기타의 식물, 인경ㆍ뿌리와 이와 유사한 물품 및 절화(切花)와 장식용의 잎', 'Piante vive e prodotti della floricoltura'),
