(8, '08', 2, '食用水果及坚果；柑桔或甜瓜的果皮', 'Frutas y frutos comestibles; cortezas de agrios (cítricos), melones o sandías', 'Edible fruit and nuts; peel of citrus fruit or melons', '', 'فواكة وأثمار قشرية صالحة للأكل ؛ قشور حمضيات وقشور بطيخ أو شمام', 'Frutas; cascas de citrinos e de melões', 'Фрукты и орехи съедобные; кожура и корки цитрусовых или дынь', '食用の果実及びナット、かんきつ類の果皮並びにメロンの皮', 'Geniessbare früchte und nüsse; schalen von zitrusfrüchten oder von melonen', 'Fruits comestibles; écorces d´agrumes ou de melons  ', '식용의 과실 및 견과류와 감귤류 또는 멜론의 껍질', 'Frutta commestibili; scorze di agrumi o di meloni'),
