(12, '12', 2, '油籽；子仁；工业或药用植物；饲料', 'Semillas y frutos oleaginosos, semillas y frutos diversos, plantas industriales o medicinales, paja y forraje ', 'Oil seeds and oleaginous fruits; miscellaneous grains, seeds and fruit; industrial or medicinal plants ; straw and fodder', '', 'حبوب وأثمار زيتية ؛ حبوب وبذور أثمار منوعة ؛ نباتات للصناعة أو الطب ؛ قش وعلف', 'Sementes e frutos oleaginosos; grãos, sementes e frutos diversos; plantas industriais ou medicinais; palhas e forragens', 'Семена и плоды масличные, семена, плоды и зерно прочие, лекарственные растения и растения для технических целей; солома и фураж', '採油用の種及び果実、各種の種及び果実、工業用又は医薬用の植物並びにわら及び飼料用植物', 'Ölsamen und ölhaltige früchte; verschiedene samen und früchte; pflanzen zum gewerbe- oder heilgebrauch; stroh und futter', 'Graines et fruits oléagineux, graines, semences et fruits divers, plantes industrielles ou médicinales, pailles et fourrages  ', '채유용에 적합한 종자와 과실, 각종의 종자와 과실, 공업용 또는 의약용의 식물, 짚과 사료용 식물', 'Semi e frutti oleosi; semi, sementi e frutti diversi; piante industriali o medicinali; paglie e foraggi'),
(13, '13', 2, '虫胶；树胶、树脂及其他植物液、汁', 'Gomas, resinas y demás jugos y extractos vegetales', 'Lac, gums, resins and other vegetable saps and extracts', '', 'صمغ اللك ؛ صموغ وراتنجات وغيرها من عصارات وخلاصات نباتية', 'Gomas, resinas e outros sucos e extratos vegetais', 'Шеллак природный неочищенный; камеди, смолы и прочие растительные соки и экстракты', 'ラック並びにガム、樹脂その他の植物性の液汁及びエキス', 'Schellack; gummen, harze und andere pflanzensäfte und pflanzenauszüge', 'Gommes, résines et autres sucs et extraits végétaux.  ', '락ㆍ검ㆍ수지 및 기타의 식물성 수액과 엑스', 'Gomme, resine ed altri succhi ed estratti vegetali'),
