(20860, '0208.60', 2, '鲜、冷、冻骆驼及其他骆驼科动物的肉及食用杂碎', 'Carne fresca, refrigerada o congelada y despojos comestibles de camellos y otros camélidos [Camélidos]', 'Fresh, chilled or frozen meat and edible offal of camels and other camelids [Camelidae]', '', 'لحوم وأحشاء وأطراف أخر صالحة للأكل من جمال وحيوانات أخر من فصيلة الجمال، طازجة أو مبردة', 'Carnes e miudezas comestíveis, de camelos e outros camelídeos (camelidae), frescas, refrigeradas ou congeladas', 'Мясо и пищевые субпродукты верблюдов и прочих животных семейства верблюдовых (Camelidae), свежие, охлажденные или замороженные', '－ らくだ科のもの [ その他の肉及び食用のくず肉（生鮮のもの及び冷蔵し又は冷凍したものに限る。） ] ', 'Fleisch und genießbare Schlachtnebenerzeugnisse von Kamelen [Camelidae], frisch, gekühlt oder gefroren', 'Viandes et abats comestibles de chameaux et d´autres camélidés (Camélidés), frais, réfrigérés ou congelés', '그 밖의 육과 식용 설육(屑肉)(신선한 것, 냉장하거나 냉동한 것으로 한정한다)(낙타와 그 밖의 낙타과[카멜리대(Camelidae)과]의 것)', 'Altre carni e frattaglie commestibili, fresche, refrigerate o congelate - di cammelli e altri camelidi (Camelidae)'),
