(20910, '0209.10', 2, '未炼制或用其他方法提取的不带瘦肉的肥猪肉、猪脂肪，鲜、冷、冻、干、熏、盐腌或盐渍的', 'Manteca de cerdo, sin partes magras, sin fundir ni extraer de otro modo, frescos, refrigerados, congelados, salados o en salmuera, secos o ahumados', 'Pig fat, free of lean meat, not rendered or otherwise extracted, fresh, chilled, frozen, salted, in brine, dried or smoked', '', 'شحم من خنزيز ، غير مستخلص بالإذابة أو بطرق الاستخلاص الأخرى، طازجاً أو مبرداً أو مجمداً أو مملحاً أو في ماء مملح أو مجففاً أو مدخناً', 'Toucinho de porco sem partes magras e gorduras de porco , não fundidas nem extraídas de outro modo, frescos, refrigerados, congelados, salgados ou em salmoura, secos ou fumados', 'Свиной жир, отделенный от тощего мяса, не вытопленный или не извлеченный другим способом, свежий, охлажденный, замороженный, соленый, в рассоле, сушеный или копченый', '－ 豚のもの [ 家きんの脂肪及び豚の筋肉層のない脂肪（溶出その他の方法で抽出してないもので、生鮮のもの及び冷蔵し、冷凍し、塩蔵し、塩水漬けし、乾燥し又はくん製したものに限る。） ] ', 'Schweinespeck ohne magere Teile und Schweinefett, weder ausgeschmolzen noch anders ausgezogen, frisch, gekühlt, gefroren, gesalzen, in Salzlake, getrocknet oder geräuchert', 'Lard de porc sans parties maigres, graisse de porc non fondue ni autrement extraite, frais, réfrigérés, congelés, salés ou en saumure, séchés ou fumés', '살코기가 없는 돼지 비계와 가금(家禽)의 비계(기름을 빼지 않은 것이나 그 밖의 방법으로 추출하지 않은 것으로서 신선한 것·냉장하거나 냉동한 것·염장하거나 염수장한 것·건조하거나 훈제한 것으로 한정한다)(돼지의 것)', 'Lardo senza parti magre, grasso di maiale e grasso di volatili non fusi né altrimenti estratti, freschi, refrigerati, congelati, salati o in salamoia, essiccati o affumicati - di suini'),
