(21093, '0210.93', 2, '干、熏、盐腌或盐渍的爬行动物（包括蛇及龟鳖）的肉及食用杂碎', 'Carne y despojos comestibles, salados o en salmuera, secos o ahumados, así como harina y polvo comestibles de carne o de despojos, de reptiles, incl. las serpientes y tortugas de mar', 'Meat and edible offal, salted, in brine, dried or smoked, and edible flours and meals of meat and meat offal, of reptiles ´e.g. snakes, turtles, alligators´', '', 'لحوم وأحشاء وأطراف صالحة للأكل من زواحف بما فيها الثعابين و السلاحف', 'Carnes e miudezas comestíveis, salgadas ou em salmoura, secas ou fumadas, incluídas as farinhas e pós comestíveis, de répteis (incluindo serpentes e tartarugas do mar)', 'Мясо и пищевые мясные субпродукты рептилий (включая змей и черепах), соленые, в рассоле, сушеные или копченые; пищевая мука тонкого и грубого помола из мяса или мясных субпродуктов рептилий (включая змей и черепах)', '－－ 爬虫類のもの－ その他のもの（肉又はくず肉の食用の粉及びミールを含む。） [ 肉及び食用のくず肉（塩蔵し、塩水漬けし、乾燥し又はくん製したものに限る。）並びに肉又はくず肉の食用の粉及びミール ] ', 'Fleisch und genießbare Schlachtnebenerzeugnisse, gesalzen, in Salzlake, getrocknet oder geräuchert sowie genießbares Mehl von Fleisch und von Schlachtnebenerzeugnissen, von Reptilien ´z.B. Schlangen, Schildkröten, Alligatoren´', 'Viandes et abats comestibles, salés ou en saumure, séchés ou fumés; farines et poudres, comestibles, de viandes et d´abats, de reptiles [p.ex. serpents, tortues, alligators]', '육과 식용 설육(屑肉)(염장하거나 염수장한 것·건조하거나 훈제한 것으로 한정한다), 육이나 설육(屑肉)의 식용 고운 가루·거친 가루(기타[육이나 설육(屑肉)의 식용 고운 가루·거친 가루를 포함한다],파충류의 것(뱀과 거북을 포함한다))', 'Carni e frattaglie commestibili, salate o in salamoia, secche o affumicate; farine e polveri, commestibili, di carni o di frattaglie - altre, comprese le farine e le polveri commestibili, di carni o di frattaglie -- di rettili (compresi i serpenti e le tartarughe marine)'),
(21099, '0210.99', 2, '其他干、熏、盐腌或盐渍肉及食用杂碎，包括可供食用的肉或杂碎的细粉、粗粉', 'Carne y despojos comestibles, salados o en salmuera, secos o ahumados, y harina y polvo comestibles de carne y despojos (excepto los de la carne bovina y porcina y de carnes y despojos comestibles de primates, ballenas, delfines y marsopas ´mamíferos del orden Cetáceos ´, manatíes y dugongos´ mamíferos del orden Sirenios ´, focas, leones marinos y morsas´ mamíferos del suborden de pinnípedos ´, y reptiles)', 'Meat and edible offal, salted, in brine, dried or smoked, and edible flours and meals of meat and meat offal (excl. meat of bovine animals and swine and meat and edible offal of primates, whales, dolphins and porpoises ´mammals of the order Cetacea´, manatees and dugongs ´mammals of the order Sirenia´, seals, sea lions and walruses ´mammals of the suborder Pinnipedia´ and reptiles)', '', 'غيرها من لحوم وأحشاء وأطراف صالحة للأكل', 'Carnes e miudezas comestíveis, salgadas ou em salmoura, secas ou fumadas incluídas as farinhas e pós comestíveis (exceto de animais das espécies bovina e suína, de primatas, baleias, golfinhos e botos, manatins e dugongues e de répteis)', 'Мясо и пищевые мясные субпродукты животных, соленые, в рассоле, сушеные или копченые, пищевая мука тонкого и грубого помола из мяса или мясных субпродуктов (кроме мяса крупного рогатого скота или свиней и мяса или пищевых мясных субпродуктов приматов, китов, дельфинов, морских свиней (млекопитающих отряда Cetacea), ламантинов, дюгоней (млекопитающих отряда Sirenia), тюленей, морских львов, моржей (млекопитающих подотряда Pinnipedia) или рептилий)', '－－ その他のもの－ その他のもの（肉又はくず肉の食用の粉及びミールを含む。） [ 肉及び食用のくず肉（塩蔵し、塩水漬けし、乾燥し又はくん製したものに限る。）並びに肉又はくず肉の食用の粉及びミール ] ', 'Fleisch und genießbare Schlachtnebenerzeugnisse, gesalzen, in Salzlake, getrocknet oder geräuchert sowie genießbares Mehl von Fleisch und von Schlachtnebenerzeugnissen (ausg. Fleisch von Rindern und Schweinen sowie Fleisch und genießbare Schlachtnebenerzeugnisse von Primaten, Walen, Delphinen und Tümmlern ´Säugetiere der Ordnung Cetacea´, von Rundschwanzseekühen ´Manatis´ und Gabelschwanzseekühen ´Dugongs´ „Säugetiere der Ordnung Sirenia“, von Robben, Seelöwen und Walrossen „Säugetiere der Unterordnung Pinnipedia“ und von Reptilien)', 'Viandes et abats comestibles, salés ou en saumure, séchés ou fumés et farines et poudres comestibles de viandes ou d´abats (à l´excl. des viandes de porcins et bovins, des viandes et des abats comestibles de primates, baleines, dauphins et marsouins [mammifères de l’ordre des cétacés], de lamantins et dugongs [mammifères de l’ordre des siréniens], d´otaries et phoques, lions de mer et morses [mammifères du sous-ordre des pinnipèdes] ainsi que de reptiles)', '육과 식용 설육(屑肉)(염장하거나 염수장한 것·건조하거나 훈제한 것으로 한정한다), 육이나 설육(屑肉)의 식용 고운 가루·거친 가루(기타[육이나 설육(屑肉)의 식용 고운 가루·거친 가루를 포함한다],기타)', 'Carni e frattaglie commestibili, salate o in salamoia, secche o affumicate; farine e polveri, commestibili, di carni o di frattaglie - altre, comprese le farine e le polveri commestibili, di carni o di frattaglie -- altre'),
(30111, '0301.11', 3, '淡水观赏鱼', 'Peces ornamentales, de agua dulce, vivos', 'Live ornamental freshwater fish', '', 'أسماك حية للزينة من مياه عذبة', 'Peixes ornamentais, de água doce, vivos', 'Живая пресноводная декоративная рыба', '－－ 淡水魚－ 観賞用の魚 [ 魚（生きているものに限る。） ] ', 'Süßwasser-Zierfische, lebend', 'Poissons d´ornement d´eau douce, vivants', '활어(관상용,민물의 것)', 'Pesci vivi - Pesci ornamentali -- di acqua dolce');
